BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "music_genre" (
	"id"	INTEGER,
	"name"	varchar(256),
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "django_migrations" (
	"id"	integer NOT NULL,
	"app"	varchar(255) NOT NULL,
	"name"	varchar(255) NOT NULL,
	"applied"	datetime NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" (
	"id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_user_groups" (
	"id"	integer NOT NULL,
	"user_id"	integer NOT NULL,
	"group_id"	integer NOT NULL,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("group_id") REFERENCES "auth_group"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" (
	"id"	integer NOT NULL,
	"user_id"	integer NOT NULL,
	"permission_id"	integer NOT NULL,
	FOREIGN KEY("permission_id") REFERENCES "auth_permission"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "django_admin_log" (
	"id"	integer NOT NULL,
	"action_time"	datetime NOT NULL,
	"object_id"	text,
	"object_repr"	varchar(200) NOT NULL,
	"change_message"	text NOT NULL,
	"content_type_id"	integer,
	"user_id"	integer NOT NULL,
	"action_flag"	smallint unsigned NOT NULL CHECK("action_flag" >= 0),
	FOREIGN KEY("user_id") REFERENCES "auth_user"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "django_content_type" (
	"id"	integer NOT NULL,
	"app_label"	varchar(100) NOT NULL,
	"model"	varchar(100) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_permission" (
	"id"	integer NOT NULL,
	"content_type_id"	integer NOT NULL,
	"codename"	varchar(100) NOT NULL,
	"name"	varchar(255) NOT NULL,
	FOREIGN KEY("content_type_id") REFERENCES "django_content_type"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_group" (
	"id"	integer NOT NULL,
	"name"	varchar(150) NOT NULL UNIQUE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "auth_user" (
	"id"	integer NOT NULL,
	"password"	varchar(128) NOT NULL,
	"last_login"	datetime,
	"is_superuser"	bool NOT NULL,
	"username"	varchar(150) NOT NULL UNIQUE,
	"last_name"	varchar(150) NOT NULL,
	"email"	varchar(254) NOT NULL,
	"is_staff"	bool NOT NULL,
	"is_active"	bool NOT NULL,
	"date_joined"	datetime NOT NULL,
	"first_name"	varchar(150) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "django_session" (
	"session_key"	varchar(40) NOT NULL,
	"session_data"	text NOT NULL,
	"expire_date"	datetime NOT NULL,
	PRIMARY KEY("session_key")
);
CREATE TABLE IF NOT EXISTS "music_artist" (
	"id"	INTEGER,
	"name"	varchar(256),
	"pseudonym"	varchar(256),
	"type"	text,
	"biography"	text,
	"image"	text,
	"strMusicBrainzArtistID"	text,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "music_release" (
	"id"	INTEGER,
	"name"	varchar(256),
	"tracks"	INTEGER,
	"image"	text,
	"strMusicBrainzAlbumID"	text,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "music_playlist" (
	"id"	integer NOT NULL,
	"name"	varchar(255) NOT NULL,
	"tracks"	INTEGER,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "music_track" (
	"id"	INTEGER,
	"name"	varchar(512),
	"duration"	integer,
	"strMusicBrainzTrackID"	text,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "music_release_tracks" (
	"id"	integer NOT NULL,
	"release_id"	bigint NOT NULL,
	"track_id"	bigint NOT NULL,
	FOREIGN KEY("release_id") REFERENCES "music_release"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("track_id") REFERENCES "music_track"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "music_track_genre" (
	"id"	integer NOT NULL,
	"track_id"	bigint NOT NULL,
	"genre_id"	bigint NOT NULL,
	FOREIGN KEY("track_id") REFERENCES "music_track"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("genre_id") REFERENCES "music_genre"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "music_playlist_tracks" (
	"id"	integer NOT NULL,
	"playlist_id"	bigint NOT NULL,
	"track_id"	bigint NOT NULL,
	FOREIGN KEY("track_id") REFERENCES "music_track"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("playlist_id") REFERENCES "music_playlist"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "music_track_artists_old" (
	"id"	INTEGER NOT NULL,
	"track_id"	integer NOT NULL,
	"artist_id"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "music_track_artists" (
	"id"	INTEGER NOT NULL,
	"track_id"	bigint NOT NULL,
	"artist_id"	bigint NOT NULL,
	FOREIGN KEY("track_id") REFERENCES "music_track"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("artist_id") REFERENCES "music_artist"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
They achieved worldwide success following the release of their debut album Happy Nation in 1992. Later re-issued as The Sign, it was certified nine times platinum in the United States, and was the best-selling album of 1994. One of the most successful debut albums of all time, it was the first to produce three No. 1 singles on the Billboard Mainstream Top 40 chart: "All That She Wants", "The Sign" and "Don''t Turn Around".They continued to score hit singles throughout the 1990s, with songs such as "Beautiful Life", "Lucky Love", "Cruel Summer" and "Life Is a Flower". By 2002, they had sold a total of 30 million copies of their first four studio albums, making them the third most successful Swedish group of all time, after ABBA and Roxette.Despite being largely inactive since 2012, the group has never officially disbanded.  In the last decade, they have released a number of demo tracks; first via their Facebook page, then in 2015 on the compilation album Hidden Gems.  An expanded two-disc edition was included in the 2020 boxset All That She Wants: The Classic Collection. Jenny Berggren continues to perform the group''s hits in solo concerts around the world. 

=== Formation ===
