-4f235b67ad2b4.jpg">https://assets.fanart.tv/fanart/music/d4a1404d-e00c-4bac-b3ba-e3557f6468d6/artistbackground/ace-of-base-4f235b67ad2b4.jpg</thumb>','d4a1404d-e00c-4bac-b3ba-e3557f6468d6');
François sold some 70 million records during his career (and after his death) and was about to embark for the United States when he was accidentally electrocuted in March 1978 at age 39. Former French President Valéry Giscard d''Estaing is quoted as saying Claude François was, to him, "the French equivalent of The Beatles, meaning the great talent of a generation". The son of a French father and a Calabrian mother, Claude Antoine Marie François was born in Egypt, in the city of Ismaïlia, where his father, Aimé François (1908–1961), was working as a senior manager in the Anglo-French Suez canal company on the Suez Canal. In 1951, the job took the family to the city of Port Tewfik (now Suez Port). Claude had an older sister, Josette (born 1934), who wrote her memoirs in 2008.
