The eighth child of the Jackson family, Jackson made his professional debut in 1964 with his elder brothers Jackie, Tito, Jermaine, and Marlon as a member of the Jackson 5. Jackson began his solo career in 1971 while at Motown Records, and became a solo star with his 1979 album Off the Wall. His music videos, including those for "Beat It", "Billie Jean", and "Thriller" from his 1982 album Thriller, are credited with breaking racial barriers and transforming the medium into an art form and promotional tool. He helped propel the success of MTV and continued to innovate with videos on the albums Bad (1987), Dangerous (1991), and HIStory: Past, Present and Future, Book I (1995). Thriller became the best-selling album of all time, while Bad was the first album to produce five Billboard Hot 100 number-one singles.
From the late 1980s, Jackson became a figure of controversy and speculation due to his changing appearance, relationships, behavior and lifestyle.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-4fd5d6fe49b71.jpg">https://assets.fanart.tv/fanart/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-4fd5d6fe49b71.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-4fd5d6fe4969e.jpg">https://assets.fanart.tv/fanart/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-4fd5d6fe4969e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-50f26a8a34022.jpg">https://assets.fanart.tv/fanart/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-50f26a8a34022.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-4fd5d6fe43b00.jpg">https://assets.fanart.tv/fanart/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-4fd5d6fe43b00.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-4fd9f298c1394.jpg">https://assets.fanart.tv/fanart/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-4fd9f298c1394.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-50fbaa9b1b572.jpg">https://assets.fanart.tv/fanart/music/f27ec8db-af05-4f36-916e-3d57f91ecf5e/artistthumb/jackson-michael-50fbaa9b1b572.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="ht