Before forming Queen, May and Taylor had played together in the band Smile. Mercury was a fan of Smile and encouraged them to experiment with more elaborate stage and recording techniques. He joined in 1970 and suggested the name "Queen". Deacon was recruited in February 1971, before the band released their eponymous debut album in 1973. Queen first charted in the UK with their second album, Queen II, in 1974. Sheer Heart Attack later that year and A Night at the Opera in 1975 brought them international success. The latter featured "Bohemian Rhapsody", which stayed at number one in the UK for nine weeks and helped popularise the music video format.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0383dadf-2a4e-4d10-a46a-e9e041da8eb3/artistthumb/queen-4fd64d8582dad.jpg">https://assets.fanart.tv/fanart/music/0383dadf-2a4e-4d10-a46a-e9e041da8eb3/artistthumb/queen-4fd64d8582dad.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0383dadf-2a4e-4d10-a46a-e9e041da8eb3/artistthumb/queen-4fdc952a7e119.jpg">https://assets.fanart.tv/fanart/music/0383dadf-2a4e-4d10-a46a-e9e041da8eb3/artistthumb/queen-4fdc952a7e119.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0383dadf-2a4e-4d10-a46a-e9e041da8eb3/artistthumb/queen-515dd5c29548e.jpg">https://assets.fanart.tv/fanart/music/0383dadf-2a4e-4d10-a46a-e9e041da8eb3/artistthumb/queen-515dd5c29548e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/LoLJNW_G2ISZCVn0SE_bneVlJtY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-81013-1211978659.jpeg.jpg">https://img.discogs.com/kBO17UiZ1nch9-xu2HT6ZmQIlZ0=/595x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-81013-1211978659.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/SB1uYFek-blri8pJg238Aqxw1lc=/150x150/sm