=== Formation and early start (1997–1998) ===

Named after a joint-rolling technique, Toploader''s live career began playing with Coldplay and Muse in small venues across the UK. They later went on to support the likes of Paul Weller, Noel Gallagher, Tom Jones, Robbie Williams and Simple Minds. On 20 July 2000 they backed Bon Jovi at the original Wembley Stadium, becoming the last British band to play there before it was demolished and redeveloped.


=== Commercial success (1999–2001) ===
By 1998, Toploader were picked up by S2 Records, a subsidiary of Sony Music, and signed a six-album deal. On 7 May 1999, the band made their first live TV performance on TFI Friday, hosted by Chris Evans.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3bdf9667-3205-4c5b-865b-ca3bb33fc5ac/artistthumb/toploader-5a0f564820609.jpg">https://assets.fanart.tv/fanart/music/3bdf9667-3205-4c5b-865b-ca3bb33fc5ac/artistthumb/toploader-5a0f564820609.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3bdf9667-3205-4c5b-865b-ca3bb33fc5ac/artistthumb/toploader-5148b0781e788.jpg">https://assets.fanart.tv/fanart/music/3bdf9667-3205-4c5b-865b-ca3bb33fc5ac/artistthumb/toploader-5148b0781e788.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Lr71gIzWh6iMEMzHGFltotUifmo=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-251953-1331641390.jpeg.jpg">https://img.discogs.com/zMTG9fuWI_rkfo37-rfy3R2oYI4=/595x449/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-251953-1331641390.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/2o5b5HSYLNzJVJVsxz-EsF3ZG8g=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-251953-1150548535.jpeg.jpg">https://img.discogs.com/dL9iqseAh01TzeSIG4hyL6T6lwQ=/350x341/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-251953-1150548535.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/3bdf9667-3205-4c5b-865b-ca3bb33fc5ac/hdmusiclogo/toploader-535c318bae6b3.png">https://assets.fanart.tv/fanart/music/3bdf9667-3205-4c5b-865b-ca3bb33fc5ac/hdmusiclogo/toploader-535c318bae6b3.png</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/3bdf9667-3205-4c5b-865b-ca3bb33fc5ac/artistbackground/toploader-5a0f5571c19ee.jpg">https://assets.fanart.tv/fanart/music/3bdf9667-3205-4c5b-865b-ca3bb33fc5ac/artistbackground/toploader-5a0f5571c19ee.jpg</thumb>','3bdf9667-3205-4c5b-865b-ca3bb33fc5ac');
Twisted Sister evolved from a band named Silver Star, and experienced several membership changes before settling on a classic lineup consisting of Jay Jay French (guitars), Eddie "Fingers" Ojeda (guitars), Dee Snider (lead vocals), Mark "The Animal" Mendoza (bass), and A. J. Pero (drums) in 1982 which recorded four of the band''s first five albums. Twisted Sister''s first two albums, Under the Blade (1982)  and You Can''t Stop Rock ''n'' Roll (1983), were critically well-received and earned the band underground popularity. The band achieved mainstream success with their third album, Stay Hungry (1984), and its single "We''re Not Gonna Take It", which was their only Top 40 hit on the Billboard Hot 100. Their next two albums, Come Out and Play (1985) and Love Is for Suckers (1987) did not match the success of Stay Hungry. Twisted Sister disbanded in 1988.
The band briefly reunited in the late 1990s before permanently reforming in 2003. The band released two more albums: Still Hungry (2004), a rerecording of their third album, and the Christmas album, A Twisted Christmas. Following Pero''s death in 2015, the band embarked on a farewell tour and broke up again upon the tour''s completion in 2016.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c6122fee-089f-41c4-a34f-e5f7e5607b05/artistthumb/twisted-sister-50e9c6c5a7cf4.jpg">https://assets.fanart.tv/fanart/music/c6122fee-089f-41c4-a34f-e5f7e5607b05/artistthumb/twisted-sister-50e9c6c5a7cf4.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c6122fee-089f-41c4-a34f-e5f7e5607b05/artistthumb/twisted-sister-50f3c0ea92a28.jpg">https://assets.fanart.tv/fanart/music/c6122fee-089f-41c4-a34f-e5f7e5607b05/artistthumb/twisted-sister-50f3c0ea92a28.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/twAOyygEVVQwUu3KC5oQHGXtces=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-253057-1473529728-3981.jpeg.jpg">https://img.discogs.com/-W6bv_1mWDzGMkP4WgCUp3wwAGo=/600x428/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-253057-1473529728-3981.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/YdMZI7JxMC2OlaLlytWsph_NNIc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-253057-1522870184-1490.jpeg.jpg">https://img.discogs.com/q1QoMKftv_sdvA3EVYexVcZuPIU=/600x587/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-253057-1522870184-1490.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/oWm4hQrW2RjMg-jioUYulcd4_8E=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-253057-1427569215-9441.jpeg.jpg">https://img.discogs.com/2ARBkUA6