In the 1980s, Tyler ventured into rock music with songwriter and producer Jim Steinman. He wrote Tyler''s biggest hit "Total Eclipse of the Heart", the lead single from her 1983 UK chart-topping album Faster Than the Speed of Night. Steinman also wrote Tyler''s other major 1980s hit "Holding Out for a Hero". She had success in mainland Europe during the 1990s with Dieter Bohlen, who wrote and produced her hit "Bitterblue". In 2003, Tyler re-recorded "Total Eclipse of the Heart" with singer Kareen Antonn. Their bilingual duet, titled "Si demain... (Turn Around)", topped the French charts.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-53a4e3fe99613.jpg">https://assets.fanart.tv/fanart/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-53a4e3fe99613.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-53a4e44dd0864.jpg">https://assets.fanart.tv/fanart/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-53a4e44dd0864.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-542ebff6036cf.jpg">https://assets.fanart.tv/fanart/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-542ebff6036cf.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-4fdafe70d038a.jpg">https://assets.fanart.tv/fanart/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-4fdafe70d038a.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0aa8294b-6332-4b65-b677-e3a1f8591d3b/artistthumb/tyler-bonnie-542ebfca7e31a.jpg">https://assets.fanart.tv/fanart/music/0aa8294b-6332-4b65-b