Their next single "March of the Siamese Children" (Pye 7NJ.2051 – released February 1962), from The King and I, topped the pop music magazine New Musical Express''s chart on 9 March 1962, further hits followed and such was their popularity in the UK that Ball was featured, along with Cliff Richard, Brenda Lee, Joe Brown, Craig Douglas and Frank Ifield, on the cover of the New Musical Express in July 1962, although in the United States they remained a "one-hit wonder". Ball appeared with his jazz band in the 1962 British musical movie It''s Trad, Dad!, directed by Richard Lester.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/WSV2WFif-fikZwOjDgZgG1ft3EM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-279916-1148980012.jpeg.jpg">https://img.discogs.com/2EyDQ_oTMgMNM92YE7_uUc8bZH4=/483x343/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-279916-1148980012.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/3_aZegiG4TUsCGcaULP9EmgtMwc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-279916-1457205992-8750.jpeg.jpg">https://img.discogs.com/TjdaDIxlL-mSYzmae5bF8S8hfew=/322x503/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-279916-1457205992-8750.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/lsEql1PBXF8fvPKiUbBvxLnJJHQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-279916-1472645714-9237.jpeg.jpg">https://img.discogs.com/cnSxFpjG9fNccoYhXehasJPqH0g=/600x839/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-279916-1472645714-9237.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/iZXLIJA_4mBgJgYrjkMMsWKWHoQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-279916-1472645714-9277.jpeg.jp