Though their 1992 eponymous debut album failed to make an impact, its ska punk-inspired follow-up The Beacon Street Collection sold over 100,000 copies in 1995, over triple that of its predecessor. The band''s diamond-certified album Tragic Kingdom (1995) benefited from the resurgence of third-wave ska in the 1990s, and "Don''t Speak", the third single from the album, set a record when it spent 16 weeks at the number one spot on the Billboard Hot 100 Airplay chart. "Just a Girl", co-written by Stefani, was described as "the most popular cut on the CD".The group''s next album, Return of Saturn (2000), despite its Top 40 hit single "Simple Kind of Life", did not match the success of their previous album, but received critical praise and was nominated for Best Rock Album at the 43rd Grammy Awards. Fifteen months later, the band reappeared with the album Rock Steady (2001), which incorporated reggae and dancehall music into their work. The album was primarily recorded in Jamaica and featured collaborations with Jamaican artists Bounty Killer, Sly and Robbie, and Lady Saw. The album produced two Grammy-winning singles, "Hey Baby" and "Underneath It All". "Hella Good" was also nominated for a Grammy award.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/fbd2a255-1d57-4d31-ac11-65b671c19958/artistthumb/no-doubt-5067e7523ebed.jpg">https://assets.fanart.tv/fanart/music/fbd2a255-1d57-4d31-ac11-65b671c19958/artistthumb/no-doubt-5067e7523ebed.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/fbd2a255-1d57-4d31-ac11-65b671c19958/artistthumb/no-doubt-4fd5f83c5d263.jpg">https://assets.fanart.tv/fanart/music/fbd2a255-1d57-4d31-ac11-65b671c19958/artistthumb/no-doubt-4fd5f83c5d263.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/fbd2a255-1d57-4d31-ac11-65b671c19958/artistthumb/no-doubt-59ab1cc5b188a.jpg">https://assets.fanart.tv/fanart/music/fbd