A-ha achieved their biggest success with their debut album Hunting High and Low in 1985. The album peaked at number one in their native country Norway, number 2 in the UK, and number 15 on the US Billboard album chart; yielded two international number-one singles: "Take On Me" and "The Sun Always Shines on T.V."; and earned the band a Grammy Award nomination for Best New Artist. In the UK, Hunting High and Low continued its chart success into the following year, becoming one of the best-selling albums of 1986. The band released studio albums in 1986, 1988, and 1990, with single hits including "Hunting High and Low", "The Living Daylights", "Stay on These Roads", and "Crying in the Rain". In 1994, after their fifth studio album, Memorial Beach (1993), failed to achieve the commercial success of their previous albums, the band went on hiatus.Following a performance at the Nobel Peace Prize Concert in 1998, A-ha recorded their sixth album, 2000''s Minor Earth Major Sky, which was another number-one album in Norway and Germany. This album was followed by Lifelines (2002); Analogue (2005), which was certified Silver in the UK; and Foot of the Mountain (2009), which was certified Silver in the UK and reached the top five in many European countries.On 15 October 2009, the band announced they would split after the 2010 worldwide Ending on a High Note Tour. Thousands of fans from at least 40 countries on six continents congregated to see A-ha for the last leg of the tour.On 4 December 2014, A-ha officially announced its participation at Rock in Rio 2015, which celebrated 30 years for both the band and the event. In 2015, it was announced that A-ha would reunite; their tenth studio album, Cast in Steel, was released on 4 September 2015, and the band toured in support of the album.The band has released ten studio albums, several compilations and four live albums.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/7364dea6-ca9a-48e3-be01-b