English singer-songwriter, composer and pianist, born March 25, 1947, Pinner, Middlesex.
Elton John has been one of the dominant forces in rock and popular music, especially during the 1970s. He has sold over 200 million records, making him one of the most successful artists of all time. He has more than 50 Top 40 hits including seven consecutive No. 1 U.S. albums, 59 Top 40 singles, 16 Top 10, four No. 2 hits, and nine No. 1 hits. He has won five Grammy awards and two Academy Award. His success has had a profound impact on popular music and has contributed to the continued popularity of the piano in rock and roll.

