After signing with Hollywood Records, Lovato released their pop rock debut album, Don''t Forget (2008), which debuted at number two on the Billboard 200. Its follow-up, Here We Go Again (2009), debuted at number one in the U.S., while its title track reached number 15 on the Hot 100. Lovato''s third studio album, Unbroken (2011), experimented with pop and R&B and spawned the U.S. platinum-certified single "Skyscraper". They released their eponymous fourth album in 2013, which debuted at number three on the Billboard 200, and contained the top-ten international hit "Heart Attack". For their fifth and sixth albums, Confident (2015) and Tell Me You Love Me (2017), Lovato infused soul and mature themes; they earned a Grammy Award nomination for Confident, while "Sorry Not Sorry", the lead single from Tell Me You Love Me, became their highest-charting single in the U.S., reaching number six. After a period of hiatus, Lovato released their seventh album, Dancing with the Devil... the Art of Starting Over (2021), which reached number two on the Billboard 200.
On television, Lovato has starred as the titular character on the sitcom Sonny with a Chance (2009–2011), served as a judge on the music competition series The X Factor USA for its second and third seasons, and appeared as a recurring character on the musical comedy Glee (2013–2014) and the sitcom Will & Grace (2020).','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/faf4cefb-036c-4c88-b93a-5b03dd0a0e6b/artistthumb/lovato-demi-568f50eb566fc.jpg">https://assets.fanart.tv/fanart/music/faf4cefb-036c-4c88-b93a-5b03dd0a0e6b/artistthumb/lovato-demi-568f50eb566fc.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/faf4cefb-036c-4c88-b93a-5b03dd0a0e6b/artistthumb/lovato-demi-503fc3e3e23b9.jpeg">https://assets.fanart.tv/fanart/music/faf4cefb-036c-4c88-b93a-5b03dd0a0e6b/artistthumb/lovato-demi-503fc3e3e23b9.jpeg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/faf4cefb-036c-4c88-b93a-5b03dd0a0e6b/artistthumb/lovato-demi-55cfa2cf59b50.jpeg">https://assets.fanart.tv/fanart/music/faf4cefb-036c-4c88-b93a-5b03dd0a0e6b/artistthumb/lovato-demi-55cfa2cf59b50.jpeg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ruwUhucH3jl5sZXIYiZ82uRifrM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1181524-1617462034-8577.jpeg.jpg">https://img.discogs.com/ytAyOVWrm843rx8hF7_4vs5EIW4=/600x899/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1181524-1617462034-8577.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/gXcM-DLSsksmpaaejl-IVQs7XwE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1181524-1617346061-3059.jpeg.jpg">https://img.discogs.com/iH9784GpA91elhVD0s4UCqRm4e8=/300x300/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1181524-1617346061-3059.jpeg.jpg