Muse released their debut album, Showbiz, in 1999, showcasing Bellamy''s falsetto and a melancholic alternative rock style. Their second album, Origin of Symmetry (2001), incorporated wider instrumentation and romantic classical influences, featured their acclaimed cover of "Feeling Good", and earned them a reputation for energetic live performances. Absolution (2003) saw further classical influence, with strings on tracks such as "Butterflies and Hurricanes", and was the first of six consecutive UK number-one albums.
Black Holes and Revelations (2006) incorporated electronic and pop elements, displayed in singles such as "Supermassive Black Hole", and brought Muse wider international success. The Resistance (2009) and The 2nd Law (2012) explored themes of government oppression and civil uprising and cemented Muse as one of the world''s major stadium acts. Rolling Stone stated the band possessed "stadium-crushing songs". Topping the US Billboard 200, their seventh album, Drones (2015), was a concept album about drone warfare and returned to a harder rock sound. Their eighth album, Simulation Theory (2018), prominently featured synthesisers and was influenced by science fiction and the simulation hypothesis.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-54ab2cbd530ec.jpg">https://assets.fanart.tv/fanart/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-54ab2cbd530ec.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-4fd51a31102fa.jpg">https://assets.fanart.tv/fanart/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-4fd51a31102fa.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-53e9963ab0d7d.jpg">https://assets.fanart.tv/fanart/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-53e9963ab0d7d.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-5b8c32723d74f.jpg">https://assets.fanart.tv/fanart/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-5b8c32723d74f.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/9c9f1380-2516-4fc9-a3e6-f9f61941d090/artistthumb/muse-5376d617c101f.jpg">https://assets.fanart.