The band adopted retro styles covering several decades of popular music. They have also performed numerous covers of popular songs, including War''s "Why Can''t We Be Friends?", Simple Minds'' "Don''t You (Forget About Me)", ? & the Mysterians'' "Can''t Get Enough of You Baby", the Beatles'' "Getting Better", and "I Wan''na Be Like You" from The Jungle Book. They also composed 2 songs for the South Korean animated film Pororo, The Racing Adventure: "Beside Myself" and "Everything Just Crazy". 

=== 1990–97: Formation and Fush Yu Mang ===
Smash Mouth''s roots trace back to 1990 when Steve Harwell and Kevin Coleman met. Smash Mouth was then formed in 1994 by Harwell, who had formerly played in a rap group called F.O.S. (Freedom of Speech). Coleman, who was Harwell''s manager, knew guitarist Greg Camp and bassist Paul De Lisle, who had both played in a local punk band, and introduced the three musicians to each other.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/944e1036-8a03-4611-8aa0-31515a05c848/artistthumb/smash-mouth-514efad1f3074.jpg">https://assets.fanart.tv/fanart/music/944e1036-8a03-4611-8aa0-31515a05c848/artistthumb/smash-mouth-514efad1f3074.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/LFodjfmlwvC_lpkR865YAwMh26o=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-90040-1268189094.jpeg.jpg">https://img.discogs.com/gf0wx73xN3pNY4zGWxBOx7fLNZs=/599x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-90040-1268189094.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/4vl0D_nqZq9Rqgr_9HwJIlgCuYc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-90040-1097353073.jpg.jpg">https://img.discogs.com/PmSvZdztiWR0ZOzGBRvfthDFSrM=/400x266/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-90040-1097353073.jpg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/4LneNZ-8cq49-l-RJbTEKO8r7JE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-90040-1119791271.jpg.jpg">https://img.discogs.com/RlnXHWyu4QzlHdXhfhbt0IU9noc=/292x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-90040-1119791271.jpg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/QHt59b8tc0O23DnUx-iPAJfOAbs=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb(