In June 2008, McCartney''s official website announced that a track called "Lifelong Passion (Sail Away)", from the album Electric Arguments, would be issued as a limited-edition download to fans who donated to the charity Adopt-A-Minefield. The album was released on the label One Little Indian on 24 November 2008. The new album features more traditional songs, in which there are vocals (the first time on any of their albums). The majority of the album''s vocals come from McCartney. In February 2009, Sirius XM launched Fireman Radio, a limited-run channel dedicated to the music of the group.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Gsd16ANCAFPnE8_MexsrI0jdMS4=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-105069-1275646637.jpeg.jpg">https://img.discogs.com/7HvEVizKRPOXXxGqAToSIhs3OVI=/574x326/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-105069-1275646637.jpeg.jpg</thumb>','23466b9d-f57a-4e73-906f-c11dca8b3723');
Perry rose to fame in 2008 with her second album, One of the Boys, a pop rock record containing the controversial U.S number one song "I Kissed a Girl" and "Hot n Cold". Three subsequent albums have topped the U.S. Billboard 200. The disco-influenced Teenage Dream (2010) spawned five chart-topping U.S. Billboard Hot 100 singles–"California Gurls", "Teenage Dream", "Firework", "E.T.", and "Last Friday Night (T.G.I.F.)" — a record tying her with Michael Jackson''s Bad. Its follow-up record Prism (2013) was inspired by her divorce, and incorporates pop and dance along with themes of self-reflection, everyday life, and relationships.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-4fc6a4eddc2ef.jpg">https://assets.fanart.tv/fanart/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-4fc6a4eddc2ef.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-4fd0ab2f9d701.jpg">https://assets.fanart.tv/fanart/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-4fd0ab2f9d701.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-4fd0ab2fa30c2.jpg">https://assets.fanart.tv/fanart/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-4fd0ab2fa30c2.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-5452e50d3ada3.jpg">https://assets.fanart.tv/fanart/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-5452e50d3ada3.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/122d63fc-8671-43e4-9752-34e846d62a9c/artistthumb/perry-katy-4fd0ab2fa2c19.jpg">https://assets.fanart.tv/fanart/m