Within the last decade the band played about 1500 concerts all over the world and is with its numerous awards and Chart Positions among the internationally most successful German Jazz Bands.Their style is a composition of (cit. Quadro Nuevo) "Tango, Valse Musette, Flamenco, lovely dedusted filmmusic and an almost faded Italy".
