At the World Soundtrack Awards, Britell was awarded Film Composer of the Year in 2019 for his scores for Vice and If Beale Street Could Talk and Television Composer of the Year in 2020 for Succession. His works, as described by Soraya McDonald of Film Comment, "seem to organically straddle accessibility and sophistication in a way that goes beyond the typical programming of a big-city pops orchestra...That might have something to do with the fact that Britell has long had one foot in the world of hip-hop and another in the world of classical music." Britell was raised in a Jewish family, in New York City. He graduated from the college preparatory school, Hopkins School, in 1999. Britell is a graduate of the Juilliard School''s Pre-College Division and a Phi Beta Kappa graduate of Harvard University in 2003.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/eLDx5MJ7d_-PiExPcL_UacgJguE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4305950-1481724178-1123.jpeg.jpg">https://img.discogs.com/AOgvup3xVIMfYfaLxZD8BYInzZs=/527x680/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4305950-1481724178-1123.jpeg.jpg</thumb>','afa80039-cd8a-47ae-947e-538df896586f');
After previous iterations of the group called the Polka Tulk Blues Band and Earth, the band settled on the name Black Sabbath in 1969. They distinguished themselves through occult themes with horror-inspired lyrics and down-tuned guitars. Signing to Philips Records in November 1969, they released their first single, "Evil Woman" in January 1970. Their debut album, Black Sabbath, was released the following month. Though it received a negative critical response, the album was a commercial success, leading to a follow-up record, Paranoid, later in 1970. The band''s popularity grew, and by 1973''s Sabbath Bloody Sabbath, critics were starting to respond favourably.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-sabbath-4ffece80888f8.jpg">https://assets.fanart.tv/fanart/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-sabbath-4ffece80888f8.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-sabbath-4ffece808935e.jpg">https://assets.fanart.tv/fanart/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-sabbath-4ffece808935e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-sabbath-542473f6e996d.jpg">https://assets.fanart.tv/fanart/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-sabbath-542473f6e996d.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-sabbath-52a675f1650ec.jpg">https://assets.fanart.tv/fanart/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-sabbath-52a675f1650ec.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5182c1d9-c7d2-4dad-afa0-ccfeada921a8/artistthumb/black-s