Marvel first realized this gift when he became aware of the Canadian rap artist''s tendency to ''Americanize'' their sound. Witnessed in his first ever appearance on vinyl, the seminal Canadian classic "Hate Runs Deep," Marvel writes and spits with a highly animated and pictorial style, often rhyming about issues that affect the underprivileged on a daily basis. Not surprisingly, the song won him a MuchMusic Award for Best Rap/Hip-Hop Video in 1996. The summer of that year spawned the white-labeled classic, "Wordz of" which garnered international critical acclaim, and the "Make It Happen" tour in June to promote the record. 

Marvel continued to develop and challenge himself. Between 1997 and 200, Marvel appeared on every major compilation released from Canada. The first of these was the 1998 release "Beat Factory, vol.2" featuring the banger, "Shituations," and Mastermind''s "50 Legal." "Planet Mars," a vinyl compilation released in early 1999, featured Marvel''s first production venture with Kardinal Offishall''s "Rhyme, Shine, and Buss," the compilation''s first and only 12 inch single, and the track "Conversation" featuring himself, Solitair, and Choclair. 1999 also spawned Da Grassroots'' classic "Passage Through Time" with the Marvel single "Last Days." 

1995-2000 proved to be an exceptional period for Marvel as well as Canadian hip-hop. It was during this time the country''s musicians really began to showcase their talents internationally as well as at home. Marvel knew he had to follow-up with the buzz he helped create over the years over compilations features. Rather than appearing on a track as a guest feature, he sought his own path and decided to release his own material. Beginning his own record-releasing outfit, JamDone Entertainment, Marvel released the 12 inch, "Throw This Ball," featuring former Circle members Tara Chase and Solitair. The project also included the track, "Red Light District," which was featured on the CBC series, "Drop The Beat" featuring Michie Mee and was in syndication for 2 years before its termination. 

Marvel has shared the stage with hip-hop luminaries such as: OutKast at the Opera House in 1996, Gangstarr at the Guvernment in 1998, Common in 1997, Busta Rhymes in 1997, Lauryn Hill in 1999, The Roots at the Opera House in 1995 and 1996, Wyclef Jean at "Club Industry in 1997, Talib Kweli at the Opera House in 2000, Slum Village at the Comfort Zone in 1999, and De La Soul. He has also toured with the like of k-os, Rascalz, Kardinal Offishall, Saukrates, Thrust, IRS, and Brassmunk in 2001 for Kardinal''s "Firestarter Tour" released off his former label,MCA/Universal. Marvel is a seasoned and experienced performer who has a proven track record of solid and highly entertaining shows, touching down from Whistler, B.C., to North Preston, Halifax.','','34bba430-a0a2-4196-96ff-89dd179031de');
Williams released his debut solo album, In My Mind, in 2006. In 2013, he was featured on the song "Blurred Lines" with Robin Thicke and T.I., and his song "Happy" was the lead single for the soundtrack of the film Despicable Me 2. In the same year, he was featured on Daft Punk''s single "Get Lucky", which won Record of the Year and Best Pop Duo/Group Performance at the 56th Grammy Awards. His second album, Girl, was released in 2014.Williams has received numerous accolades and nominations. He has won 13 Grammy Awards, including three for Producer of the Year, Non-Classical (one as a member of The Neptunes). He is also a two-time Academy Award nominee: in 2014 for Best Original Song, for "Happy" (from Despicable Me 2); and in 2017 for Best Picture, as a producer of Hidden Figures. Williams was born in Virginia Beach, Virginia, on April 5, 1973, the eldest of the three sons of teacher Carolyn and handyman Pharoah Williams.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/149f91ef-1287-46da-9a8e-87fee02f1471/artistthumb/williams-pharrell-53f79b819d917.jpg">https://assets.fanart.tv/fanart/music/149f91ef-1287-46da-9a8e-87fee02f1471/artistthumb/williams-pharrell-53f79b819d917.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/149f91ef-1287-46da-9a8e-87fee02f1471/artistthumb/williams-pharrell-53fbe85e829f7.jpg">https://assets.fanart.tv/fanart/music/149f91ef-1287-46da-9a8e-87fee02f1471/artistthumb/williams-pharrell-53fbe85e829f7.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/149f91ef-1287-46da-9a8e-87fee02f1471/artistthumb/williams-pharrell-55d2dad934959.jpeg">https://assets.fanart.tv/fanart/music/149f91ef-1287-46da-9a8e-87fee02f1471/artistthumb/williams-pharrell-55d2dad934959.jpeg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/149f91ef-1287-46da-9a8e-87fee02f1471/artistthumb/williams-pha