Born in Birkenhead, England, Egerton began acting at age 15 and graduated from the Royal Academy of Dramatic Art in 2012. He gained recognition for his starring role as a spy recruit in the action comedy film Kingsman: The Secret Service (2014) and its sequel Kingsman: The Golden Circle (2017). He has also starred in several biographical films, portraying military officer Edward Brittain in the drama Testament of Youth (2014), the titular ski-jumper in the sports film Eddie the Eagle (2016), and singer Elton John in the musical Rocketman (2019), the lattermost of which earned him the Golden Globe Award for Best Actor – Motion Picture Musical or Comedy. Egerton was born on 10 November 1989 in Birkenhead, Merseyside. His mother worked in social services, while his father ran a bed-and-breakfast near Liverpool, both of them being Liverpool natives. Although born in England, Egerton considers himself to be Welsh "through and through" and is fluent in both Welsh and English. His first name is a variation of taran, which means "thunder" in Welsh. He has two younger half-sisters.Egerton''s parents divorced when he was two, and he subsequently moved with his mother to the Welsh island of Anglesey, where he went to primary school.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3c17c228-b4f2-485a-9d7c-ada98d9662dd/artistthumb/egerton-taron-5cdf7283cdc29.jpg">https://assets.fanart.tv/fanart/music/3c17c228-b4f2-485a-9d7c-ada98d9662dd/artistthumb/egerton-taron-5cdf7283cdc29.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/1r6MHSYD_Vup2dNWemwW8D52IfQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4948866-1556196702-4722.jpeg.jpg">https://img.discogs.com/Udmkxpk8zqw4mjkpqvVqcAq5_j8=/600x500/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4948866-1556196702-4722.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/hMKhKeAhgLo_0-B9YKICdcLQeUI=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4948866-1460637783-7227.jpeg.jpg">https://img.discogs.com/tHwMbZD9N6F_8d8YFOBuLj79iAo=/550x550/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4948866-1460637783-7227.jpeg.jpg</thumb>','3c17c228-b4f2-485a-9d7c-ada98d9662dd');

=== Film scoring ===
Bates began his career in the 1990s scoring low-budget films like Tammy and the T-Rex, The Last Time I Committed Suicide, and Denial. His breakthrough into the mainstream arguably came in the early 2000s, when he worked on higher-profile projects like Get Carter, Half Past Dead, and Baadasssss! The 2004 remake of Dawn of the Dead was significant, as he would maintain long-term collaborations with its director Zack Snyder, and writer James Gunn.
Bates scored four of director Rob Zombie''s films, beginning with 2005''s The Devil''s Rejects. For Zombie''s remake of Halloween and its subsequent sequel, Bates adapted John Carpenter''s original themes and motifs in order to fit the darker, grittier, and more contemporary atmosphere of the films. It was around 2007 that Bates began working regularly on big-budget, blockbuster films; including 300, Doomsday, The Day the Earth Stood Still, Sucker Punch, and Conan the Barbarian.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/03cfec4a-9885-444c-9e74-5fbab5861106/artistthumb/bates-tyler-50cbe74c5ae97.jpg">https://assets.fanart.tv/fanart/music/03cfec4a-9885-444c-9e74-5fbab5861106/artistthumb/bates-tyler-50cbe74c5ae97.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/PJd-UrOcj4EMfCOxtvbadagC5W0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-168946-1454381420-9972.jpeg.jpg">https://img.discogs.com/jiK-rydaebCeq8GEMGwqdcTZ1nk=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-168946-1454381420-9972.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/DYou4RrnJB3qxXAnQt85RAQ5U-o=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-168946-1454381420-6201.jpeg.jpg">https://img.discogs.com/VMl3e9CiP83uo2iXD2bUXE3dLe4=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-168946-1454381420-6201.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/jY6b2io9_o5mc85nZI7BGPYLIx8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-168946-1454381420-4709.jpeg.jpg">https://img.discogs.com/8GkWzMiL9ndkbGHa096IVUwokdY=/600x339/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-168946-1454381420-4709.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/UQ6h_NyVrp76u_MRNYrszSCciPg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-168946-1243673096.jpeg.jpg">https://img.discogs.com/AztGEunaL7H7A9zFenBHpxySrLo=/350x437/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-168946-1243673096.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/03cfec4a-9885-444c-9e74-5fbab5861106/hdmusiclogo/bates-tyler-5a955a7f79d2a.png">https://assets.fanart.tv/fanart/music/03cfec4a-9885-444c-9e74-5fbab5861106/hdmusiclogo/bates-tyler-5a955a7f79d2a.png</thumb>','03cfec4a-9885-444c-9e74-5fbab5861106');
His composition for the film Last Call earned him the first of three Emmy nominations, a gold record, and was inducted into the music branch of the Academy of Motion Picture Arts and Sciences. As of November 2017, his films have grossed $12 billion worldwide which puts him in to the top 10 highest-grossing film composers of all time in the category of worldwide box office. Tyler was born and raised in Orange County, California.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-5521bd016894e.jpg">https://assets.fanart.tv/fanart/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-5521bd016894e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-552636a209216.jpg">https://assets.fanart.tv/fanart/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-552636a209216.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-5525a5fda4b76.jpg">https://assets.fanart.tv/fanart/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-5525a5fda4b76.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-5521bf2d7b985.jpg">https://assets.fanart.tv/fanart/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-5521bf2d7b985.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-5521bf2d7bef4.jpg">https://assets.fanart.tv/fanart/music/23d89243-79c9-4afc-8db5-fce27e7ba78d/artistthumb/tyler-brian-5521bf2d7bef4.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/23d89243-79c9-4afc