rian-5521be20a12f4.jpg</thumb>','23d89243-79c9-4afc-8db5-fce27e7ba78d');
Mothersbaugh came to prominence in the late 1970s as co-founder, lead singer, keyboardist of the new wave band Devo, whose "Whip It" was a Top 20 single in the US in 1980 and which has since maintained a cult following. Mothersbaugh is one of the main composers of Devo''s music.
In addition to his work with Devo, Mothersbaugh has made music for television series, films and video games via his production company, Mutato Muzika. He composed the music for the 13-year run of the animated series Rugrats and its three related theatrical films. As a solo musician, Mothersbaugh has released four studio albums: Muzik for Insomniaks, Muzik for the Gallery, Joyeux Mutato and The Most Powerful Healing Muzik in the Entire World.
In 2004, he received the Richard Kirk award at the BMI Film and TV Awards for his contributions to film and television music. In 2008, Mothersbaugh received an honorary doctorate of humane letters from Kent State University, his alma mater.His lifelong interest in creating multimedia art pieces has resulted in gallery exhibitions of items such as his "Beautiful Mutants" photograph series, postcard diaries, art rugs, sculptures and musical instruments created from salvaged organ pipes and bird vocalizations. He has married twice and is the father of two adopted children. Mark Allen Mothersbaugh was born on May 18, 1950, in Akron, Ohio.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/6ff5f720-9fcd-434c-8a62-dc9dd123bde7/artistthumb/mothersbaugh-mark-50316f505d830.jpg">https://assets.fanart.tv/fanart/music/6ff5f720-9fcd-434c-8a62-dc9dd123bde7/artistthumb/mothersbaugh-mark-50316f505d830.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/6ff5f720-9fcd-434c-8a62-dc9dd123bde7/artistthumb/mothersbaugh-mark-5527d19445838.jpg">https://assets.fanart.tv/fanart/music/6ff5f720-9fcd-434c-8a62-dc9dd123bde7/artistthumb/mothersbaugh-mark-5527d19445838.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/6ff5f720-9fcd-434c-8a62-dc9dd123bde7/artistthumb/mothersbaugh-mark-5527d1b33ccc3.jpg">https://assets.fanart.tv/fanart/music/6ff5f720-9fcd-434c-8a62-dc9dd123bde7/artistthumb/mothersbaugh-mark-5527d1b33ccc3.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/6ff5f720-9fcd-434c-8a62-dc9dd123bde7/artistthumb/mothersbaugh-mark-5527d2441aea5.jpg">https://assets.fanart.tv/fanart/music/6ff5f720-9fcd-434c-8a62-dc9dd123bde7/artistthumb/mothersbaugh-mark-5527d2441aea5.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/br32PoyageQab8sNMFc-S2r30Zc=/150x150/smart/filters:strip_icc():for