Brubeck experimented with time signatures throughout his career, recording "Unsquare Dance" in 74, "World''s Fair" in 138, and "Blue Rondo à la Turk" in 98. He was also a composer of orchestral and sacred music and wrote soundtracks for television, such as Mr. Broadway and the animated miniseries This Is America, Charlie Brown.
Often incorrectly attributed to Brubeck, the song "Take Five", which has become a jazz standard, was composed by Brubeck''s long-time musical partner, alto saxophonist Paul Desmond. Appearing on one of the top-selling jazz albums, Time Out, and written in 54 time, "Take Five" has endured as a jazz classic associated with Brubeck. Dave Brubeck was born in the San Francisco Bay Area city of Concord, California, and grew up in a city located in the Mother Lode called Ione, California.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/de0222a6-e1c4-403d-8b01-3f66d505061b/artistthumb/brubeck-dave-53a87b2c4a554.jpg">https://assets.fanart.tv/fanart/music/de0222a6-e1c4-403d-8b01-3f66d505061b/artistthumb/brubeck-dave-53a87b2c4a554.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/de0222a6-e1c4-403d-8b01-3f66d505061b/artistthumb/brubeck-dave-53a87bda0447a.jpg">https://assets.fanart.tv/fanart/music/de0222a6-e1c4-403d-8b01-3f66d505061b/artistthumb/brubeck-dave-53a87bda0447a.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/de0222a6-e1c4-403d-8b01-3f66d505061b/artistthumb/brubeck-dave-50603269ada7d.jpg">https://assets.fanart.tv/fanart/music/de0222a6-e1c4-403d-8b01-3f66d505061b/artistthumb/brubeck-dave-50603269ada7d.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/de0222a6-e1c4-403d-8b01-3f66d505061b/artistthumb/brubeck-dave-50603270e9479.jpg">https://assets.fanart.tv/fanart/music/de0222a6-e1c4-403d-8b01-3f66d505061b/artistthumb/brubeck-dave-50603270e9479.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/nsa6miyrsiFrN0CMKUw5P6X61Nw=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-37737-1158057444.jpeg.jpg">https://img.discogs.com/9In2NlKn3av3TG_WkM5UJbqw2VM=/500x519/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(