Jett has a mezzo-soprano vocal range. She has three albums that have been certified platinum or gold. She has been described as the Queen of Rock ''n'' Roll. In 2015, Joan Jett & the Blackhearts were inducted into the Rock and Roll Hall of Fame.Jett lives in Long Beach, New York, and has been a New York resident since the late 1970s. Joan Marie Larkin was born on September 22, 1958, to James and Dorothy Larkin, at Lankenau Hospital in Wynnewood, Pennsylvania, a suburb of Philadelphia (although some sources list her birth date as September 22, 1960, which is incorrect). She is the oldest of three children.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/46e63d3b-d91b-4791-bb73-e9f638a45ea0/artistthumb/jett-joan-and-blackhearts-the-5110a559a01b8.jpg">https://assets.fanart.tv/fanart/music/46e63d3b-d91b-4791-bb73-e9f638a45ea0/artistthumb/jett-joan-and-blackhearts-the-5110a559a01b8.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/46e63d3b-d91b-4791-bb73-e9f638a45ea0/artistthumb/jett-joan-and-blackhearts-the-51113fd761008.jpg">https://assets.fanart.tv/fanart/music/46e63d3b-d91b-4791-bb73-e9f638a45ea0/artistthumb/jett-joan-and-blackhearts-the-51113fd761008.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/LJ8i0iDpPZjgNv_lsV4IufV8TmU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-217628-1611724076-5712.jpeg.jpg">https://img.discogs.com/fXE6sJxMIdtFs6Y4ouYOaLOQQYs=/600x247/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-217628-1611724076-5712.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/TD8lWpmhjIpgTUrDX4ErQ4aC5L8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-217628-1611724076-7606.jpeg.jpg">https://img.discogs.com/qfxAYgQmmmJPRQZV2OUknxN0m1s=/599x329/smart/filters:strip_icc():format(jpeg):mode_r