=== 1961–1964 ===
Three members of the band, Rod Argent, Paul Atkinson, and Hugh Grundy, first came together to jam in 1961 in St Albans, Hertfordshire, England. Argent wanted to form a band and initially asked his elder cousin Jim Rodford to join as a bassist. Rodford was in a successful local band, the Bluetones, at the time and so declined, but he offered to help Argent (Rodford would later join in 2004 when the band reformed). Colin Blunstone and Paul Arnold joined the other three to form the band in April 1962, while all five members were at school.Some sources state that Argent, Atkinson, and Grundy were at St Albans School, while Blunstone and Arnold were students at St Albans Boys'' Grammar School (since renamed Verulam School). However, both Blunstone and Grundy came from Hatfield and both sang in the choir there at St Etheldreda''s Church.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/BwO1VedOE_Y0qQTpkM7QuFXxr8I=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-262221-1336467367.png.jpg">https://img.discogs.com/uXUrfkt0j1Hd6vQABYf2xD7CUsc=/598x468/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-262221-1336467367.png.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/IPmopaLoX_T9VPwV7YwpPAzVqx0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-262221-1500069415-6693.jpeg.jpg">https://img.discogs.com/C9mNP-lsOXKo8-XkohfkICbHCqA=/600x337/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-262221-1500069415-6693.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/2a8dkn1BeAgwKVMxeTjvH7mVsFg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-262221-1193319711.jpeg.jpg">https://img.discogs.com/TddNXFYY8VNSIrWSO5Ov2-YsCYw=/519x341/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-262221-