A subsequent single, "Kangaroo Court", was released on March 27, 2012. The band was featured on the Pop Up #1 compilation selected by Perez Hilton that was released on August 7, 2012. The band''s song "Safe and Sound" charted at #1 on the US Alternative Songs chart. The song was also used in a German Vodafone commercial, in a television commercial in the United States and Canada for the 2014 Mazda 3, and in an Air New Zealand in-flight safety video. The song "Center Stage" was featured on ESPN''s First Take where they played a short segment of the retro sounding track before going to commercial breaks.
The band''s debut album, In a Tidal Wave of Mystery, was released June 4, 2013 via Capitol Records in partnership with Lazy Hooks. It was the first release of new material on Capitol with a Universal Music Group catalog number.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/119a2c67-e6d6-41cf-a58c-c51b75c80daa/artistthumb/capital-cities-59dab9ae3fb3f.jpg">https://assets.fanart.tv/fanart/music/119a2c67-e6d6-41cf-a58c-c51b75c80daa/artistthumb/capital-cities-59dab9ae3fb3f.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/1TRBkZBEBg9qwvSKRe7KOMQbtsk=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2899046-1368131551-2650.jpeg.jpg">https://img.discogs.com/Zmuxky4yz2i_ORD4FsgD096oUMw=/300x276/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2899046-1368131551-2650.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="banner" preview="https://assets.fanart.tv/preview/music/119a2c67-e6d6-41cf-a58c-c51b75c80daa/musicbanner/capital-cities-53edaa0c67cf0.jpg">https://assets.fanart.tv/fanart/music/119a2c67-e6d6-41cf-a58c-c51b75c80daa/musicbanner/capital-cities-53edaa0c67cf0.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/119a2c67-e6d6-41cf-a58c-c51b75c80daa/hdmusiclogo/capital-cities-569c0621b2e2b.png">https://assets.fanart.tv/fanart/music/119a2c67-e6d6-41cf-a58c-c51b75c80daa/hdmusiclogo/capital-cities-569c0621b2e2b.png</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/119a2c67-e6d6-41cf-a58c-c51b75c80daa/artistbackground/capital-cities-5363f9cf26915.jpg">https://assets.fanart.tv/fanart/music/119a2c67-e6d6-41cf-a58c-c51b75c80daa/artistbackground/capital-cities-5363f9cf26915.jpg</thumb>','119a2c67-e6d6-41cf-a58c-c51b75c80daa');

=== Origin of the band''s name ===
Vocalist Leigh Nash described the origin of the band''s name on the Late Show with David Letterman:
It comes from a book by C. S. Lewis called Mere Christianity. A little boy asks his father if he can get a sixpence—a very small amount of English currency in use at the time—to go and get a gift for his father. The father gladly accepts the gift and he''s really happy with it, but he also realizes that he''s not any richer for the transaction. C.S. Lewis was comparing that to his belief that God has given him, and us, the gifts that we possess, and to serve him the way we should, we should do it humbly—realizing how we got the gifts in the first place.


=== Formation and early years (1992–1996) ===
Guitarist/songwriter Matt Slocum met Leigh Nash in the early 1990s. They recorded a demo, which circulates as "The Original Demos", with bassist T.J. Behling at Verge Music Works recording studio in Dallas, and eventually an album, The Fatherless and the Widow, for the independent label REX Music in 1993.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c2c70ed6-5f10-445c-969f-2c16bc9a4c2e/artistthumb/sixpence-none-the-richer-516a1d80eed15.jpg">https://assets.fanart.tv/fanart/music/c2c70ed6-5f10-445c-969f-2c16bc9a4c2e/artistthumb/sixpence-none-the-richer-516a1d80eed15.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/OzKJz25z9f8Yq0gv0DEa-0jM6Gw=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-230500-1098499933.jpg.jpg">https://img.discogs.com/IsKcxNfOaR5BqEa71-FYBxVehFY=/300x227/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-230500-1098499933.jpg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/KTmhjHDviYW3ekx94JtfeQUYk_o=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-230500-1451653906-4807.jpeg.jpg">https://img.discogs.com/6ymvNnin6BIOkUOluTnMmVhFsKc=/349x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-230500-1451653906-4807.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/h4kRQFjsTOq6hyTcC8ez9qfNAg4=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-230500-1316021368.jpeg.jpg">https://img.discogs.com/5U1KpWyv6CWVi5mhZ-m4PVOwImI=/600x411/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-230500-1316021368.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/hYjY3JMFm9bKyuJSP84U8kMEdiE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-230