From 1974 until 1985, Van Halen consisted of Eddie Van Halen; Eddie''s brother, drummer Alex Van Halen; energetic vocalist David Lee Roth; and bassist/vocalist Michael Anthony. Upon its release in 1978, the band''s self-titled debut album reached No. 19 on the Billboard pop music charts and would sell over 10 million copies in the U.S. By 1982, the band released four more albums (Van Halen II, Women and Children First, Fair Warning, and Diver Down), all of which have since been certified multi-platinum. By the early 1980s, Van Halen was one of the most successful rock acts of the day. The album 1984 was a commercial success with U.S. sales of 10 million copies and four hit singles; its lead single, "Jump", was the band''s only U.S. number one single.
In 1985, Roth left the band to embark on a solo career and was replaced by former Montrose lead vocalist Sammy Hagar. With Hagar, the group released four U.S. number-one, multi-platinum albums over the course of 11 years (5150 in 1986, OU812 in 1988, For Unlawful Carnal Knowledge in 1991, and Balance in 1995).','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-50f3b5f4c2bfc.jpg">https://assets.fanart.tv/fanart/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-50f3b5f4c2bfc.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-550f47134c783.jpg">https://assets.fanart.tv/fanart/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-550f47134c783.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-551083d157e57.jpg">https://assets.fanart.tv/fanart/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-551083d157e57.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-550f47134cc83.jpg">https://assets.fanart.tv/fanart/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-550f47134cc83.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-50b548311116e.jpg">https://assets.fanart.tv/fanart/music/b665b768-0d83-4363-950c-31ed39317c15/artistthumb/van-halen-50b548311116e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/dEny_N_adTQa9M0D36ivXZPc4Ho=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-94066-1402213359-4053.jpeg.jpg">https://img.discogs.com/p