The Propellerheads album Decksandrumsandrockandroll was released in 1998 by Wall of Sound in Europe and DreamWorks in the US and Japan. The DreamWorks versions include collaborations with hip hop artists De La Soul and Jungle Brothers, and the Japanese version is a two disc special edition including some of their earlier singles. A track from the album, "Spybreak!", became widely known after its use in the lobby scene in the 1999 feature film The Matrix. They are also noted for providing "Crash" (a remixed cover version of Brass Incorporated''s "At the Sign of the Swinging Cymbal", perhaps best known as the theme song of BBC Radio 1''s Pick of the Pops) as the theme tune to Radio 1''s ''Official Chart Show'' between 1998 and 2002, when Mark Goodier was the host.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/cbaafb20-eb74-421a-85f1-2bb6341aad23/artistthumb/propellerheads-5d823c72dfa76.jpg">https://assets.fanart.tv/fanart/music/cbaafb20-eb74-421a-85f1-2bb6341aad23/artistthumb/propellerheads-5d823c72dfa76.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/6UJPPzUgIHq64d9OGJ5--oQmTJ4=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1598-1479669263-6995.jpeg.jpg">https://img.discogs.com/KZikY45xYlf4CC66-MsfJ_z1rGo=/340x170/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1598-1479669263-6995.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ET9aQgrlvWIbhAk-uA-DPfw-Ok0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1598-1508848741-6168.png.jpg">https://img.discogs.com/gVa2IeXvP6IRwNdewLc5512wnho=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1598-1508848741-6168.png.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/INhH3JGE7mcRdtMGsXHY2GYFFjc=/150x150/smart/filters:strip_icc()