Originally, Audiomachine released albums only for the film industry''s professional use, but since 2012 it has released selected albums and compilations for the general public as well. The industry-released albums include Deus Ex Machina, Phenomena, Origins, Leviathan, Awakenings, Millennium, and Monolith. 

=== Paul Dinletir ===
Paul Dinletir initially just played piano and wanted to be a songwriter and jazz pianist. His wife was able to get him into a film and television music UCLA taught by Robert Etoll, who is now a collaborator. This led to him becoming a composer for X-Ray Dog where he composed trailers for cartoons (such as Samurai Jack until season 4) and reality TV shows; from that he saw the enjoyment he got from trailer music and eventually did that full time. Dinletir''s influences are Mozart, Beethoven, Debussy; he regularly listens to soundtracks. He used Logic Pro software for 15 years and switched to Steinberg Cubase.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ewRA3WxV8TIj5baGy90oxRyi580=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4629198-1443872550-4492.jpeg.jpg">https://img.discogs.com/6vK_vP8uEO3gLUZqoBD0asrHKK8=/160x160/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4629198-1443872550-4492.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/DOuYuo_a2ttBwuG6RkMZg7lwesY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4629198-1443802874-8276.jpeg.jpg">https://img.discogs.com/mCrnp8diQ-CFvzHtxZVvcAmUx60=/225x225/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4629198-1443802874-8276.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/MqmtrQNCBdXwEB2_PJU9IBW1hkY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4629198-1443185959-4354.jpeg.jpg">https://img.discogs.com/zv6bJcukNDqfvW1t6Olurw_L5CM=/578x172/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4629198-1443185959-4354.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/1e3e8759-f149-4e1b-933a-e4c46876c5fd/hdmusiclogo/audiomachine-535d41dcd68c7.png">