=== 1925–1956: Early life and career ===
In 1925, Mauriat was born and raised in Marseille, Bouches-du-Rhône, France. His father was a postal inspector who loved to play classical piano and violin. Mauriat began playing music at age four. In 1935, at the age of 10, he enrolled in the Conservatoire in Marseille to study classical music, but by the time he was 17, he had fallen in love with jazz and popular music.As a young adult, Mauriat started his own dance band and toured concert halls throughout Europe throughout the 1940s. In the 1950s, Mauriat became the musical director for at least two well-known French singers, Charles Aznavour and Maurice Chevalier, touring with both of them.


=== 1957–1962: First studio recordings ===
In 1957, Mauriat released his first EP, Paul Mauriat, a four track RGM release. One of his first songs, Rendez-vous au Lavandou, co-written with André Pascal, was awarded the 1958 le Coq d''or de la Chanson Française.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/1FQrqrYQhbk3_Ci9uiuyHv8ufuY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-717122-1518802160-2703.jpeg.jpg">https://img.discogs.com/gpVxt-X_k4wHPnPOQQVbbqF6KFU=/527x528/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-717122-1518802160-2703.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/87496c04-c857-4bd5-b86b-345129a1be63/hdmusiclogo/mauriat-paul-5744badc5b220.png">https://assets.fanart.tv/fanart/music/87496c04-c857-4bd5-b86b-345129a1be63/hdmusiclogo/mauriat-paul-5744badc5b220.png</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/87496c04-c857-4bd5-b86b-345129a1be63/hdmusiclogo/mauriat-paul-5745fd9d0073f.png">https://assets.fanart.tv/fanart/music/87496c04-c857-4bd5-b86b-345129a1be63/hdmusiclogo/mauriat-paul-5745fd9d0073f.png</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/87496c04-c857-4bd5-b86b-345129a1be63/hdmusiclogo/mauriat-paul-57461c2248fe0.png">https://assets.fanart.tv/fanart/music/87496c04-c857-4bd5-b86b-345129a1be63/hdmusiclogo/mauriat-paul-57461c2248fe0.png</thumb>','87496c04-c857-4bd5-b86b-345129a1be63');
Elfman has frequently worked with directors Tim Burton, Sam Raimi, and Gus Van Sant, with notable achievements the scores for 16 Burton-directed films including Batman, Edward Scissorhands, Charlie and the Chocolate Factory, Alice in Wonderland, and Dumbo; Raimi''s Spider-Man, Spider-Man 2, and Oz the Great and Powerful; and Van Sant''s Academy Award-nominated films Good Will Hunting and Milk. He wrote music for all of the Men in Black and Fifty Shades of Grey franchise films, the songs and score for Henry Selick''s animated musical The Nightmare Before Christmas, and the themes for the popular television series Desperate Housewives and The Simpsons.Among his honors are four Oscar nominations, two Emmy Awards, a Grammy, six Saturn Awards for Best Music, the 2002 Richard Kirk Award, the 2015 Disney Legend Award, and the Max Steiner Film Music Achievement Award in 2017. Elfman was born in Los Angeles, California, to a Jewish family of Polish Jewish and Russian Jewish descent. He is the son of Blossom Elfman (née Bernstein), a writer and teacher, and Milton Elfman, a teacher who was in the Air Force, and the brother of actor, musician, and journalist Richard Elfman. Elfman was raised in a racially mixed affluent community in Baldwin Hills, California, where he spent much of his time at the local movie theater discovering classic sci-fi, fantasy and horror films and first noticed the music of such film composers as Bernard Herrmann and Franz Waxman.In his early school days, Elfman exhibited an aptitude for science with almost no interest in music, and was even rejected from elementary school orchestra "for having no propensity for music." This would change when he switched high schools in the late 1960s and fell in with a musical crowd, who introduced him to early jazz and the work of Stravinsky and his 20th century contemporaries.After finishing high school early with plans to travel the world, Elfman followed his brother Richard to France, where he performed violin with Jérôme Savary''s Le Grand Magic Circus, an avant-garde musical theater group. He then embarked on a ten-month, self-guided tour through Africa, busking and collecting a range of West African percussion instruments until a series of illnesses forced him to return home. At this time, Richard was forming a new musical theater group in Los Angeles.While Elfman was never officially a student at CalArts, an instructor in the Indonesian music department encouraged him to attend classes and perform music there for two years.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5b24fbab-c58f-4c37-a59d-ab232e2d98c4/artistthumb/elfman-danny-5e540f8ea3dc7.jpg">https://assets.fanart.tv/fanart/music/5b24fbab-c58f-4c37-a59d-ab232e2d98c4/artistthumb/elfman-danny-5e540f8ea3dc7.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5b24fbab-c58f-4c37-a59d-ab232e2d98c4/artistthumb/elfman-danny-4ff30aade04f5.jpg">https://assets.fanart.tv/fanart/music/5b24fbab-c58f-4c37-a59d-ab232e2d98c4/artistthumb/elfman-danny-4ff30aade04f5.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5b24fbab-c58f-4c37-a59d-ab232e2d98c4/artistthumb/elfman-danny-552c3982b7982.jpg">https://assets.fanart.tv/fanart/music/5b24fbab-c58f-4c37-a59d-ab232e2d98c4/artistthumb/elfman-danny-552c3982b7982.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5b24fbab-c58f-4c37-a59d-ab232e2d98c4/artistthumb/elfman-danny-552c3a99c64a1.jpg">https://assets.fanart.tv/fanart/music/5b24fbab-c58f-4c37-a59d-ab232e2d98c4/artistthumb/elfman-danny-552c3a99c64a1.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/1Pcq8AmdZygIc143AKQPlhkTQzc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-75864-1617567203-3085.jpeg.jpg">https://img.discogs.com/mRl2JbQ0PAgkiuCVppq3p1vHMrA=/600x454/smart/filters: