At the 2014 Brit Awards, Newman was nominated for three Brit Awards, including for British Male Solo Artist. As of February 2014, Newman has sold over 1.3 million records in the UK alone. John William Peter Newman was born in Settle in the Yorkshire Dales and attended Settle College. When Newman was six years old, his father left the family, leaving his mother Jackie, his older brother James, and him with a pound a day. In his youth Newman was influenced by Motown and Stax that he heard via his mother. He was also influenced by the Northern soul sound, which also influenced his dance style. Many over 30s from Settle would leave on a weekend to go to Northern soul nights all over Yorkshire.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/589ef702-7f3a-4a1c-8f2c-4727005cfc0e/artistthumb/newman-john-5304178ac4fce.jpg">https://assets.fanart.tv/fanart/music/589ef702-7f3a-4a1c-8f2c-4727005cfc0e/artistthumb/newman-john-5304178ac4fce.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/589ef702-7f3a-4a1c-8f2c-4727005cfc0e/artistthumb/newman-john-541b4d507db19.jpg">https://assets.fanart.tv/fanart/music/589ef702-7f3a-4a1c-8f2c-4727005cfc0e/artistthumb/newman-john-541b4d507db19.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/589ef702-7f3a-4a1c-8f2c-4727005cfc0e/artistthumb/newman-john-541b4d507e5e4.jpg">https://assets.fanart.tv/fanart/music/589ef702-7f3a-4a1c-8f2c-4727005cfc0e/artistthumb/newman-john-541b4d507e5e4.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/uYsh5pfLyPeWUNaOGY4F0MQFzvU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2797907-1373268554-2106.jpeg.jpg">https://img.discogs.com/6z-vOzEn65gB7udNiLtvRjf1GLI=/545x733/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2797907-1373268554-2106.jpeg.jpg</thumb><thumb spoof="" cach