=== Early years ===
Before Survivor formed, Jim Peterik was the lead vocalist–guitarist for the band The Ides of March. In the mid 1970s, The Jim Peterik Band was formed after Peterik had released his album Don''t Fight the Feeling on Epic Records in 1976. In the liner notes of the album, written by Jim Charney, Peterik is referred to as a "survivor.” This note was the inspiration for the name of Peterik''s next grouping.
Drummer Gary Smith and bassist Dennis Keith Johnson had both been members of Bill Chase''s jazz-rock fusion band Chase; Peterik had worked with Chase in 1974. One of the other inspirations for Peterik''s choice of the new band''s name was his narrow escape from death when he was unable to make a guest appearance at a Chase concert scheduled for Jackson, Minnesota on August 9, 1974. He ended up not being on the plane that crashed, killing Bill Chase and most of his band.
In 1978, the Jim Peterik Band had dissolved, and Jim was considering returning to singing and producing jingles.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ZapH-qi18D44qaxzadL1GzBcC7I=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-149347-1370203746-3022.jpeg.jpg">https://img.discogs.com/SX7e9FXVo9jQjGo3EGzVoewzLW4=/600x425/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-149347-1370203746-3022.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/T2v2n-sPvR9XeqdWud0P86xR-WU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-149347-1453557120-3034.jpeg.jpg">https://img.discogs.com/tcO4QZ6YclAXntuaXluctHf5h-Q=/600x388/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-149347-1453557120-3034.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/f4QXPSn5MG_XeqPNZyyMnemkee0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-149347-1453557211-4591.jpeg.jpg">https://img.discogs.com/AjcBTD-hnV6PuaQO6qQpw3UkkFs=/588x690/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-149347-1453557211-4591.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Me1-6db_zznRFhkRB_s3YEGFwNY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-149347-1453557135-2217.jpeg.jpg">https://img.discogs.com/FYQIp9K1gTlaYnmYQu-aRI7OYXw=/600x423/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-149347-1453557135-2217.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/R5pwIx3k7dx03Q8gWSw5ziY654s=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-149347-1156435715.jpeg.jpg">https://img.discogs.com/FP70Tj2OeQQFQjIaeC5xVBn1lFU=/403x202/sma