Her height is 5 ft 6 in (168 cm). Yulianna was born in Moscow on April 24, 1988. When she was four years old, her father was sent to the diplomatic service in Bulgaria, and she and her family moved to Sofia. She studied at the School of the Russian Embassy in Bulgaria. At the age of 11 years, returned to Moscow and completed her school.
In 2003, Yulianna got ranked second in the "Person of the Year" competition organized by teen magazine, Yes!. After that, she became one of the singers of the Yes musical group.In 2004, she became a member of the Channel One Russia "Fabrika Zvyozd 5" under the direction of Alla Pugacheva, and reached the finals. By the end of the project, Yulianna had joined a new group of Maxim Fadeev Netsuke.After the "Fabrika Zvyozd", she studied in London for half a year, while occasionally working as an editor for the Yes! magazine.In 2011, Yulianna became a soloist of the group "5sta Family".','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/lpe3XCjYu_GnBnXJ2LS0eMvoiBg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1551544-1439647416-6076.jpeg.jpg">https://img.discogs.com/HV1yh0pvgvbEgQRDnKAETVsYPrA=/469x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1551544-1439647416-6076.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/JkIaUgTfPY-kZTMxJ_AAEwnIuMk=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1551544-1439647544-1862.jpeg.jpg">https://img.discogs.com/8zDhpbSVgOqGTaNXaMwa43bJVjo=/450x450/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1551544-1439647544-1862.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Z510uGAqIPI2LPGkQVbw4PnbbSo=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1551544-1439647583-6517.jpeg.jpg">https://img.discogs.com/agBVUQGpS9EkUQZjickr3VrsmWI=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1551544-1439647583-6517.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Gq5vnMkXN_mrOsdGbQvDIr59y6g=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1551544-143