=== 2006–2009: Formation and career beginnings ===
Lenzie and Edwards met in 2006 at Leeds University; Cameron was working in local record store Tribe Records and with Echo Location''s Obi running local night Event Horizon, while Lenzie was DJing hip-hop and warming up Event Horizon for acts. Once they had finished in Leeds, they relocated to London and became a three-piece with Ben Mauerhoff, being signed under DJ Fresh''s Breakbeat Kaos. After a while, Mauerhoff left. In December 2008, they formed their own record label, Life Recordings (so called because, according to Lenzie, the industry demanded that it be their life). Its inaugural release was a VIP mix of their early Bingo Beats single "El Presidente".','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/89ec6f82-1ad7-42d5-983e-ebf90f6868c8/artistthumb/sigma-54c0bca99ccd6.jpg">https://assets.fanart.tv/fanart/music/89ec6f82-1ad7-42d5-983e-ebf90f6868c8/artistthumb/sigma-54c0bca99ccd6.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/89ec6f82-1ad7-42d5-983e-ebf90f6868c8/artistthumb/sigma-54c0bcc30314c.jpg">https://assets.fanart.tv/fanart/music/89ec6f82-1ad7-42d5-983e-ebf90f6868c8/artistthumb/sigma-54c0bcc30314c.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/SR_CLKAig0ONWSproOCaj5Zuwno=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-561924-1415628533-8387.jpeg.jpg">https://img.discogs.com/n7dXABhBrYV-Gf6TR4I12Mimivs=/600x399/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-561924-1415628533-8387.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/i7sEv5-9bKH4nL8TaNKLTpgRYig=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-561924-1186545568.jpeg.jpg">https://img.discogs.com/ads_Pak5HVowGbZFoK2a5CtHatI=/600x394/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-561924-11865