Cyrus, a daughter of country music singer Billy Ray Cyrus, emerged as a teen idol while portraying the title character of the Disney Channel television series Hannah Montana (2006–2011). As Hannah Montana, she attained two number-one and three top-five soundtracks on the US Billboard 200, including the US Billboard Hot 100 top-ten single "He Could Be the One". Cyrus''s own discography includes the US number-one albums Meet Miley Cyrus (2007), Breakout (2008), and Bangerz (2013); the top-five releases Can''t Be Tamed (2010), Younger Now (2017), Plastic Hearts (2020) and the free album Miley Cyrus & Her Dead Petz (2015). Cyrus''s EPs The Time of Our Lives (2009) and She Is Coming (2019) also debuted in the top-five. Plastic Hearts became Cyrus''s most acclaimed album, and her first entry on the Billboard Rock Chart, debuting atop the chart. It included the lead single "Midnight Sky".','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/7e9bd05a-117f-4cce-87bc-e011527a8b18/artistthumb/cyrus-miley-5075dea7705ea.jpg">https://assets.fanart.tv/fanart/music/7e9bd05a-117f-4cce-87bc-e011527a8b18/artistthumb/cyrus-miley-5075dea7705ea.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/7e9bd05a-117f-4cce-87bc-e011527a8b18/artistthumb/cyrus-miley-5027db4faf570.jpg">https://assets.fanart.tv/fanart/music/7e9bd05a-117f-4cce-87bc-e011527a8b18/artistthumb/cyrus-miley-5027db4faf570.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/7e9bd05a-117f-4cce-87bc-e011527a8b18/artistthumb/cyrus-miley-5027db6e050dc.jpg">https://assets.fanart.tv/fanart/music/7e9bd05a-117f-4cce-87bc-e011527a8b18/artistthumb/cyrus-miley-5027db6e050dc.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/7e9bd05a-117f-4cce-87bc-e011527a8b18/artistthumb/cyrus-miley-5075e013b4ba3.jpg">https://assets.fanart.tv/fanart/music/7e9bd05a-117f-4cce-87