Seal has won multiple awards throughout his career, including three Brit Awards; he won Best British Male in 1992, as well as four Grammy Awards and an MTV Video Music Award. As a songwriter, he received two Ivor Novello Awards for Best Song Musically and Lyrically from the British Academy of Songwriters, Composers, and Authors for "Killer" (1990) and "Crazy" (1991).He was a coach on The Voice Australia in 2012 and 2013, and returned to Australia to work as a coach in 2017. Henry Olusegun Adeola Samuel was born on 19 February 1963 at St Mary''s Hospital in Paddington, London, to a Nigerian mother, Adebisi Ogundeji, and an Afro-Brazilian father, Francis Samuel. He was raised by a foster family in Westminster, London. He received a two-year diploma in architecture and had various jobs in the London area. 

=== Early career ===
In the 1980s, Seal spent a short time singing in local clubs and bars. In 1987, he joined Push, a British funk band, and toured with them in Japan. In Thailand, he joined a blues band for a while before separating from the group and journeying throughout India on his own.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f053ae01-dae6-4aae-9883-e8c279fdbef4/artistthumb/seal-4fe8360daea07.jpg">https://assets.fanart.tv/fanart/music/f053ae01-dae6-4aae-9883-e8c279fdbef4/artistthumb/seal-4fe8360daea07.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/3oDteY-8MBUISwNaZuBcrD8Z7Ig=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-10643-1603230006-6464.jpeg.jpg">https://img.discogs.com/NaGpkwESLVTM3qbYxQo8E8rexow=/600x394/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-10643-1603230006-6464.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/OJFFgO79TbGUqeWnKcxz-5ZJVx8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-10643-1542209580-2188.jpeg.jpg">https://img.discogs.com/U2rLR88AblPlRTv3g7cj9zwV4CA=/495x733/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-10643-1542209580-2188.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/PnLcQC9JgQqevxnzAbvWySvZSaU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-10643-1603230006-5389.jpeg.jpg">https://img.discogs.com/unrc3Oi4b09IcMggdjC2i5bzJjw=/600x706/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-10643-1603230006-5389.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/bcdDJbJzhfGh5Iq3gUBnXtgzdfM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-10643-1491740981-9166.jpeg.jpg">https://img.discogs.com/gNhOn