After self-releasing their independent album We Like Digging?, the band signed to Reprise Records and released the album The Fourth World in 1997. The album garnered a tepid response, after which the record label dropped the band and the members focused on college. In 2001, the band re-emerged as Maroon 5, pursuing a different direction and adding guitarist Valentine. The band signed with Octone Records, an independent record label with a separate joint venture relationship with J Records and released their debut album Songs About Jane in June 2002. Aided by the singles "Harder to Breathe", "This Love" and "She Will Be Loved", the album peaked at number six on the Billboard 200 chart and went quadruple platinum in 2005. In the same year, the band won the Grammy Award for Best New Artist. In 2006, Dusick left the band after suffering from serious wrist and shoulder injuries and was replaced by Matt Flynn.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0ab49580-c84f-44d4-875f-d83760ea2cfe/artistthumb/maroon-5-4fd5c67806fb8.jpg">https://assets.fanart.tv/fanart/music/0ab49580-c84f-44d4-875f-d83760ea2cfe/artistthumb/maroon-5-4fd5c67806fb8.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0ab49580-c84f-44d4-875f-d83760ea2cfe/artistthumb/maroon-5-4fd5c6780d336.jpg">https://assets.fanart.tv/fanart/music/0ab49580-c84f-44d4-875f-d83760ea2cfe/artistthumb/maroon-5-4fd5c6780d336.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/0ab49580-c84f-44d4-875f-d83760ea2cfe/artistthumb/maroon-5-4fd5c6780cc1c.jpg">https://assets.fanart.tv/fanart/music/0ab49580-c84f-44d4-875f-d83760ea2cfe/artistthumb/maroon-5-4fd5c6780cc1c.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/GAJAoYw4dMjGqnue_A3cDD6tWEc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-192151-1509716319-8232.png.jpg">h