Before auditioning for Australian Idol, Leith worked in Sydney as a chemist with Pharmalab utilising the Bachelor of Science (Honours) in Chemistry he obtained from University College, Dublin and postgraduate experience within the Metallosupramolecular Research Group in the Chemistry Department of Trinity College, Dublin. Only following determined coaxing by friends, Leith auditioned for the 4th series of Network Ten''s Australian Idol along with some 25,000 other contestants.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/uGFBV_mhsRNhRAEFnKv-lncZPqE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2064446-1571325843-1211.jpeg.jpg">https://img.discogs.com/ZdEDLVMAHKSD9kfgHRa3_o4NFqo=/600x801/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2064446-1571325843-1211.jpeg.jpg</thumb>','504b5521-bab3-468d-9014-8a987613a6a1');
Black Eyed Peas'' first major hit was the 2003 single "Where Is the Love?" from Elephunk, which topped the charts in 13 countries, including the United Kingdom, where it spent seven weeks at number one and went on to become Britain''s biggest-selling single of 2003. Their fourth album, Monkey Business, was an even bigger worldwide success, and became certified 3× Platinum in the United States. In 2009, the group became one of only 11 artists to have simultaneously held the number-one and number-two spots on the Billboard Hot 100, with their singles "Boom Boom Pow" and "I Gotta Feeling", which topped the chart for an unprecedented 26 consecutive weeks.
The album The E.N.D. produced a third Hot 100 number-one placement with "Imma Be", making the group one of few to ever place three number one singles on the chart from the same album, before being followed with "Rock That Body" and "Meet Me Halfway", which peaked in the top 10 of the Hot 100. "I Gotta Feeling" became the first single to sell more than one million downloads in the United Kingdom. At the 52nd Grammy Awards ceremony, held in January 2010, they won three awards out of six nominations. In November 2010, they released the album The Beginning.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-520b14329f31f.jpg">https://assets.fanart.tv/fanart/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-520b14329f31f.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-50787509d52d7.jpg">https://assets.fanart.tv/fanart/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-50787509d52d7.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-507874f95553d.jpg">https://assets.fanart.tv/fanart/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-507874f95553d.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-5ef641370b43a.jpg">https://assets.fanart.tv/fanart/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-5ef641370b43a.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/d5be5333-4171-427e-8e12-732087c6b78e/artistthumb/black-eyed-peas-the-5ef6415cbcfb7.jpg">https://assets.fanart.tv/fanar