=== 1977–2000: Early life and career beginnings ===
Natalia Oreiro, daughter of Carlos Florencio Oreiro Poggio and Mabel Cristina Iglesias Bourié, was born on 19 May 1977. Natalia studied drama at the age of eight and at twelve started auditioning for advertisements. During her teens she appeared in more than 30 television commercials for such trade marks as Coca-Cola, Pepsi and Johnson & Johnson. At the age of 16 she moved to Argentina to work there and unleash her ambition to be a star. She worked as an MTV VJ and in 1995, she landed a role in the soap opera Dulce Ana.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/bf67a751-bce5-4f7a-8d68-e4b5a678fae3/artistthumb/oreiro-natalia-525ccbaf2b97e.jpg">https://assets.fanart.tv/fanart/music/bf67a751-bce5-4f7a-8d68-e4b5a678fae3/artistthumb/oreiro-natalia-525ccbaf2b97e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/bf67a751-bce5-4f7a-8d68-e4b5a678fae3/artistthumb/oreiro-natalia-525ccbaf2c0ad.jpg">https://assets.fanart.tv/fanart/music/bf67a751-bce5-4f7a-8d68-e4b5a678fae3/artistthumb/oreiro-natalia-525ccbaf2c0ad.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/30B6k-lkzs0Q39aK92-QGusk2XQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-202821-1529589369-1253.jpeg.jpg">https://img.discogs.com/HXJBb2GyXqwFwClO9_NpSrqC6W0=/364x547/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-202821-1529589369-1253.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/MgF8D1RuNGmpM-Nsxm_7PjcBeLc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-202821-1480858561-3440.jpeg.jpg">https://img.discogs.com/daRJ3S0ZKP5zowk0neisdyW6ezw=/600x739/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-202821-1480858561-3440.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/U