Fonsi received his first Latin Grammy Award nominations in the Record of the Year category and won Song of the Year thanks to the song "Aquí Estoy Yo". The song also won three Billboard Latin Music Awards. "Despacito" became Fonsi''s biggest success winning four Latin Grammy Awards, seven Billboard Latin Music Awards, five Billboard Music Awards and received three Grammy Awards nominations. He also won one Latin American Music Award for "Échame la Culpa" with Demi Lovato.
As of 2018, Fonsi has broken six Guinness World Records and sold more than 11 million records with "Despacito". "Despacito" was the most-watched YouTube video of all time until November 2020, with over 7 billion views. Fonsi was born on April 15, 1978 in San Juan, Puerto Rico, the oldest child of Alfonso Rodríguez and Delia López-Cepero. He has two younger siblings: Jean Rodríguez, who also is a singer, and Tatiana Rodríguez.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ueblpOh1HhIDDP3HBSO5Jbkny2s=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-170496-1452145906-9213.jpeg.jpg">https://img.discogs.com/WNV7sv4W5E0hoL6uauCPhNyThDs=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-170496-1452145906-9213.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/rvPIyoHRskaRm1IZehtVcq079h0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-170496-1154807463.jpeg.jpg">https://img.discogs.com/QSbcI_dV9Qw4lU-frHuPXiZQKGw=/350x461/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-170496-1154807463.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/SbcovRRCXr52cAc43qPXU2IAf58=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-170496-1509012911-8213.jpeg.jpg">https://img.discogs.com/3M-NrUW-LrviH-dg1kAOm72KtGE=/400x535/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-170496-1509012911-8213.jpeg.jpg</thumb>','d68fda90-ab8d-4799-be56-317ba4ae700f');
Cabello''s debut studio album, Camila (2018), reached number one on the Billboard 200 chart. The Latin music-influenced pop album was critically well-received, and received a Platinum certification by the Recording Industry Association of America (RIAA). Its lead single "Havana" topped the charts in several countries including the US and UK, and follow-up single "Never Be the Same" reached the top ten in multiple countries. Cabello''s 2019 duet with Mendes, "Señorita", became her second single to top the Billboard Hot 100. Her second studio album, Romance (2019), peaked at number three on the Billboard 200 chart and number one in Canada. Cabello is set to star in an upcoming film adaptation of Cinderella (2021), for Sony Pictures.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/01b8b5bf-06cb-45da-85fb-61ada72fcd69/artistthumb/cabello-camila-5cdeaf5b65905.jpg">https://assets.fanart.tv/fanart/music/01b8b5bf-06cb-45da-85fb-61ada72fcd69/artistthumb/cabello-camila-5cdeaf5b65905.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/01b8b5bf-06cb-45da-85fb-61ada72fcd69/artistthumb/cabello-camila-5cdeafaf4d9d8.jpg">https://assets.fanart.tv/fanart/music/01b8b5bf-06cb-45da-85fb-61ada72fcd69/artistthumb/cabello-camila-5cdeafaf4d9d8.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/01b8b5bf-06cb-45da-85fb-61ada72fcd69/artistthumb/cabello-camila-5cdeafc280b81.jpg">https://assets.fanart.tv/fanart/music/01b8b5bf-06cb-45da-85fb-61ada72fcd69/artistthumb/cabello-camila-5cdeafc280b81.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/01b8b5bf-06cb-45da-85fb-61ada72fcd69/artistthumb/cabello-camila-5cdeafdc35213.jpg">https://assets.fanart.tv/fanart/music/01b8b5bf-06cb-45da-85fb-61ada72fcd69/artistthumb/cabello-camila-5cdeafdc35213.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.f