Blind since shortly after his birth, Wonder was a child prodigy known as Little Stevie Wonder, leading him to sign with Motown''s Tamla label at the age of 11. In 1963, the single "Fingertips" was a number-one hit on the Billboard Hot 100 when Wonder was 13, making him the youngest artist ever to top the chart. Wonder''s critical success was at its peak in the 1970s. His "classic period" began in 1972 with the releases of Music of My Mind and Talking Book, the latter featuring "Superstition", which is one of the most distinctive and famous examples of the sound of the Hohner Clavinet keyboard. His works Innervisions (1973), Fulfillingness'' First Finale (1974) and Songs in the Key of Life (1976) all won the Grammy Award for Album of the Year, making him the tied-record holder for the most Album of the Year wins, with three. He is also the only artist to have won the award with three consecutive album releases.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/1ee18fb3-18a6-4c7f-8ba0-bc41cdd0462e/artistthumb/wonder-stevie-510f249fa8e6a.jpg">https://assets.fanart.tv/fanart/music/1ee18fb3-18a6-4c7f-8ba0-bc41cdd0462e/artistthumb/wonder-stevie-510f249fa8e6a.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/1ee18fb3-18a6-4c7f-8ba0-bc41cdd0462e/artistthumb/wonder-stevie-510f24aa5922b.jpg">https://assets.fanart.tv/fanart/music/1ee18fb3-18a6-4c7f-8ba0-bc41cdd0462e/artistthumb/wonder-stevie-510f24aa5922b.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/1ee18fb3-18a6-4c7f-8ba0-bc41cdd0462e/artistthumb/wonder-stevie-5557ba15b6d43.jpg">https://assets.fanart.tv/fanart/music/1ee18fb3-18a6-4c7f-8ba0-bc41cdd0462e/artistthumb/wonder-stevie-5557ba15b6d43.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/1ee18fb3-18a6-4c7f-8ba0-bc41cdd0462e/artistthumb/wonder-stevie-51002176c9264.jpg">https://assets.f