In February 2012, Epps signed a solo record deal with Def Jam Recordings, an imprint of Universal Music Group. The following August, he released his debut studio album Based on a T.R.U. Story on August 14, 2012, to commercial success despite mixed reviews. The album spawned three successful singles: "No Lie" (featuring Drake), "Birthday Song" (featuring Kanye West), and "I''m Different", all of which charted in the top 50 of the Billboard Hot 100 and were certified Gold or higher by the RIAA, along with the album being certified Gold. His second studio album B.O.A.T.S. II: Me Time was released on September 11, 2013; supported by the lead singles "Feds Watching" (featuring Pharrell Williams) and "Used 2". Epps began working with TV network Viceland on a show called Most Expensivest, which debuted on November 15, 2017 and has aired three seasons. 2 Chainz was born Tauheed Epps in College Park, Georgia. He attended North Clayton High School, where he played basketball and graduated second in his class.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/dff0d392-4cd5-4052-9fbb-f485df3891e5/artistthumb/2-chainz-4ff3c2f2aba7b.jpg">https://assets.fanart.tv/fanart/music/dff0d392-4cd5-4052-9fbb-f485df3891e5/artistthumb/2-chainz-4ff3c2f2aba7b.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/dff0d392-4cd5-4052-9fbb-f485df3891e5/artistthumb/2-chainz-52ec34fe98e29.jpg">https://assets.fanart.tv/fanart/music/dff0d392-4cd5-4052-9fbb-f485df3891e5/artistthumb/2-chainz-52ec34fe98e29.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/tydvQM2Qo8kurNBUFWdKZ_6G2sM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-688662-1349083971-6997.jpeg.jpg">https://img.discogs.com/ZdUSKCa7tHKadeh-MNTV0Ur5zEc=/456x304/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-688662-1349083971-6997.jpeg.jpg</thumb><thumb spo