The duo have won an MTV Video Music Award for Best New Artist in 1984, the Grammy Award for Best Rock Performance by a Duo or Group with Vocal in 1987, the Brit Award for Outstanding Contribution to Music in 1999, and in 2005 were inducted into the UK Music Hall of Fame. The Eurythmics have sold an estimated 75 million records worldwide. In 2017, the group was nominated for induction into the Rock & Roll Hall of Fame, and were nominated again in 2018.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b4d32cff-f19e-455f-86c4-f347d824ca61/artistthumb/eurythmics-50dfafdba2178.jpg">https://assets.fanart.tv/fanart/music/b4d32cff-f19e-455f-86c4-f347d824ca61/artistthumb/eurythmics-50dfafdba2178.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b4d32cff-f19e-455f-86c4-f347d824ca61/artistthumb/eurythmics-50e1fba71ab96.jpg">https://assets.fanart.tv/fanart/music/b4d32cff-f19e-455f-86c4-f347d824ca61/artistthumb/eurythmics-50e1fba71ab96.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b4d32cff-f19e-455f-86c4-f347d824ca61/artistthumb/eurythmics-503db54a452f5.jpg">https://assets.fanart.tv/fanart/music/b4d32cff-f19e-455f-86c4-f347d824ca61/artistthumb/eurythmics-503db54a452f5.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/37InvKGIR9iZkRYdgEx7h4Nz7r0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-13911-1610740109-8094.jpeg.jpg">https://img.discogs.com/aPHz5MaJSjtkFFoRBLd1j79GknQ=/600x399/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-13911-1610740109-8094.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/naTpWCOoINI5XvmYpp2IBdkFV54=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-13911-1610740110-5970.jpeg.jpg">https://img.discogs.com/p-P-XbsQL6zlHVPRlN6a3gPOUrI=