=== 2005–2013: Formation and debut album ===
The Met brothers (born Metzger) initially began writing, producing, and mixing their own material in the living room of their Chelsea apartment in Manhattan, New York, focusing on DIY indie pop music. They began performing around 2006, busking in Central Park and Washington Square Park. Initially, Jack played the harmonica, Ryan played the piano, and Adam played the bass. They later began playing various instruments.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/TuE63cwbAygwSH4_vRzru86Wqag=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2308877-1556917653-6560.jpeg.jpg">https://img.discogs.com/s7_KdXRuAiKRbN9H4S7emvPTj9Y=/495x495/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2308877-1556917653-6560.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/XMAAjPRYTomuKzB0muj_UJ3ERKw=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2308877-1529945757-4823.jpeg.jpg">https://img.discogs.com/0Iw8qtdVrN__B1xbWn0Lx-evpwY=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2308877-1529945757-4823.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/M6XbbwIwvaI3w_DrlfMTqI9uxhI=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2308877-1510808171-3003.jpeg.jpg">https://img.discogs.com/LG0I-ov7vjQNVv3ibIOdh-XCftA=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2308877-1510808171-3003.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/NEaC4Mzh2ZtM7XOQLSlyHAIuv58=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2308877-1424945679-3536.jpeg.jpg">https://img.discogs.com/bsXO3DocCiLrwmy8B-lP59TrFiE=/500x334/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2308877-1424945679-3536.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/2eb55bd9-cfbf-44fd-a5da-92dd825284c7/hdmusiclogo/ajr-59a38da093974.png">https://assets.fanart.tv/fanart/music/2eb55bd9-cfbf-44fd-a5da-92dd825284c7/hdmusiclogo/ajr-59a38da093974.png</thumb>','2eb55bd9-cfbf-44fd-a5da-92dd825284c7');
In 2007, Legend received the Hal David Starlight Award from the Songwriters Hall of Fame. Legend won the Academy Award for Best Original Song and Golden Globe Award in 2015 for co-writing the song "Glory" from the film Selma. He has also won eleven Grammy Awards. In 2017, Legend received a Tony Award for co-producing Jitney for the Broadway stage. In 2018, Legend portrayed Jesus Christ in NBC''s adaptation of the rock opera Jesus Christ Superstar. He received a Primetime Emmy Award nomination for his acting role, and won for his role as a producer of the show, making him one of 16 people and the first black man to have won all four of the major American entertainment awards: Emmy, Grammy, Oscar, and Tony (EGOT).','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/75a72702-a5ef-4513-bca5-c5b944903546/artistthumb/legend-john-516c594e3ab1e.jpg">https://assets.fanart.tv/fanart/music/75a72702-a5ef-4513-bca5-c5b944903546/artistthumb/legend-john-516c594e3ab1e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/75a72702-a5ef-4513-bca5-c5b944903546/artistthumb/legend-john-502284864513b.jpg">https://assets.fanart.tv/fanart/music/75a72702-a5ef-4513-bca5-c5b944903546/artistthumb/legend-john-502284864513b.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/75a72702-a5ef-4513-bca5-c5b944903546/artistthumb/legend-john-516a899f64a36.jpg">https://assets.fanart.tv/fanart/music/75a72702-a5ef-4513-bca5-c5b944903546/artistthumb/legend-john-516a899f64a36.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/0feKLgmLooCsExY40dUKFOxOH0A=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-438161-1502554777-7161.jpeg.jpg">https://img.discogs.com/Ds9TKrO6NvXFlTNA3veaEMhKoxU=/600x685/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-438161-1502554777-7161.jpeg.jpg</thumb