=== 2006: Formation ===
The duo was formed in 2006 when they met in a Parisian café and decided to collaborate on writing songs together.


=== 2008–09: Lilly Who and the What? ===
After collaborating on a number of songs, in 2008 they made a cover of "L.E.S. Artistes" from Santogold. They also met guitarist Pierre Guimard who heard their songs on Myspace and offered to work with them and opened his studio for production of their work. 2008 saw release of their track on a compilation entitled Folk & Proud followed, in 2009, by the EP of the duo Lilly Who and the What? referring to the stage name of the duo. It was released on Choke Industry independent label founded by Pierre Guimard and by Matthieu Tessier, the duo''s manager.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/1b72331b-3a97-4981-a81c-eeee9c275d28/artistthumb/lilly-wood--the-prick-54cfeaa1b8379.jpg">https://assets.fanart.tv/fanart/music/1b72331b-3a97-4981-a81c-eeee9c275d28/artistthumb/lilly-wood--the-prick-54cfeaa1b8379.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/CiiyYNc25_Dhhg89xTTVgYqjXOw=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1935042-1300444446.jpeg.jpg">https://img.discogs.com/NwqruUZHAjdx4NI_Sh9oBh_iZlc=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1935042-1300444446.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/_wetOeIKYaVrWaLpbh3_UuN4Ti0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1935042-1300444599.jpeg.jpg">https://img.discogs.com/bnQHdfmELrIGnyXY2gwkyDL3Bjs=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1935042-1300444599.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/51j5CnMI68KquciPSZM7Vz6yk0I=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1935042-1300444624.jpeg.jpg">https://img.discogs.com/cShvPp8OGbCL0U49iKUsjNGNUXs=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/di