She signed to [url=http://www.discogs.com/label/XL+Recordings]XL Recordings[/url] for the release of her second single and subsequent debut album. (Her debut single having been released as a 500 Limited Edition 7" on [url=http://www.discogs.com/label/Pacemaker+Recordings]Pacemaker Recordings[/url].)

She plays guitar and piano, though her music is characterized by her soulful voice which has been described as [i]"somewhere between [url=http://www.discogs.com/artist/Dusty+Springfield]Dusty Springfield[/url] and [url=http://www.discogs.com/artist/Jill+Scott]Jill Scott[/url]."[/i] (In contrast to the hard South London accent of her spoken voice). She confesses to being obsessed with the themes of love lost and heartbreak which, along with teenage experiences and London life, predominate in her soul-tinged songs.

October 2007 saw her first headlining tour (in the UK), after previously touring with best friend [url=http://www.discogs.com/artist/Jack+Pe%C3%B1ate]Jack Peñate[/url] (on whose album [url=http://www.discogs.com/release/1101920]Matinée[/url] she provides backing vocals for [i]My Yvonne[/i]), as well supporting [url=http://www.discogs.com/artist/Jamie+T]Jamie T[/url], [url=http://www.discogs.com/artist/Raul+Mid%C3%B3n]Raul Midon[/url], [url=http://www.discogs.com/artist/Devendra+Banhart]Devendra Banhart[/url] and [url=http://www.discogs.com/artist/Amos+Lee]Amos Lee[/url].

She lists [url=http://www.discogs.com/artist/Etta+James]Etta James[/url], [url=http://www.discogs.com/artist/Jill+Scott]Jill Scott[/url], [url=http://www.discogs.com/artist/Billy+Bragg]Billy Bragg[/url], [url=http://www.discogs.com/artist/Peggy+Lee]Peggy Lee[/url], [url=http://www.discogs.com/artist/Jeff+Buckley]Jeff Buckley[/url], [url=http://www.discogs.com/artist/Ella+Fitzgerald]Ella Fitzgerald[/url], [url=http://www.discogs.com/artist/Billie+Holiday]Billie Holiday[/url], [url=http://www.discogs.com/artist/Johnny+Cash]Johnny Cash[/url] and [url=http://www.discogs.com/artist/Cure%2C+The]The Cure[/url] amongst her influences, and is also a huge fan of Al Pacino.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/cc2c9c3c-b7bc-4b8b-84d8-4fbd8779e493/artistthumb/adele-4fb28efcda7b1.jpg">https://assets.fanart.tv/fanart/music/cc2c9c3c-b7bc-4b8b-84d8-4fbd8779e493/artistthumb/adele-4fb28efcda7b1.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/cc2c9c3c-b7bc-4b8b-84d8-4fbd8779e493/artistthumb/adele-4fb28f0853f8d.jpg">https://assets.fanart.tv/fanart/music/cc2c9c3c-b7bc-4b8b-84d8-4fbd8779e493/artistthumb/adele-4fb28f0853f8d.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/cc2c9c3c-b7bc-4b8b-84d8-4fbd8779e493/artistthumb/adele-50741cbeecc8c.jpg">https://assets.fanart.tv/fanart/music/cc2c9c3c-b7bc-4b8b-84d8-4fbd8779e493/artistthumb/adele-50741cbeecc8c.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/sMBJT5eDPI22Ra_r4g3wq0dzUnU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-819015-1611849912-4007.jpeg.jpg">https://img.discogs.com/OVqn0GWDXQD3LWOUsoZxs3N_7ds=/600x472/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-819015-1611849912-4007.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/acCpe0i0RtgL