=== Formation and Everything All the Time (2004–2006) ===

Ben Bridwell (vocals, guitar) formed Band of Horses, who were originally briefly known as Horses, in 2004 after the break-up of his previous band, Carissa''s Wierd, along with bassist Chris Early and drummer Tim Meinig. They were soon joined by former Carissa''s Wierd bandleader Mat Brooke (guitar, vocals). The band initially received attention from Sub Pop after opening for Iron & Wine during Seattle area shows. In 2005, the band released the Tour EP, which was sold at shows and on Sub Pop''s website.
Their first full-length album, Everything All the Time, was recorded in 2005 with producer Phil Ek and released by Sub Pop on 21 March 2006.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/07b6020a-c539-4d68-aeef-f159f3befc76/artistthumb/band-of-horses-508d1450c072c.jpg">https://assets.fanart.tv/fanart/music/07b6020a-c539-4d68-aeef-f159f3befc76/artistthumb/band-of-horses-508d1450c072c.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/KY4aN0msUxOzvLDqDI8OLixIUxw=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-424476-1487348991-7755.jpeg.jpg">https://img.discogs.com/Mgj1cPc7k0io4_p951u-Z7V_-CA=/600x375/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-424476-1487348991-7755.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/C5qTN_ESizEiW9YxmX9aY9d0FS4=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-424476-1189201131.jpeg.jpg">https://img.discogs.com/dxFwpTSsxXw1UxBm3DXxKMrE0cg=/600x437/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-424476-1189201131.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Wq8uGyQNY3BgYJ9Nw1UnVwiSDO4=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-424476-1189201146.jpeg.jpg">https://img.discogs.com/eAsKZhZceH3wKxS5PeAnQlusRwQ=/600x490/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-424476-1189201146.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="banner" preview="https://assets.fanart.tv/preview/music/07b6020a-c539-4d68-aeef-f159f3befc76/musicbanner/band-of-horses-5515b21c33035.jpg">https://assets.fanart.tv/fanart/music/07b6020a-c539-4d68-aeef-f159f3befc76/musicbanner/band-of-horses-5515b21c33035.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv