Born and raised in County Wicklow, Hozier released his debut EP in 2013, featuring "Take Me to Church", which became a rock radio hit in the U.S. and peaked at number two on the Billboard Hot 100. His debut studio album was released in March 2014 to critical acclaim. It has been certified 6× platinum in Ireland and multi-platinum in several countries. In September 2018, he released an EP titled Nina Cried Power and featured the title track as a single, reaching number one on the Billboard Adult Alternative Songs chart. He released his second album Wasteland, Baby! in March 2019, which debuted atop the Irish Albums Chart and the Billboard 200, and has since been certified gold in the U.S. Andrew John Hozier-Byrne was born on 17 March 1990 in Bray, County Wicklow, the son of Raine Hozier-Byrne, an artist, and John Byrne, a local blues drummer who had a day job working at a bank. He grew up near Delgany, County Wicklow.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b4691384-50c3-4afd-9988-51d3ec5db65d/artistthumb/hozier-54a6a0f4106de.jpg">https://assets.fanart.tv/fanart/music/b4691384-50c3-4afd-9988-51d3ec5db65d/artistthumb/hozier-54a6a0f4106de.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/eliO_k7HHOkTMgZv3fsqdobLyFQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3853178-1564934129-6070.jpeg.jpg">https://img.discogs.com/LzAkXGOE9_PA7JULyO07YpqKxHY=/600x846/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3853178-1564934129-6070.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Ha0sAZrZf7GxiFK4mixIk1Cww8I=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3853178-1587234480-1686.jpeg.jpg">https://img.discogs.com/VSq82Dg0aShYV1BnlvpXjkJ9ccY=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3853178-1587234480-