The Chainsmokers is an American electronic DJ and production duo consisting of Alexander "Alex" Pall and Andrew "Drew" Taggart. They started out by releasing remixes of songs by indie artists. The EDM-pop duo achieved a breakthrough with their 2014 song "#Selfie", which became a top twenty single in several countries. They have won a Grammy award, two American Music Awards, seven Billboard Music Awards and nine iHeartRadio Music Awards. According to Forbes 2019 list of highest paid celebrities, the Chainsmokers were the highest paid DJs, dethroning Calvin Harris after six years.Their debut EP, Bouquet, was released in October 2015 and featured the single "Roses" which reached the top 10 on the US Billboard Hot 100. "Don''t Let Me Down", featuring American singer Daya, became their first top-five single on the Billboard chart and won the Grammy Award for Best Dance Recording at the 59th awards ceremony. Their single "Closer", featuring American singer-songwriter Halsey, became their first number-one single on the Billboard chart. The duo''s second EP, Collage, was released in November 2016. Their debut studio album, Memories...Do Not Open, was released in April 2017 and topped the US Billboard 200 chart. Their second album, Sick Boy, was released in December 2018.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/91a81925-92f9-4fc9-b897-93cf01226282/artistthumb/chainsmokers-the-59dbfcd7a4632.jpg">https://assets.fanart.tv/fanart/music/91a81925-92f9-4fc9-b897-93cf01226282/artistthumb/chainsmokers-the-59dbfcd7a4632.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/dqW-68_NobRxazP9Dbrhh8ovjBo=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3403158-1473252506-9344.jpeg.jpg">https://img.discogs.com/mdcgMsOtQJE6YXPb2MRKgkTADNM=/600x397/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3403158-1473252506-9344.jpeg.jpg</thumb><thumb sp