For Smith''s and Jimmy Napes''s song "Writing''s on the Wall", the theme for the James Bond film Spectre (2015), Smith won the Golden Globe Award and the Academy Award for Best Original Song. Smith''s second studio album, The Thrill of It All, was released in November 2017 and debuted atop the UK and US album charts. The lead single, "Too Good at Goodbyes", reached number one in the UK and Australia and number four in the US. They released the single "Promises" with Calvin Harris, which peaked at number one in the UK. Smith released "Dancing with a Stranger" with Normani in 2019, which reached the top ten in the UK and the US and was nominated for Song of the Year at the 2020 Brit Awards, and followed it by releasing a string of commercially successful singles "How Do You Sleep?", "To Die For", and "I''m Ready" with Demi Lovato; all of which feature on Smith''s third album, Love Goes.Smith has won four Grammy Awards, three Brit Awards, three Billboard Music Awards, and an American Music Award, as well as a Golden Globe and an Academy Award through their career. Smith is non-binary and prefers the use of they/them pronouns. Samuel Frederick Smith was born on 19 May 1992 in London to Frederick Smith and broker Kate Cassidy.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5a85c140-dcf9-4dd2-b2c8-aff0471549f3/artistthumb/smith-sam-52f502921104b.jpg">https://assets.fanart.tv/fanart/music/5a85c140-dcf9-4dd2-b2c8-aff0471549f3/artistthumb/smith-sam-52f502921104b.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/5a85c140-dcf9-4dd2-b2c8-aff0471549f3/artistthumb/smith-sam-539ea731da6c9.jpg">https://assets.fanart.tv/fanart/music/5a85c140-dcf9-4dd2-b2c8-aff0471549f3/artistthumb/smith-sam-539ea731da6c9.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/3-0Pc5CEkVVmORaaWHDLOea7CRg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-