Her second album, N.B. (2007), yielded the UK top 10 singles "I Wanna Have Your Babies" and "Soulmate". N.B. was not released in North America, but six tracks from it were included with seven new ones and released in 2008 as her third studio album, Pocketful of Sunshine, with the singles "Love Like This" and "Pocketful of Sunshine" earning success on the charts. In December 2010, Bedingfield released her third album in North America, named Strip Me with the song of the same name charting on the US Billboard Hot 100 at 91. Bedingfield has sold over 10 million albums and 10 million singles worldwide, totalling over 20 million records worldwide. In 2012, VH1 ranked Bedingfield number 66 on the list of 100 Greatest Women in Music.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/8b477559-946e-4ef2-9fe1-446cff8fdd79/artistthumb/bedingfield-natasha-4fd5f2b704a9d.jpg">https://assets.fanart.tv/fanart/music/8b477559-946e-4ef2-9fe1-446cff8fdd79/artistthumb/bedingfield-natasha-4fd5f2b704a9d.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/8b477559-946e-4ef2-9fe1-446cff8fdd79/artistthumb/bedingfield-natasha-4fd5f2b703e25.jpg">https://assets.fanart.tv/fanart/music/8b477559-946e-4ef2-9fe1-446cff8fdd79/artistthumb/bedingfield-natasha-4fd5f2b703e25.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/8b477559-946e-4ef2-9fe1-446cff8fdd79/artistthumb/bedingfield-natasha-4fd5f2b7050de.jpg">https://assets.fanart.tv/fanart/music/8b477559-946e-4ef2-9fe1-446cff8fdd79/artistthumb/bedingfield-natasha-4fd5f2b7050de.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/kE1aX69C1saOm575pVq-UNlcCmg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-192149-1367039091-7560.jpeg.jpg">https://img.discogs.com/xHCjPoZ4VqyCDVk6i9ajL88RD9g=/402x446/smart/filters:strip_icc():format(jpeg):mode_rgb():qual