Perry and Hamilton, originally in a band together called the Jam Band, met up with Tyler, Kramer, and guitarist Ray Tabano, and formed Aerosmith; in 1971, Tabano was replaced by Whitford. They released a string of multi-platinum albums starting with their eponymous debut in 1973, followed by Get Your Wings in 1974. The band broke into the mainstream with Toys in the Attic (1975) and Rocks (1976). Draw the Line and Night in the Ruts followed in 1977 and 1979. Throughout the 1970s, the band toured extensively and charted a dozen Hot 100 singles, including their first Top 40 hit "Sweet Emotion" and the Top 10 hits "Dream On" and "Walk This Way".','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3d2b98e5-556f-4451-a3ff-c50ea18d57cb/artistthumb/aerosmith-4fd0b247b3115.jpg">https://assets.fanart.tv/fanart/music/3d2b98e5-556f-4451-a3ff-c50ea18d57cb/artistthumb/aerosmith-4fd0b247b3115.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3d2b98e5-556f-4451-a3ff-c50ea18d57cb/artistthumb/aerosmith-4fd96f172b162.jpg">https://assets.fanart.tv/fanart/music/3d2b98e5-556f-4451-a3ff-c50ea18d57cb/artistthumb/aerosmith-4fd96f172b162.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3d2b98e5-556f-4451-a3ff-c50ea18d57cb/artistthumb/aerosmith-50acd72cdc8a1.jpg">https://assets.fanart.tv/fanart/music/3d2b98e5-556f-4451-a3ff-c50ea18d57cb/artistthumb/aerosmith-50acd72cdc8a1.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ycNiTjz3dmdJvWhG6TferyiQBWk=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-48424-1612015775-3711.png.jpg">https://img.discogs.com/H0woDH4q8FxzFjRezINf5goLt1c=/600x309/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-48424-1612015775-3711.png.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/hxJV7Ye-d791S