=== 2012–2013: Early years and self-titled album ===
Best friends since attending elementary school outside of Reykjavik, band leader JJ, drummer David Antonsson, and bassist Daniel Kristjansson began playing together at the age of 17 before adding guitarist Rubin Pollock to the mix in 2012. They named the band Kaleo, which means "the voice" in Hawaiian, and started their career with a handful of well-received shows at the 2012 Iceland Airwaves music festival, which was the band''s first major public appearance.
