Basta first began to write rap songs between the ages of 15–16. In 1997, he joined the rap group Psycholyric, which he later renamed Kasta. In 1998, he recorded his first solo single "Моя Игра" (Moya Igra/My Game). Subsequently, Vakulenko assembled his own band, "Уличные Звуки" (Ulichnye Zvuki/Street Sounds). In 2004, he was noticed by Bogdan Titomir, who invited him to accompany him to Moscow. In Moscow, Basta met other performers Smoky Mo and Guf (future founder of the Centr). Later on, he participated in recording Guf''s album "Город дорог" (Gorod Dorog/City of roads) and collaborated with him on the cover of his first single "Моя Игра" (Moya Igra/My Game).','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/dc453ee9-f2d4-4582-840b-b3be6c79654d/artistthumb/basta-56a2363168dc9.jpg">https://assets.fanart.tv/fanart/music/dc453ee9-f2d4-4582-840b-b3be6c79654d/artistthumb/basta-56a2363168dc9.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/70hIC8FWEwXjz03Oapm4eNtJPlE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-960805-1323025250.jpeg.jpg">https://img.discogs.com/r280RayO_tXVkCxkfop7yPlDYp4=/416x361/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-960805-1323025250.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/DBKDCT-L1VSjtlFCOxoyQ-IrnxI=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-960805-1323025448.jpeg.jpg">https://img.discogs.com/bt1VBuC9S8AspuX-bxhaHkOWcrY=/450x675/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-960805-1323025448.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/y7btlqhveaho4G1KluJUEUCxdkk=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-960805-1323025403.jpeg.jpg">https://img.discogs.com/SoOEIyvlgXNvzmSU82JvkQwxmA