Shortly after Korzh followed the path of becoming a beatmaker making music for other artists but to no critical success. This made him decide to record his own songs over his own instrumentals.
Korzh recorded his first solo song while studying at Belarusian State University; the biggest university in Belarus. During the 3rd year of studying at the university he decided to drop out and concentrate on his music career. He borrowed $300 dollars from his mom, went to a studio and recorded "Nebo Pomozhet Nam" (English: "Sky Will Help Us") and posted it on VKontakte, the biggest Russian social network.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/EmUnzvsE8U7UuOekPkC2XCz8Yn0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2286915-1584890125-7802.jpeg.jpg">https://img.discogs.com/Gu4mlCrILJJdZ7G8nqrTvXsj5LQ=/600x399/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2286915-1584890125-7802.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/0d58yvRrFP4jjZQtRQYOefc3a88=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2286915-1584890142-3930.jpeg.jpg">https://img.discogs.com/WzJuwzWLv17cqkj-RIYgfsMOROM=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2286915-1584890142-3930.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/fRfKNCtx0J7KkbjC3aBhAjuP_qg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2286915-1584890152-7422.jpeg.jpg">https://img.discogs.com/e2-nW1MvMI5ZDRZPFnHuj07eHCY=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2286915-1584890152-7422.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/bDoj26K7hEDBfHtR1wvYSDPP2-k=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2286915-1584890358-9794.png.jpg">https://img.discogs.com/lP2QgzpYKhReaiZ3-EFZJVedoYA=/600x402/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2286915-158489035