At the end of 2015, Gyrdymova uploaded her first album, Psychedelic Cloud-Rap (Russian: «Психоделический клауд рэп», romanized: Psihodeličeskij klaud rèp), to the social network VKontakte under the pseudonym Monetochka. She recorded the songs at home on a synthesizer. Soon after, she began uploading videos of her live performances to YouTube.On 22 January 2016, she officially released Psychedelic Cloud Rap. The album was posted in one of the popular social network communities and quickly went viral. By the end of February, she had over 20,000 followers on her VKontakte page and received offers to give concerts and interviews.In January 2017, Monetochka released the video for the song "Ushla k realistu" (Russian: «Ушла к реалисту»).','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/xMZ5oY_tUEz-1bl7TJafKMNN-cA=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-6511821-1617809552-1386.jpeg.jpg">https://img.discogs.com/asXrDvvGe665dPfHrV0wZAohcLY=/600x557/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-6511821-1617809552-1386.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/EaDjA1Eq6jB-Dg9HpBiUx2tlO8Q=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-6511821-1617809551-5207.jpeg.jpg">https://img.discogs.com/GP4DhiukgrV8dzpq2EUralpBXhs=/600x517/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-6511821-1617809551-5207.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/FHQXeNepjP6lq4_FJjrGIDg-U2Y=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-6511821-1529845432-1677.jpeg.jpg">https://img.discogs.com/j6Ew4wznrZcOC3EMr7aZrq1a1Fg=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-6511821-1529845432-1677.jpeg.jpg</thumb>','30fcffbe-1083-4e3e-b85a-9b184b97d09f');
