In 1978, Igor Kornelyuk moved to Leningrad to study at the School of Music of the Nikolai Rimsky-Korsakov Conservatory. He graduated in 1982, and started to follow the Composition classes at the same institute, from which he graduated in 1987. Being a student, he worked as musical director and composer for the Leningrad Theatre Buff. 
His professional career started in 1988, when he reached the final of the TV show Song of the Year with his song Bilyet na Balyet (Ticket to the Ballet).
Igor Kornelyuk wrote more than 200 popular songs, many of which were recorded by popular Russian singers like Mikhail Boyarsky, Anne Veski, Edita Piekha and Philipp Kirkorov, and he wrote the soundtracks for some of the most renowned Russian films and TV-series directed by Vladimir Bortko like Gangsters of Saint-Petersburg, The Idiot, The Master and Margarita and Taras Bulba. 1988 – Bilyet na Balyet (A ticket to the ballet)
1990 – Podozhdi (Wait)
1994 – Ya ne mogu tak zhit (I can not live like this)
1994 – Moy lyubimye pesni (My favorite songs)
1998 – Privyet, a eto Kornelyuk!','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/y70l2-GGE5BMR_Hyex_T9UtfDjI=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1219008-1609779705-7849.jpeg.jpg">https://img.discogs.com/GjFWB9yi84dVuTnF1w6qM4yUEUw=/600x849/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1219008-1609779705-7849.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/E98Wlp6Qn95adPwA4ITStRrsVYk=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1219008-1447347641-7106.jpeg.jpg">https://img.discogs.com/il1CRt_usUli0EUaRvwZzfI4_Tc=/600x900/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1219008-1447347641-7106.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/yhe9uwUMtJ42TJ0oWnKYdilzqHk=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1219008-1447347641-1471.jpeg.jpg">https://img.discogs.com/KV-LrCAZUzCzSDjVO3bFGVK-TF0=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1219008-1447347641-1471.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/xFPZplNBwfy1Sfuh07e4B18z3wc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1219008-1447347641-6833.jpeg.jpg">https://img.discogs.com/qs4zSrfJUDO2olZGl7h5zGVqumU=/600x643/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1219008-1447347641-6833.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/xi8ejSoRMZiWSt7kAkjAdLpYwm8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1219008-1447347641-7509.jpeg.jpg">https://img.discogs.com/jftKAhIaSouv8XI0_w7m7GYBdEM=/600x776/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs