Blur''s self-titled fifth album (1997) saw another stylistic shift, influenced by the lo-fi styles of American indie rock groups, and became their third UK chart-topping album. Its single "Song 2" brought the band mainstream success in the US for the first time. Their next album, 13 (1999) saw the band experimenting with electronic and gospel music, and featured more personal lyrics from Albarn. Their seventh album, Think Tank (2003), continued their experimentation with electronic sounds and was also shaped by Albarn''s growing interest in hip hop and world music, featuring more minimal guitar work. Coxon left the band during early recording sessions for Think Tank, and Blur disbanded for several years after the end of the album''s associated tour, with the members engaged in other projects.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/ba853904-ae25-4ebb-89d6-c44cfbd71bd2/artistthumb/blur-4fb67f27f2e67.jpg">https://assets.fanart.tv/fanart/music/ba853904-ae25-4ebb-89d6-c44cfbd71bd2/artistthumb/blur-4fb67f27f2e67.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/ba853904-ae25-4ebb-89d6-c44cfbd71bd2/artistthumb/blur-53e5654247b90.jpg">https://assets.fanart.tv/fanart/music/ba853904-ae25-4ebb-89d6-c44cfbd71bd2/artistthumb/blur-53e5654247b90.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/ba853904-ae25-4ebb-89d6-c44cfbd71bd2/artistthumb/blur-59fcf24fd7225.jpg">https://assets.fanart.tv/fanart/music/ba853904-ae25-4ebb-89d6-c44cfbd71bd2/artistthumb/blur-59fcf24fd7225.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/ba853904-ae25-4ebb-89d6-c44cfbd71bd2/artistthumb/blur-53613779bb01b.jpg">https://assets.fanart.tv/fanart/music/ba853904-ae25-4ebb-89d6-c44cfbd71bd2/artistthumb/blur-53613779bb01b.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/VFLRjrcOU