Carla''s Dreams has launched in Romania in 2013, along with Inna with the song P.O.H.U.I., later to sing with Loredana Lumea ta ("Your World"), and in 2015 with Delia, releasing songs Cum ne noi ("How We Us") and Da, mamă ("Yes, Mom"). With eight number-one singles on the Romanian Airplay 100, "Carla''s Dreams" is the most-successful act in the chart''s history. Their latest number-one was "Luna" in March 2019, their eighth. In June 2020, the group''s singles "Seară de seară" and "Secrete" were both in the Airplay 100''s top ten, sitting at numbers seven and ten respectively.They were chosen by Disney to provide the Romanian dub of a character in the animated movie Frankenweenie.  
