=== Birth, early work (1985–2002) ===
Alexeyev was born on 9 March 1985 in Yartsevo, Smolensk Oblast, Russia. His father is a musician and his mother is a chemist. His parents divorced in 1994.
When he was about eight or nine years old, Alexeyev first began to write poetry, and at the age of ten became interested in music. In the winter of 1995–96 he enrolled in music school, studying classical guitar. In 1997 he moved with his mother to the city of Belgorod, where he twice won the regional competition for classical guitar: 1st place in 1998 and 2nd in 2000.
When Alexeyev was 13 he formed his own rock band. His idols were Nirvana and The Prodigy.
In 2001 Alexeyev graduated music school and in 2002 he graduated high school with a "gold medal".','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/a0c5737e-da6d-468f-a78e-19146494f1db/artistthumb/noize-mc-56a530763ff9a.jpg">https://assets.fanart.tv/fanart/music/a0c5737e-da6d-468f-a78e-19146494f1db/artistthumb/noize-mc-56a530763ff9a.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/a0c5737e-da6d-468f-a78e-19146494f1db/artistthumb/noize-mc-5ef3f07402a23.jpg">https://assets.fanart.tv/fanart/music/a0c5737e-da6d-468f-a78e-19146494f1db/artistthumb/noize-mc-5ef3f07402a23.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/kwo5Em2Q8dDjaBnM5M3uetLJHYY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1490490-1617812364-9827.jpeg.jpg">https://img.discogs.com/IkCzMgIL30rwlVTDJ1YA2_ZHNDU=/600x523/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1490490-1617812364-9827.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="banner" preview="https://assets.fanart.tv/preview/music/a0c5737e-da6d-468f-a78e-19146494f1db/musicbanner/noize-mc-56a53d66536a1.jpg">https://assets.fanart.tv/fanart/music/a0c5737e-da6d-468f-a78e-19146494f1db/musicbanner/noize-mc-56a53d66536a1.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/a0c5737e-da6d-468f-a78e-19146494f1db/hdmusiclogo/noize-mc-56a530437c853.png">https://assets.fanart.tv/fanart/music/a0c5737e-da6d-468f-a78e-19146494f1db/hdmusiclogo/noize-mc-56a530437c853.png</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/a0c5737e-da6d-468f-a78e-19146494f1db/hdmusiclogo/noize-mc-56a53a161c711.png">https://assets.fanart.tv/fanart/music/a0c5737e-da6d-468f-a78e-19146494f1db/hdmusiclogo/noize-mc-56a53a161c711.png</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://