Although "Avaria" knew only moderate success in Russia during the 1990s, they are considered to be pioneers of house music in that country, as the genre only started to appear there around 2000. Following Zhukov''s death in 2002, the trio slowly lost original popularity and oriented themselves into a mainstream electropop movement. 

=== The origins ===
Towards the end of the eighties Nikolay Timofeev and Alexey Ryzhov met in high school. Both being creative minds with good sense of humor, they started creating humorous material. After being noticed at a KVN (Клуб Весёлых и Находчивых, Klub Vesyolyh i Nahodchivyh, Club of Funny and Smart, is a Russian TV show, a humor contest, which indirectly spanned similar contests in schools, independent from the show), they started receiving invitations to provide entertainment at parties.
