В 5 лет вместе с семьёй переехал в Краснодар. После 9 классов обучения в школе он приехал в Москву. Тогда же началось его увлечение хип-хопом, параллельно он занимался пением и танцами. Закончив школу с золотой медалью, Мельников поступил в МГУ на специальность экономист-менеджер. В 2012 году защитил диплом и поступил на аспирантуру.

В середине января 2013 года МоТ покидает «Soul Kitchen» и становится артистом лейбла «Black Star Inc.». 

В начале марта выходит первый сингл Мота под названием «#МотСтелетЧоСели». Также на этот трек был выпущен клип, режиссером которого выступил Рустам Романов. 
Его трек «В платье красивого цвета» возглавил Хип Хоп Чарт RU TV, а так же вошел в Топ на iTunes в жанре Хип-Хоп/Рэп! 

Популярность этого исполнителя растет с неимоверной скоростью. Последний трек артиста «Молодая кровь» на следующий день после премьеры встал на 3 место в Топе на iTunes в жанре Хип-Хоп/Рэп, а так же собрал более 100 000 просмотров клипа на YouTube! 

Сейчас Мот работает над своим третьим альбомом под названием Чёрточка, который запланирован на осень 2013.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/qH9PC4kw0qZk-1MgUre_ciRoawg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3250148-1498250345-3964.jpeg.jpg">https://img.discogs.com/qfgWosPBV3HNHRpQYHZrw9WOmII=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3250148-1498250345-3964.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/70DbyC7Lpdpq5ccWxE5qoWV0jsM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3250148-1498250344-4072.jpeg.jpg">https://img.discogs.com/RDjNvQg4b6R8adq-QXd724WrkTQ=/600x614/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3250148-1498250344-4072.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ls0B3yIrikLO74dry4me8ciP0Bc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3250148-1498250344-9806.jpeg.jpg">https://img.discogs.com/CvJofj1iPmIb-2Dk_wXSLJdjGU4=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3250148-1498250344-9806.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/SwaDzXZjR_A1zjRsha99M9zVmt0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3250148-1374754135-7654.jpeg.jpg">https://img.discogs.com/x18eWnQQWzeS9G6K997RgpjPcA0=/500x677/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3250148-1374754135-7654.jpeg.jpg</thumb>','a8a685d4-3936-4823-a253-dfbf1e1379cf');
Timmy Trumpet''s breakthrough single "Freaks" with New Zealand rapper Savage was certified gold by the RIAA, six times platinum by ARIA, and triple platinum by Recorded Music NZ. Timmy Trumpet is currently ranked the number 10 DJ in the world, according to the DJ Mag Top 100.On 25 March 2019, Timmy Trumpet became the first trumpet player to perform in zero gravity, a project partnership between the European Space Agency and BigCityBeats. Timothy Jude Smith was born in Sydney, Australia. Timothy started playing the trumpet at an early age of 4 years old, taught by his father. At thirteen, Timothy was named ''Young Musician of the Year'' before being granted a full scholarship to the Conservatorium of Music, where he was tutored by Anthony Heinrich of the Sydney Symphony Orchestra. Within two years he secured a position as the leading solo trumpet player in the Australian All-Star Stage Band. 

=== 2010–2015: Early career in Australia ===
Timothy adopted the stage name Timmy Trumpet and began performing as a trumpeter alongside Australian DJ duo the Stafford Brothers at Australian nightclubs and music festivals. Timothy then taught himself how to DJ and began playing solo shows billed as Timmy Trumpet, incorporating live trumpet into his DJ sets.Timmy Trumpet signed early music releases to Australian record labels OneLove, Central Station and Hussle Recordings, and produced various mix compilations for Ministry of Sound Australia which included national promotional tours.In 2010, Timmy Trumpet consistently played in Western Sydney''s famous Mean Fiddler. While there, he received acclaim from such notable local critics such as Wade Yovanovic, Rollo, Lachy Nash and James Iversen.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/x6ilAJBaTOGIctBFz8BF2c8n3mM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1142687-1533944294-7009.jpeg.jpg">https://img.discogs.com/w2rz-RkJH7D0KhaQATpcONYJ174=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1142687-1533944294-7009.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/vJRiZj6Q1Fi0ydLLLGhY-6JIfLc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1142687-1533943951-1889.jpeg.jpg">https://img.discogs.com/nJVF6WuqDX0PuKX6nd8RScUbPb0=/600x338/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1142687-1533943951-1889.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/FKJhDr6RAdt6WxdrLxIoqf766O8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1142687-1533944042-8129.jpeg.jpg">https://img.discogs.com/4zOio47iFAe1SN7hacsXf450Ihg=/600x337/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1142687-1533944042-8129.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="th