Throughout his career, Balvin has won five Billboard Latin Music Awards, four Latin Grammy Awards, two MTV Video Music Awards and four Latin American Music Awards and received two Grammy Award nominations. In 2017, the BMI Latin Awards named him the Contemporary Latin Songwriter of the Year for his contribution in Latin music industry, and has won the first Global Icon Award given by Lo Nuestro Awards, in recognition of his contribution to spread Latin music worldwide. He became the first Latino to headline world-musical events such as Coachella, Tomorrowland, and Lollapalooza. The Guinness World Records acknowledged him as a "leader of a second-generation reggaeton revolution".His breakthrough came in 2014 with "Ginza" and the single "6 AM" featuring Puerto Rican singer Farruko which peaked at number 2 on the Billboard Hot Latin Songs chart following with "Ay Vamos" and "Ginza". In 2016, he released Energia, which included the hit singles "Ginza", "Bobo", "Safari", and "Sigo Extrañándote".','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/raKe9HjRxKPNcvu-mYvbJ7ekcrU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3460335-1444736886-1407.jpeg.jpg">https://img.discogs.com/U0s1LUMvjtBBcDoTBQQZU-3Elgw=/220x301/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3460335-1444736886-1407.jpeg.jpg</thumb>','5bdeb32d-56a5-4b6d-a768-264101fa0a0a');
He has performed at music festivals such as Coachella, Electric Daisy Carnival, Ultra Music Festival, Tomorrowland, and Creamfields. In 2014 he headlined the 1st edition of Ultra South Africa making this his first major festival. In the same year he became the youngest DJ to headline 2014 Ultra Music Festival at the age of 17. He was a resident DJ at Spain''s Hï Ibiza (2017) and Ushuaïa Ibiza (2016 and 2018). He founded the label Stmpd Rcrds in 2016, months after leaving Spinnin'' Records and before signing with Sony Music. Garrix was born as Martijn Gerard Garritsen on 14 May 1996 in Amstelveen in the Netherlands, the son of Gerard and Karin Garritsen. He has a younger sister named Laura.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3e1f2ee4-16be-4406-bf18-6173840cf2b1/artistthumb/garrix-martin-55aea06e86b6e.jpg">https://assets.fanart.tv/fanart/music/3e1f2ee4-16be-4406-bf18-6173840cf2b1/artistthumb/garrix-martin-55aea06e86b6e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3e1f2ee4-16be-4406-bf18-6173840cf2b1/artistthumb/garrix-martin-55aea486edb37.jpg">https://assets.fanart.tv/fanart/music/3e1f2ee4-16be-4406-bf18-6173840cf2b1/artistthumb/garrix-martin-55aea486edb37.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/3e1f2ee4-16be-4406-bf18-6173840cf2b1/artistthumb/garrix-martin-55aea486eeeb1.jpg">https://assets.fanart.tv/fanart/music/3e1f2ee4-16be-4406-bf18-6173840cf2b1/artistthumb/garrix-martin-55aea486eeeb1.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/HwsFntf7mNr8gw8XAIo8GxAsDco=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3003250-1529544875-8988.jpeg.jpg">https://img.discogs.com/YS70CfzmFwtHRNvx9uoy0FQmjpo=/600x322/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3003250-1529544875-8988.jpeg.jpg</thumb><thumb s