The Cranberries rose to international fame in the 1990s with their debut album, Everybody Else Is Doing It, So Why Can''t We?, which became a commercial success. Some of the band''s hit singles include "Dreams" (1992), "Linger" (1993), "Zombie" (1994), and "Salvation" (1996). Five of the band''s albums reached the Top 20 on the Billboard 200 chart, and eight of their singles reached the Top 20 on the Modern Rock Tracks chart.In early 2009, after a six-year hiatus, the Cranberries reunited and began a North American tour followed by shows in Latin America and Europe. The band''s sixth studio album, Roses, was released in February 2012, and its seventh, Something Else, followed in April 2017. On 15 January 2018, lead singer Dolores O''Riordan was found dead of drowning in a London hotel room. The Cranberries confirmed in September 2018 that they would not continue as a band; their final album, In the End, was released in April 2019 and they disbanded afterward.As of 2019, the Cranberries had sold nearly 50 million albums worldwide.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c98d40fd-f6cf-4b26-883e-eaa515ee2851/artistthumb/cranberries-the-4fd4fb981eb08.jpg">https://assets.fanart.tv/fanart/music/c98d40fd-f6cf-4b26-883e-eaa515ee2851/artistthumb/cranberries-the-4fd4fb981eb08.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c98d40fd-f6cf-4b26-883e-eaa515ee2851/artistthumb/cranberries-the-5b7e3e1e8ffd8.jpg">https://assets.fanart.tv/fanart/music/c98d40fd-f6cf-4b26-883e-eaa515ee2851/artistthumb/cranberries-the-5b7e3e1e8ffd8.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c98d40fd-f6cf-4b26-883e-eaa515ee2851/artistthumb/cranberries-the-5256fb0080feb.jpg">https://assets.fanart.tv/fanart/music/c98d40fd-f6cf-4b26-883e-eaa515ee2851/artistthumb/cranberries-the-5256fb0080feb.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="htt