He has been active since 1994. Solveig manages his own label called Mixture Stereophonic and was ranked number 29 in the 2011 DJ Mag Top 100 DJs. He has collaborated with, among others, Ina Wroldsen, David Guetta, Jax Jones (under their alias Europa), Laidback Luke, Dragonette, Kele of Bloc Party and Madonna. Solveig was born in Paris,. As a child, he joined the choir of The Paris Boys Choir also known in France as Les petits chanteurs de Sainte-Croix de Neuilly, where he had a classical music training and became soprano soloist under the direction of François Polgár. At the age of 18, he became a DJ and then started to work in famous Parisian nightclubs: L''Enfer, Le Queen, Les Bains Douches. 

=== 2002–07: Sur la Terre and Hedonist ===
