In early 2000, both Roberson and Luckett were replaced with Williams and Farrah Franklin; however, Franklin quit after five months, leaving the group as a trio. Their third album, Survivor (2001), whose themes the public interpreted as a channel to the group''s experience, produced the worldwide hits "Independent Women", "Survivor" and "Bootylicious". In 2001, they announced a hiatus to pursue solo careers. The trio reunited two years later for the release of their fifth and final studio album, Destiny Fulfilled (2004), which spawned the international hits "Lose My Breath" and "Soldier". Since the group''s official disbandment in 2006, Knowles, Rowland, and Williams have reunited a couple of times, including at the 2013 Super Bowl halftime show and 2018 Coachella festival.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/a796b92e-c137-4895-9c89-10f900617a4f/artistthumb/destinys-child-50336ebad966b.jpg">https://assets.fanart.tv/fanart/music/a796b92e-c137-4895-9c89-10f900617a4f/artistthumb/destinys-child-50336ebad966b.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/a796b92e-c137-4895-9c89-10f900617a4f/artistthumb/destinys-child-5075bd55b4bad.jpg">https://assets.fanart.tv/fanart/music/a796b92e-c137-4895-9c89-10f900617a4f/artistthumb/destinys-child-5075bd55b4bad.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/CT850TsvKzQhFcLk3snCMEj5Gk8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-22008-1610919253-1639.jpeg.jpg">https://img.discogs.com/SCL6zLnVHYRUEJTEIJ2nTKIbm18=/600x746/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-22008-1610919253-1639.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/mlW-mj8fCqewKEG-i1fyGNyRP1s=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-22008-1485159099-9250.jpeg.jpg