=== Soil (1992–1994) ===
Serj Tankian and Daron Malakian attended Rose and Alex Pilibos Armenian School as children, although due to their eight-year age difference they did not meet until 1992 while working on separate projects at the same recording studio. They formed a band named Soil with Tankian on vocals and keyboards, Malakian on vocals and guitar, Dave Hakopyan (who later played in The Apex Theory/Mt. Helium) on bass and Domingo "Dingo" Laranio on drums. The band hired Shavo Odadjian (another Rose and Alex Pilibos alumnus) as manager, although he eventually joined Soil as rhythm guitarist.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/cc0b7089-c08d-4c10-b6b0-873582c17fd6/artistthumb/system-of-a-down-4fe708498d209.jpg">https://assets.fanart.tv/fanart/music/cc0b7089-c08d-4c10-b6b0-873582c17fd6/artistthumb/system-of-a-down-4fe708498d209.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/iwyNI-VxsTYHL1o5zHxGyUQG1q8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-85889-1603051479-6529.jpeg.jpg">https://img.discogs.com/VSKI7pfLWEn21a1DaSogovkoR_g=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-85889-1603051479-6529.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/o1CW_63KxOlraG2DrWw99_gqNf0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-85889-1447370382-8817.png.jpg">https://img.discogs.com/C0y9sPfsrIjMU98CjbXyOdHUSRc=/600x347/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-85889-1447370382-8817.png.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/uoy2S6AGsECBhc6gaOCKW_1-gLE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-85889-1450359404-6072.jpeg.jpg">https://img.discogs.com/HUHZxkRKoTZeZjmDBQErU9zHlZ8=/400x273/smart/filters:strip_icc():format(jpeg)