In 2003, Benassi released his first solo debut album, Hypnotica, to positive reviews. It incorporates electroclash sounds and many elements of house music, and won the European Border Breakers Award. The following year, the debut album of the Benassi Bros., Pumphonia, was released. Their track "Illusion" became very popular in the American club scene, finally peaking at number 4 on Hot Dance Club Play. Following "Hit My Heart" peaked at 15.
In 2008, his remix of Public Enemy''s "Bring the Noise" won the Grammy Award for Best Remixed Recording at the 50th Grammy Awards. In 2009, Benassi also entered the Top 100 DJs list from DJ Mag at #26, while in 2011 was rated #7 on DJ Poll Top 100 by DJ List web site. 

=== Early days ===
A native of Milan and raised in Reggio Emilia, DJ and producer Benassi, started DJing alongside cousin Alle Benassi in the late 1980s in their hometown, before moving to Larry Pignagnoli''s Off Limits production studio in the mid-1990s, creating music for various acts, including Whigfield, J.K. and Ally & Jo.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/674bf89f-8e70-4472-929d-6b4ed6f98c88/artistthumb/benassi-benny-50032aa012037.jpg">https://assets.fanart.tv/fanart/music/674bf89f-8e70-4472-929d-6b4ed6f98c88/artistthumb/benassi-benny-50032aa012037.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/AK1CDhJxjcSHjdtmtGKr63vlaa0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-93375-1566889532-2270.jpeg.jpg">https://img.discogs.com/XyH5Z7uB6-EePip49Kx52OeZc5Y=/600x709/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-93375-1566889532-2270.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/hIUS6La5K07GphjkTG5VqOy2Kxc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-93375-1566889479-4620.jpeg.jpg">https://img.discogs.com/sE04COYu4s0Zx-gfxEI75CriceE=/600x697/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-93375-1566889479-4620.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/2OcOwDFabdQjo8ML0qBZ0lFD5wQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-93375-1492280534-3550.jpeg.jpg">https://img.discogs.com/JlgJk1dCiWzHr9DUzgzBduEqe9Q=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-93375-1492280534-3550.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/eMKzoE-UkPcGjjDyvUYhvslNQPM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-93375