Derulo released his second single, "In My Head", in December 2009 and his debut studio album, Jason Derulo, followed on March 2, 2010. He released his second album, Future History, on September 16, 2011; the album was preceded by the release of the UK number-one single "Don''t Wanna Go Home". Derulo''s third international album, Tattoos, was released on September 24, 2013, and later repackaged as his third U.S. album, Talk Dirty, released on April 15, 2014.
In 2015, Derulo released his single "Want to Want Me" and announced his fourth studio album, Everything Is 4, which was released on June 2, 2015.
In June 2020, Derulo released the single "Savage Love (Laxed – Siren Beat)" alongside beat producer Jawsh 685. The song went viral on TikTok and was later on remixed by BTS, wherein the remix reached number one in the US, becoming Derulo''s second chart topper in the region.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/6de0f914-3e60-4418-be3b-42e0feb6eb4d/artistthumb/derlo-jason-52474884e2188.jpg">https://assets.fanart.tv/fanart/music/6de0f914-3e60-4418-be3b-42e0feb6eb4d/artistthumb/derlo-jason-52474884e2188.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/6de0f914-3e60-4418-be3b-42e0feb6eb4d/artistthumb/derlo-jason-503fc5dd6205f.jpeg">https://assets.fanart.tv/fanart/music/6de0f914-3e60-4418-be3b-42e0feb6eb4d/artistthumb/derlo-jason-503fc5dd6205f.jpeg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/4LSFrHjnhgUZjhzi7hM1MhicmTY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1551601-1450875456-3497.jpeg.jpg">https://img.discogs.com/yCSA9oDH8tT3aKP00GI90jrzyoQ=/236x354/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1551601-1450875456-3497.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/35OLlkEDSJD5GgkDDqS0aH-uN80=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1551601-1438850234-8238.jpeg.jpg">https://img.discogs.com/CNpGMsi0WBxrzVV6UhD7uqhaSBs=/460x615/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1551601-1438850234-8238.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="banner" preview="https://assets.fanart.tv/preview/music/6de0f914-3e60-4418-be3b-42e0feb6eb4d/musicbanner/derlo-jason-557280b821e81.jpg">https://assets.fanart.tv/fanart/music/6de0f914-3e60-4418-be3b-42e0feb6eb4d/musicbanner/derlo-jason-557280b821e81.jpg</thumb><thumb spoof="" cache="" aspect="clea