He opened the first semi-final of the Eurovision Song Contest 2017 on 9 May. 

=== Early years ===
From 2000 to 2006, he was a member of the Lutsk Breakdance Group ''DBS Crew'', which became the best ''B-boy'' group in west Ukraine. In 2003, he went to the Law Faculty of the Interregional Academy of Personnel Management (Міжрегіональна академія управління персоналом), where in his free time he danced and learned music. Finishing university he received the specialization of a lawyer.


=== Popularity ===
In 2008, he became a finalist during the audition for the show Фабрика зірок - 2 (Star Academy), but he did not become a part of this project. This year singer Natalia Mohylevska asked Dmytro to work on her ballet, during her concert program ''Real O''. This became a true turning point for him, because he agreed and moved to Kyiv.
In 2008, he got together his first music group ''Monatique'', which survived through 2 live concerts in Lutsk. They played in the funk and soul genre.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/2yq2zUfgrbiT2bMPng0jrhiDXgE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3996173-1496323782-9936.jpeg.jpg">https://img.discogs.com/HgvJoEAC0mBue0pejpopU7TXfOI=/600x606/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3996173-1496323782-9936.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/tE09aRquR1yKI8taLGhsL_BbjfU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3996173-1558088216-4762.jpeg.jpg">https://img.discogs.com/x2l3Mk-QTcpxuijq7cpkv3XygGo=/460x533/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3996173-1558088216-4762.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/JekEEPoH1YF9EC2rIv0ZksDbaU4=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3996173-1496323784-6372.jpeg.jpg">https://img.discogs.com/WeiCyTPVXU8Nf-yH6h95rCN4eqs=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3996173-1496323784-6372.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/vtnxt9c4ede_HSqi-GyGcTxQBYE=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3996173-1496323784-7843.jpeg.jpg">https://img.discogs.com/z97JeV5z8XiHi0XC92fxyknX5YI=/600x900/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3996173-1496323784-7843.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/5ScGLUipjNuZAJIuZkn8-9AfYGA=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3996173-1496323782-6906.jpeg.jpg">https://img.