INSERT INTO "music_artist" VALUES (2,'ABBA','','Group','ABBA ( AB-ə, Swedish: [ˈâbːa]) are  a Swedish pop group formed in Stockholm in 1972 by Agnetha Fältskog, Björn Ulvaeus, Benny Andersson, and Anni-Frid Lyngstad. The group''s name is an acronym of the first letters of their first names. They became one of the most commercially successful acts in the history of popular music, topping the charts worldwide from 1974 to 1983. In 1974 ABBA were Sweden''s first winner of the Eurovision Song Contest, with the song "Waterloo", which in 2005 was chosen as the best song in the competition''s history as part of the 50th anniversary celebration of the contest.During the band''s main active years, it consisted of two married couples: Fältskog and Ulvaeus, and Lyngstad and Andersson. With the increase of their popularity, their personal lives suffered, which eventually resulted in the collapse of both marriages. The relationship changes were reflected in the group''s music, with latter compositions featuring darker and more introspective lyrics. After ABBA disbanded, Andersson and Ulvaeus achieved success writing music for the stage, while Lyngstad and Fältskog pursued solo careers.Ten years after their disbanding, a compilation, ABBA Gold was released, which became a worldwide bestseller. In 1999, ABBA''s music was adapted into the successful musical Mamma Mia! that toured worldwide. A film of the same name, released in 2008, became the highest-grossing film in the United Kingdom that year.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/d87e52c5-bb8d-4da8-b941-9f4928627dc8/artistthumb/abba-5263c4eea2d31.jpg">https://assets.fanart.tv/fanart/music/d87e52c5-bb8d-4da8-b941-9f4928627dc8/artistthumb/abba-5263c4eea2d31.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/d87e52c5-bb8d-4da8-b941-9f4928627dc8/artistthumb/abba-4fb28fb1a0f90.jpg">https://assets.fanart.tv/fanart/music/d87e52c5-bb8d-