INSERT INTO "music_artist" VALUES (3,'Ace Of Base','','Group','Ace of Base is a Swedish pop group, formed in 1990, originally consisting of siblings Jonas Berggren, Linn Berggren and Jenny Berggren, with Ulf Ekberg.
INSERT INTO "music_artist" VALUES (4,'Claude Francois','','Person','Claude Antoine Marie François (French pronunciation: ​[klod ɑ̃twan maʁi  fʁɑ̃swa]; 1 February 1939 – 11 March 1978), also known by the nickname Cloclo, was a French pop singer, composer, songwriter, music producer, drummer and dancer. François co-wrote the lyrics of "Comme d''habitude" (composed by Jacques Revaux and himself), the original version of "My Way" and composed the music of "Parce que je t''aime mon enfant", the original version of "My Boy". Among his most famous songs are "Le Téléphone Pleure", "Le lundi au soleil", "Magnolias for Ever", "Alexandrie Alexandra" and "Cette année là".
INSERT INTO "music_artist" VALUES (5,'Frank Sinatra','','Person','Francis Albert Sinatra (; December 12, 1915 – May 14, 1998) was an American singer and actor who was one of the most popular and influential musical artists of the 20th century. He is one of the best-selling music artists of all time, having sold more than 150 million records worldwide.Born to Italian immigrants in Hoboken, New Jersey, Sinatra was greatly influenced by the intimate easy listening vocal style of Bing Crosby and began his musical career in the swing era with bandleaders Harry James and Tommy Dorsey. Sinatra found success as a solo artist after he signed with Columbia Records in 1943, becoming the idol of the "bobby soxers". He released his debut album, The Voice of Frank Sinatra, in 1946. But by the early 1950s, his professional career had stalled and he turned to Las Vegas, where he became one of its best known residency performers as part of the Rat Pack. His career was reborn in 1953 with the success of the film From Here to Eternity, with his performance subsequently earning him an Academy Award and Golden Globe Award for Best Supporting Actor. Sinatra subsequently released several critically lauded albums, some of which are retrospectively noted as being among the first "concept albums", including In the Wee Small Hours (1955), Songs for Swingin'' Lovers! (1956), Come Fly with Me (1958), Only the Lonely (1958), No One Cares (1959), and Nice ''n'' Easy (1960).
INSERT INTO "music_artist" VALUES (6,'George Michael','','Person','George Michael (born Georgios Kyriacos Panayiotou; 25 June 1963 – 25 December 2016) was an English singer, songwriter, record producer, and philanthropist who rose to fame as a member of the music duo Wham! and later embarked on a solo career. At the time of his death, Michael had sold over 115 million records worldwide, making him one of the best-selling music artists of all time. He achieved seven number-one songs on the UK Singles Chart and eight number-one songs on the US Billboard Hot 100. Michael won various music awards, including two Grammy Awards, three Brit Awards, three American Music Awards, 12 Billboard Music Awards, four MTV Video Music Awards, and six Ivor Novello Awards. In 2008, he was ranked 40th on Billboard''s list of the Greatest Hot 100 Artists of All Time.
INSERT INTO "music_artist" VALUES (7,'John Denver','','Person','Henry John Deutschendorf Jr. (December 31, 1943 – October 12, 1997), known professionally as John Denver, was an American singer-songwriter, record producer, actor, activist, and humanitarian, whose greatest commercial success was as a solo singer. After traveling and living in numerous locations while growing up in his military family, Denver began his music career with folk music groups during the late 1960s. Starting in the 1970s, he was one of the most popular acoustic artists of the decade and one of its best-selling artists. By 1974, he was one of America''s best-selling performers; AllMusic has called Denver "among the most beloved entertainers of his era".Denver recorded and released approximately 300 songs, about 200 of which he composed. He had 33 albums and singles that were certified Gold and Platinum in the U.S by the RIAA, with estimated sales of more than 33 million units. He recorded and performed primarily with an acoustic guitar and sang about his joy in nature, disdain for city life, enthusiasm for music, and relationship trials. Denver''s music appeared on a variety of charts, including country music, the Billboard Hot 100, and adult contemporary, earning 12 gold and four platinum albums with his signature songs "Take Me Home, Country Roads", "Poems, Prayers and Promises "Annie''s Song", "Rocky Mountain High", "Calypso", "Thank God I''m a Country Boy", and "Sunshine on My Shoulders".
INSERT INTO "music_artist" VALUES (8,'Michael Jackson','','Person','Michael Joseph Jackson (August 29, 1958 – June 25, 2009) was an American singer, songwriter, and dancer. Dubbed the "King of Pop", he is regarded worldwide as one of the most significant cultural figures of the 20th century for his contributions to music, dance, and fashion, along with his publicized personal life. He influenced artists across many genres, and through stage and video performances, popularized complicated dance moves such as the moonwalk, to which he gave the name, and the robot. He is the most awarded music artist in history.
INSERT INTO "music_artist" VALUES (9,'Queen','','Group','Queen are a British rock band formed in London in 1970. Their classic line-up was Freddie Mercury (lead vocals, piano), Brian May (guitar, vocals), Roger Taylor (drums, vocals) and John Deacon (bass). Their earliest works were influenced by progressive rock, hard rock and heavy metal, but the band gradually ventured into more conventional and radio-friendly works by incorporating further styles, such as arena rock and pop rock.
INSERT INTO "music_artist" VALUES (10,'Toploader','','Group','Toploader are an English rock band, hailing from Eastbourne, East Sussex, who formed in 1997,  with over two million album sales and a few top 20 hits both home and abroad. Their debut album, Onka''s Big Moka, sold over one million units and peaked in the Top 5 of the UK Albums Chart, where it remained for six months. It earned them four nominations at the 2001 Brit Awards. They are recognised most of all for their cover of King Harvest''s US hit "Dancing in the Moonlight" written by Sherman Kelly, which became a global hit for the band. Their second album, Magic Hotel, reached number 3 in the UK Albums Chart. The band reunited in 2009; they continue to tour at various gigs and record music. 
INSERT INTO "music_artist" VALUES (11,'Twisted Sister','','Group','Twisted Sister was an American heavy metal band originally from Ho-Ho-Kus, New Jersey, and later based in Long Island, New York. Their best-known songs include "We''re Not Gonna Take It" and "I Wanna Rock", which had music videos noted for their sense of slapstick humor.
INSERT INTO "music_artist" VALUES (12,'Bonnie Tyler','','Person','Bonnie Tyler (born Gaynor Hopkins, 8 June 1951) is a Welsh singer, known for her distinctive husky voice. Tyler came to prominence with the release of her 1977 album The World Starts Tonight and its singles "Lost in France" and "More Than a Lover". Her 1978 single "It''s a Heartache" reached number four on the UK Singles Chart, and number three on the US Billboard Hot 100.
INSERT INTO "music_artist" VALUES (13,'Kenny Ball','','Person','Kenneth Daniel Ball (22 May 1930 – 7 March 2013) was an English jazz musician, best known as the bandleader, lead trumpet player and vocalist in Kenny Ball and his Jazzmen. Ball was born in Ilford, Essex. At the age of 14 he left school to work as a clerk in an advertising agency, but also started taking trumpet lessons. He began his career as a semi-professional sideman in bands, whilst also working as a salesman and for the advertising agency. He turned professional in 1953 and played the trumpet in bands led by Sid Phillips, Charlie Galbraith, Eric Delaney and Terry Lightfoot before forming his own trad jazz band – Kenny Ball and his Jazzmen – in 1958. His Dixieland band was at the forefront of the early 1960s UK jazz revival.In 1961 their recording of  Cole Porter''s "Samantha" (Pye 7NJ.2040 – released February 1961) became a hit, and they reached No. 2 at the end of 1961 on the UK Singles Chart, and in March 1962 on the Hot 100, with "Midnight in Moscow" (Pye 7NJ.2049 – released November 1961). The record sold over one million copies, earning gold disc status.
INSERT INTO "music_artist" VALUES (14,'Marvin Berry & The Starlighters','','Person','March 31, 1957 -  February 18, 1999.INSERT INTO "music_artist" VALUES (15,'No Doubt','','Group','No Doubt is an American rock band from Anaheim, California, formed in 1986. The band consists of vocalist Gwen Stefani, guitarist Tom Dumont, bassist Tony Kanal, and drummer Adrian Young. Since the mid-1990s, they have been supported by trombonist and keyboardist Gabrial McNair and trumpeter and keyboardist Stephen Bradley in live performances.
INSERT INTO "music_artist" VALUES (16,'Puppini Sisters','','Group','The Puppini Sisters are an English close harmony vocal trio composed of Italian-born singer Marcella Puppini and English singers Kate Mullins and Emma Smith. Although the three are not related, the name was chosen in tribute to The Andrews Sisters. Puppini first studied fashion design at Saint Martins School of Art, and later music at Trinity College of Music in London where she met Mullins and original member Rosanna Schura, who was later replaced by Stephanie O''Brien. After eight years with the group, O''Brien was replaced by Emma Smith. The trio are backed by a three-piece band featuring Martin Kolarides on guitar, Henrik Jensen on double bass and Peter Ibbetson on drums. The group is associated with a burlesque revival. The group was founded in 2004 by Marcella Puppini after she was inspired by the animated film The Triplets of Belleville (Les Triplettes de Belleville) (2003). In 2005 they were signed by UCJ (Universal Classics and Jazz). The Puppini Sisters'' debut single, "Boogie Woogie Bugle Boy", was a cover of the hit single by The Andrews Sisters. The Puppini Sisters'' second album, The Rise and Fall of Ruby Woo includes original compositions by Puppini, Stephanie O''Brien and Kate Mullins.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/L2MaACNwYcXVpUDjxujnZ2mnCks=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-663589-1469637313-7093.jpeg.jpg">https://img.discogs.com/1Q3-a-MWhq9EeU-bG_oD-s-JKhc=/600x780/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-663589-1469637313-7093.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/v0IjVrJ9UEujKYkRwDoIq3iEHsY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-663589-1317797887.jpeg.jpg">https://img.discogs.com/Lt_rXCu-KhvaZYQfRayewsrceWc=/300x260/smart/filters:strip_icc():form