INSERT INTO "music_artist" VALUES (17,'The Puppini Sisters','','Group','The Puppini Sisters are an English close harmony vocal trio composed of Italian-born singer Marcella Puppini and English singers Kate Mullins and Emma Smith. Although the three are not related, the name was chosen in tribute to The Andrews Sisters. Puppini first studied fashion design at Saint Martins School of Art, and later music at Trinity College of Music in London where she met Mullins and original member Rosanna Schura, who was later replaced by Stephanie O''Brien. After eight years with the group, O''Brien was replaced by Emma Smith. The trio are backed by a three-piece band featuring Martin Kolarides on guitar, Henrik Jensen on double bass and Peter Ibbetson on drums. The group is associated with a burlesque revival. The group was founded in 2004 by Marcella Puppini after she was inspired by the animated film The Triplets of Belleville (Les Triplettes de Belleville) (2003). In 2005 they were signed by UCJ (Universal Classics and Jazz). The Puppini Sisters'' debut single, "Boogie Woogie Bugle Boy", was a cover of the hit single by The Andrews Sisters. The Puppini Sisters'' second album, The Rise and Fall of Ruby Woo includes original compositions by Puppini, Stephanie O''Brien and Kate Mullins.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/L2MaACNwYcXVpUDjxujnZ2mnCks=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-663589-1469637313-7093.jpeg.jpg">https://img.discogs.com/1Q3-a-MWhq9EeU-bG_oD-s-JKhc=/600x780/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-663589-1469637313-7093.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/v0IjVrJ9UEujKYkRwDoIq3iEHsY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-663589-1317797887.jpeg.jpg">https://img.discogs.com/Lt_rXCu-KhvaZYQfRayewsrceWc=/300x260/smart/filters:strip_icc():