INSERT INTO "music_artist" VALUES (18,'Elvis Presley','','Person','Elvis Aaron Presley (January 8, 1935 – August 16, 1977), also known simply as Elvis, was an American singer, musician and actor. He is regarded as one of the most significant cultural icons of the 20th century and is often referred to as the "King of Rock and Roll". His energized interpretations of songs and sexually provocative performance style, combined with a singularly potent mix of influences across color lines during a transformative era in race relations, led him to both great success and initial controversy.
