INSERT INTO "music_artist" VALUES (20,'Stoller','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (21,'A-HA','','Group','A-ha (usually stylised as a-ha; Norwegian pronunciation: [ɑˈhɑː]) is a Norwegian synth-pop band formed in Oslo in 1982. Founded by Paul Waaktaar-Savoy (guitars), Magne Furuholmen (keyboards and guitars), and Morten Harket (vocals), the band rose to fame during the mid-1980s.
INSERT INTO "music_artist" VALUES (22,'Michael Jackson, Steve Porcaro, Maxi Anderson, Jesse Corti, Annette Sanders, Geoff Grace','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (23,'Focus','','Group','Focus are a Dutch progressive rock band formed in Amsterdam in 1969 by keyboardist, vocalist, and flautist Thijs van Leer, drummer Hans Cleuver, bassist Martijn Dresden, and guitarist Jan Akkerman. The band have undergone numerous formations in its history; since December 2016, it has comprised van Leer, drummer Pierre van der Linden, guitarist Menno Gootjes, and bassist Udo Pannekeet. They have sold one million RIAA-certified albums in the United States.After the addition of Akkerman to van Leer''s rock trio in late 1969, the band named themselves Focus and initially worked in the band for a Dutch production of the rock musical Hair. Their debut album Focus Plays Focus (1970) gained little attention but the follow-up, Moving Waves (1971), and its lead single "Hocus Pocus", earned the band international recognition. Their success continued with Focus 3 (1972) and Hamburger Concerto (1974), the former containing their second hit single, "Sylvia". After recording two albums with various musicians, including guitarist Phillip Catherine, singer P. J. Proby, and drummers Colin Allen, David Kemper, and Steve Smith, Focus dissolved in 1978. They briefly reunited in 1990 and 1997.
INSERT INTO "music_artist" VALUES (24,'Louis Armstrong','','Person','Louis Daniel Armstrong (August 4, 1901 – July 6, 1971), nicknamed "Satchmo", "Satch", and "Pops", was an American trumpeter and vocalist who is among the most influential figures in jazz. His career spanned five decades and different eras in the history of jazz.Armstrong was born and raised in New Orleans. Coming to prominence in the 1920s as an inventive trumpet and cornet player, Armstrong was a foundational influence in jazz, shifting the focus of the music from collective improvisation to solo performance. Around 1922, he followed his mentor, Joe "King" Oliver, to Chicago to play in the Creole Jazz Band. In Chicago, he spent time with other popular jazz musicians, reconnecting with his friend Bix Beiderbecke and spending time with Hoagy Carmichael and Lil Hardin. He earned a reputation at "cutting contests" and his fame reached band leader Fletcher Henderson.  Henderson persuaded Armstrong to come to New York City, where he became a featured and musically influential band soloist and recording artist.  Hardin became Armstrong''s second wife and they returned to Chicago to play together and then he began to form his own "Hot" jazz bands.  After years of touring, he settled in Queens, and by the 1950s, he was a national musical icon, assisted in part, by his appearances on radio and in film and television, in addition to his concerts.
INSERT INTO "music_artist" VALUES (25,'The Beatles','','Group','The Beatles were an English rock band formed in Liverpool in 1960. The group, whose best-known line-up comprised John Lennon, Paul McCartney, George Harrison and Ringo Starr, are regarded as the most influential band of all time. They were integral to the development of 1960s counterculture and popular music''s recognition as an art form. Rooted in skiffle, beat and 1950s rock and roll, their sound incorporated elements of classical music and traditional pop in innovative ways; the band later explored music styles ranging from ballads and Indian music to psychedelia and hard rock. As pioneers in recording, songwriting and artistic presentation, the Beatles revolutionised many aspects of the music industry and were often publicised as leaders of the era''s youth and sociocultural movements.Led by primary songwriters Lennon and McCartney, the Beatles built their reputation playing clubs in Liverpool and Hamburg over three years from 1960, initially with Stuart Sutcliffe playing bass. The core trio of Lennon, McCartney and Harrison, together since 1958, went through a succession of drummers, including Pete Best, before asking Starr to join them in 1962. Manager Brian Epstein moulded them into a professional act, and producer George Martin guided and developed their recordings, greatly expanding their domestic success after their first hit, "Love Me Do", in late 1962. As their popularity grew into the intense fan frenzy dubbed "Beatlemania", the band acquired the nickname "the Fab Four", with Epstein, Martin and other members of the band''s entourage sometimes given the informal title of "fifth Beatle".
INSERT INTO "music_artist" VALUES (26,'Elton John','','Person','Note: Please use the entry [a825268] when credited together [NB Only do this when no other writer is involved in which case you must credit them separately].INSERT INTO "music_artist" VALUES (27,'Huey Lewis and the News','','Group','Huey Lewis and the News is an American rock band based in San Francisco, California. They had a run of hit singles during the 1980s and early 1990s, eventually achieving 19 top ten singles across the Billboard Hot 100, Adult Contemporary, and Mainstream Rock charts.
