INSERT INTO "music_artist" VALUES (109,'Время и Стекло','','Group','Time And Glass (Russian: Время и Стекло "Time and Glass", pun on время истекло "time''s up") was a Ukrainian pop duo formed in Ukraine by Potap. The group consisted of Oleksiy Zavgorodniy and Nadya Dorofeeva. In 2010, Irina Gorovoj and Potap formed the production company ''MOZGI Entertainment'', and invited Oleksiy Zavgorodniy to participate in their new project. After conducting online casting and a direct casting campaign in Kyiv, Nadya Dorofeeva, winner of the festival ''Black Sea Games'', was chosen to be the female vocalist in the new duo.Oleksiy and Nadya were the participants and guests of large-scale music events, such as, the "Golden Gramophone Award", the "Crimea Music Fest", the "Slavianski Bazaar", "YUNA", "RU.TV Music Award" and others.
