INSERT INTO "music_artist" VALUES (114,'John Elton','','Person','Sir Elton Hercules John  (born Reginald Kenneth Dwight; 25 March 1947) is an English singer, songwriter, pianist, and composer. Collaborating with lyricist Bernie Taupin since 1967 on more than 30 albums, John has sold over 300 million records, making him one of the best-selling music artists of all time. He has more than fifty Top 40 hits in the UK Singles Chart and US Billboard Hot 100, including seven number ones in the UK and nine in the US, as well as seven consecutive number-one albums in the US. His tribute single "Candle in the Wind 1997", rewritten in dedication to Diana, Princess of Wales, sold over 33 million copies worldwide and is the best-selling single in the history of the UK and US singles charts. He has also produced records and occasionally acted in films. John owned Watford F.C. from 1976 to 1987 and from 1997 to 2002. He is an honorary life president of the club.Raised in the Pinner area of Greater London, John learned to play piano at an early age, and by 1962 had formed Bluesology, an R&B band with whom he played until 1967. He met his longtime musical partner Taupin in 1967, after they both answered an advert for songwriters. For two years, they wrote songs for artists including Lulu, and John worked as a session musician for artists including the Hollies and the Scaffold. In 1969, John''s debut album, Empty Sky, was released. In 1970, his first hit single, "Your Song", from his second album, Elton John, became his first top ten in both the UK and the US. His most commercially successful period, 1970–1976, included Honky Château (1972), Don''t Shoot Me I''m Only the Piano Player (1973), Goodbye Yellow Brick Road (1973) and his first Greatest Hits compilation — the latter two among the official best-selling albums worldwide.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-4fd27119da4c4.jpg">https://assets.fanart.tv/fanart/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-4fd27119da4c4.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-53bcb93001afa.jpg">https://assets.fanart.tv/fanart/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-53bcb93001afa.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-53bcb95bc8a46.jpg">https://assets.fanart.tv/fanart/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-53bcb95bc8a46.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-53bcb985e7b93.jpg">https://assets.fanart.tv/fanart/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-53bcb985e7b93.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-4fd27119d9ed7.jpg">https://assets.fanart.tv/fanart/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-4fd27119d9ed7.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-4fd27119da890.jpg">https://assets.fanart.tv/fanart/music/b83bc61f-8451-4a5d-8b8e-7e9ed295e822/artistthumb/john-elton-4fd27119da890.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/qsUbt4NvLMaa7iMy9lbabQZkRKA=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-57103-1619472775-8523.jpeg.jpg">https://img.discogs.com/dvmkocrT1XaN15tFtMmQzu-SMRc=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-57103-1619472775-8523.jpeg.jpg</thumb><thumb spoof="" 