INSERT INTO "music_artist" VALUES (115,'Demi Lovato','','Person','Demetria Devonne Lovato ( lə-VAH-toh; born August 20, 1992) is an American singer, songwriter, and actor. After appearing on the children''s television series Barney & Friends (2002–2004), Lovato rose to prominence for their role as Mitchie Torres in the musical television film Camp Rock (2008) and its sequel Camp Rock 2: The Final Jam (2010); the former film''s soundtrack contained "This Is Me", Lovato''s debut single and duet with Joe Jonas, which peaked at number nine on the Billboard Hot 100.
INSERT INTO "music_artist" VALUES (116,'Muse','','Group','Muse are an English rock band from Teignmouth, Devon, formed in 1994. The band consists of Matt Bellamy (lead vocals, guitar, keyboards), Chris Wolstenholme (bass guitar, backing vocals), and Dominic Howard (drums).
INSERT INTO "music_artist" VALUES (117,'Smash Mouth','','Group','Smash Mouth is an American rock band from San Jose, California. The band was formed in 1994, and was originally composed of Steve Harwell (lead vocals), Kevin Coleman (drums), Greg Camp (guitar), and Paul De Lisle (bass). They are known for their songs "Walkin'' on the Sun" (1997), "All Star" (1999), and "Then The Morning Comes" (1999), as well as a cover of The Monkees'' "I''m a Believer" (2001).
INSERT INTO "music_artist" VALUES (118,'The Bloody Beetroots','','Group','The Bloody Beetroots is an Italian electronic dance music project of musician and producer Bob Rifo (also Sir Bob Cornelius Rifo and SBCR, born Simone Cogo). Established in late 2006, the Bloody Beetroots were initially a duo consisting of Bob Rifo and Tommy Tea, who later left in 2012. The project is well known for the black mask, reminiscent of comic book characters, Spider-Man, Venom, and Grendel, that various members have worn during performances and other public appearances. Since 2016 Rifo performs with the "NO" mask. The leader of the band, Sir Bob Cornelius Rifo, was born in 1977 in Bassano del Grappa, Italy. He lives in Venice Beach, California. He is a classically trained musician, but gained reputation for producing music with styles ranging from punk rock to the new wave of the 1980s. His identity remains largely anonymous. In fact, the only identifying public feature he has is the year "1977" tattooed across his chest, which is the year of his birth, that coincided with the year punk-rock was born. Rifo, a music producer, DJ and photographer uses the pseudonym the Bloody Beetroots himself.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/p5MlslCebqrzZ5DCi_upZ5OXqSo=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1100480-1379725798-4790.jpeg.jpg">https://img.discogs.com/Ch-DhfQIT6Mwqgi_OOTu2RujuJE=/540x720/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1100480-1379725798-4790.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/tB7zyNYvoP9xQr92-CXwxgP_PTY=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1100480-1379793000-1268.jpeg.jpg">https://img.discogs.com/Eh2fjw3_xNlEUqGht2mOMPC6I8E=/500x342/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1100480-1379793000-1268.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/NaLQMQqd9ZZm_J-z9oZgm9mqhmg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1100480-1379725966-1717.jpeg.jpg">https://img.discogs.com/6lBplT7eZoe1irBjsMN5eQ9us7A=/598x498/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1100480-1379725966-1717.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/30d639db-5c8f-494e-a937-460a4b67f3b4/musiclogo/the-bloody-beetroots-4e9a3287d0f60.png">https://assets.fanart.tv/fanart/music/30d639db-5c8f-494e-a937-460a4b67f3b4/musiclogo/the-bloody-beetroots-4e9a3287d0f60.png</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/30d639db-5c8f-494e-a937-460a4b67f3b4/artistbackground/the-bloody-beetroots-4e26d2b37997b.jpg">https://assets.fanart.tv/fanart/music/30d639db-5c8f-494e-a937-460a4b67f3b4/artistbackground/the-bloody-beetroots-4e26d2b37997b.jpg</thumb>','30d639db-5c8f-494e-a937-460a4b67f3b4');
INSERT INTO "music_artist" VALUES (119,'Paul McCartney & Youth','','Group','The Fireman are an English experimental music duo of Paul McCartney and Youth formed in the early 1990s. Their music catalogue ranges from rock to electronica, evolving over more than two decades and three albums. Although officially anonymous until 2008 with the release of the album Electric Arguments, the group members'' names had been known to the public since soon after the release of their first album.In 1993, the Fireman released its first album, Strawberries Oceans Ships Forest, and followed that with Rushes in 1998. In 2000, Youth also took part in McCartney''s similarly styled Liverpool Sound Collage. Their most recent album is Electric Arguments (2008).
INSERT INTO "music_artist" VALUES (120,'Tommee Profitt','','Person','Tommee James Profitt (born November 12, 1984) is an American songwriter and producer. Profitt is originally from Grand Rapids, Michigan, United States. He moved to Nashville, Tennessee in 2017 to continue his music career. He has worked on the production and sound development of rapper NF. In later years, he has also worked in film and television music. His music has been featured in  24, Legacies, Quantico, The Good Doctor, Prison Break, The Rookie, America''s Got Talent, Empire, Bones, The Handmaid''s Tale, The Hunger Games: Mockingjay Part 2, NFL, TYR Sport, and others. He has won two Dove Awards and has been nominated for five.His music has also been used for video game promos and scores including Ghost Recon Breakpoint, Apex Legends, Assassin''s Creed, UFC2 and Madden. Recently, Profitt held the Top TV Song for two consecutive weeks with covers of Linkin Park''s "In The End," featuring singer-songwriter Fleurie and American rapper Jung Youth. Another collaboration, "Wake Me Up," featuring Fleurie, charted on iTunes Top 50 and on Spotify''s Top 50 Viral chart. Profitt is known for his production work with American rapper NF. The two met in Michigan while NF was starting out as a rapper and Profitt was transitioning from being a full-time artist to a producer. Profitt signed his publishing deal with Capitol CMG Publishing in 2014, the same year that NF signed to Capitol Christian Music Group as an artist.','','32b21b39-d65c-4c6e-811c-f5618b6806af');
INSERT INTO "music_artist" VALUES (121,'Tommee Profitt, Mike Mains','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (122,'Katy Perry','','Person','Katheryn Elizabeth Hudson (born October 25, 1984), known professionally as Katy Perry, is an American singer, songwriter, and television judge. After singing in church during her childhood, she pursued a career in gospel music as a teenager. Perry signed with Red Hill Records and released her debut studio album Katy Hudson under her birth name in 2001, which was commercially unsuccessful. She moved to Los Angeles the following year to venture into secular music after Red Hill ceased operations and she subsequently began working with producers Glen Ballard, Dr. Luke, and Max Martin. After adopting the stage name ''Katy Perry'' (from her mother''s maiden name) and being dropped by The Island Def Jam Music Group and Columbia Records, she signed a recording contract with Capitol Records in April 2007.
INSERT INTO "music_artist" VALUES (123,'Pentatonix','','Group','Pentatonix (abbreviated PTX) is an American a cappella group from Arlington, Texas, consisting of vocalists Scott Hoying (baritone), Mitch Grassi (tenor), Kirstin Maldonado (mezzo-soprano), Kevin Olusola (vocal percussion), and Matt Sallee (bass). Characterized by their pop-style arrangements with vocal harmonies, basslines, riffing, percussion, and beatboxing, they produce cover versions of modern pop works or Christmas songs, sometimes in the form of medleys, along with original material. Pentatonix formed in 2011 and subsequently won the third season of NBC''s The Sing-Off, receiving $200,000 and a recording contract with Sony Music. When Sony''s Epic Records dropped the group after The Sing-Off, the group formed its YouTube channel, distributing its music through Madison Gate Records, a label owned by Sony Pictures. Their YouTube channel currently has over 19 million subscribers and 5 billion views. The group''s video tribute to Daft Punk had received more than 347 million views as of April 6, 2021.Their debut EP PTX, Volume 1 was released in 2012, followed by their holiday release PTXmas the same year, with Pentatonix''s third release, PTX, Vol. II, debuting at number 1 on Billboard''s Independent Albums chart and number 10 on the Billboard 200 in 2013. In May 2014, Pentatonix signed with RCA Records, a "flagship" label of Sony Music Entertainment, while in the same year, the group released their fourth EP, PTX, Vol. III, and two full-length studio albums; PTX, Vols. 1 & 2, a compilation album released in Japan, Korea and Australia, and their second holiday release, That''s Christmas to Me, with the album certified gold by the Recording Industry Association of America (RIAA), platinum on December 24, 2014, and double platinum on February 11, 2016, becoming the highest-charting holiday album by a group since 1962, and the fourth-best-selling album in the United States in 2014.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/79c67eb5-3851-4b28-bfe0-3adfcd6f58d7/artistthumb/pentatonix-52b58d9230aae.jpg">https://assets.fanart.tv/fanart/music/79c67eb5-3851-4b28-bfe0-3adfcd6f58d7/artistthumb/pentatonix-52b58d9230aae.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/07eD76Ea_VpuT81D8QE2NYuhPUs=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3189736-1609474496-1795.jpeg.jpg">https://img.discogs.com/pocsLeDWM1ZY2l7jPxbI6fJQ88c=/600x454/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3189736-1609474496-1795.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/5BBCd2G6tS3jxCHYruZn6I2-xU8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3189736-1593447483-1426.jpeg.jpg">https://img.discogs.com/mvOMxBV3IIv76RUc3B0OHootDyE=/600x598/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3189736-1593447483-1426.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Se6rDE0KaTndnXSZI4h_RKTod1I=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3189736-1593447483-8803.jpeg.jpg">https://img.discogs.com/QXUxLbkjLlEbCnIHQnBAvAbD_Sc=/600x750/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3189736-1593447483-8803.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/D9nBxaD0-ihXet-PkfH9Duc7vpk=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3189736-1593447484-1423.jpeg.jpg">https://img.discogs.com/CavLrBftjo2iDGr-wg8ggHNhKEY=/600x337/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3189736-1593447484-1423.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/sAI4KlNtrnRQ4nLKIutcfSEGqvo=/150x150/smart/fi