INSERT INTO "music_artist" VALUES (124,'Kanye West','','Person','[b]Kanye Omari West[/b] (born June 8, 1977) is an American rapper, singer, songwriter, record producer, director, entrepreneur, and fashion designer. He first gained prominence as a producer for [l=Roc-A-Fella Records]; he achieved recognition for his work on rapper [a=Jay-Z]''s [i][m=46989][/i] (2001), as well as hit singles for musical artists including [a=Alicia Keys], [a=Ludacris], and [a=Janet Jackson]. His style of production originally used high-pitched vocal samples from soul songs incorporated with his own drums and instruments. He later broadened his influences to include 1970s R&B, baroque pop, trip hop, arena rock, house, folk, alternative, electronica, synthpop, industrial, and classical music. INSERT INTO "music_artist" VALUES (125,'Quadro Nuevo','','Group','Quadro Nuevo is a German acoustic quartet which was founded in 1996 and can be categorized as World Music and Jazz. The band is composed of Robert Wolf (1996–2008), Mulo Francel, D.D. Lowka, Andreas Hinterseher (original Heinz-Ludger Jeromine) and since 2008 Evelyn Huber.
INSERT INTO "music_artist" VALUES (126,'Mulo Francel','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (127,'Мелодия','','Group','Instrumental jazz ensemble "Melodia" was formed by [url=http://www.discogs.com/artist/%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B9+%D0%93%D0%B0%D1%80%D0%B0%D0%BD%D1%8F%D0%BD]Georgiy Garanyan[/url] and [a1653634] from members of disbanded Concert jazz orchestra of Soviet radio and Central TV (leader [url=http://www.discogs.com/artist/%D0%92%D0%B0%D0%B4%D0%B8%D0%BC+%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9]Vadim Lyudvikovsky[/url]) in 1973.INSERT INTO "music_artist" VALUES (128,'Nicholas Britell','','Person','Nicholas Britell (born October 17, 1980) is an American composer, pianist, and film producer based in New York City. He has scored both of Barry Jenkins'' studio films, Moonlight (2016) and If Beale Street Could Talk (2018), both of which received nominations for Best Original Score at the Academy Awards. He has also worked with Adam McKay, scoring his two most recent films, The Big Short (2015) and Vice (2018). The HBO original series Succession (2018–present) marked Britell''s entry into television. Britell scored every episode of the first and second season, earning the Emmy Award for Outstanding Original Main Title Theme Music and the Hollywood Music in Media Award for Best Original Score – TV Show/Limited Series. His score for the second season of Succession was nominated in 2020 for the Emmy Award for Outstanding Music Composition for a Series (Original Dramatic Score). 
INSERT INTO "music_artist" VALUES (129,'Black Sabbath','','Group','Black Sabbath were an English rock band formed in Birmingham in 1968 by guitarist Tony Iommi, drummer Bill Ward, bassist Geezer Butler and vocalist Ozzy Osbourne. They are often cited as pioneers of heavy metal music. The band helped define the genre with releases such as Black Sabbath (1970), Paranoid (1970), and Master of Reality (1971). The band had multiple line-up changes following Osbourne''s departure in 1979, with Iommi being the only constant member throughout its history.
