INSERT INTO "music_artist" VALUES (140,'Alan Silvestri','','Person','Alan Anthony Silvestri (born March 26, 1950) is an American composer and conductor of film and television scores. His credits include the Back to the Future film series, Forrest Gump, Lilo & Stitch, The Polar Express, and several Marvel Cinematic Universe films, including the Avengers films (except for Avengers: Age of Ultron). He is a two-time Academy Award and Golden Globe Award nominee, and a three-time Saturn Award and two-time Primetime Emmy Award recipient. Silvestri''s grandparents emigrated in 1909 from the Italian town of Castell''Alfero, and settled in Teaneck, New Jersey. He grew up in Teaneck, and graduated in 1968 from  Teaneck High School. He went to Berklee College of Music for two years. Silvestri was a drummer for a short time in 1966 with Teaneck-based rock band The Herd. Silvestri started his film/television composing career in 1972 at age 21 composing the score for the low-budget action film The Doberman Gang.
INSERT INTO "music_artist" VALUES (141,'Kristen Bell & Santino Fontana','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (142,'Kristen Bell, Santino Fontana','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (143,'MARVEL','','Person','Consistent innovation in his approach to music composition and the never-dying effort to ''work the angles'' on subject matter and concepts through clever yet intelligent wordplay, Marvel has evolved to become one of our nation''s forerunners for hip-hop creativity. INSERT INTO "music_artist" VALUES (144,'Pharrell Williams','','Person','Pharrell Lanscilo Williams (; born April 5, 1973) is an American singer-songwriter, record producer, fashion designer, and entrepreneur. Alongside close friend Chad Hugo, he formed the hip hop and R&B production duo The Neptunes in the early 1990s, with whom he has produced songs for various recording artists. In 1999, he became lead vocalist of the band N.E.R.D., which he formed with Hugo and drummer Shay Haley.
INSERT INTO "music_artist" VALUES (145,'Taron Egerton','','Person','Taron Egerton ( EJ-ər-tən; born 10 November 1989) is a Welsh actor. He is the recipient of a Golden Globe Award, and has received nominations for a Grammy Award and two British Academy Film Awards.
INSERT INTO "music_artist" VALUES (146,'Tyler Bates','','Person','Tyler Bates (born June 5, 1965) is an American musician, producer, and composer for film, television, and video game scores. Much of his work is in the action and horror film genres, with films like Dawn of the Dead, 300, Sucker Punch, and the John Wick franchise. He has collaborated with directors like Zack Snyder, Rob Zombie, Neil Marshall, William Friedkin, Scott Derrickson, James Gunn, Chad Stahelski and David Leitch. In addition, he is also the former lead guitarist of the American rock band Marilyn Manson, and produced its albums The Pale Emperor and Heaven Upside Down. 
