INSERT INTO "music_artist" VALUES (149,'фрукты','','','Russian band from Saint Petersburg, founded in 2008.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/UHYPL7UTdCjvpANMp8i8iWOuE6U=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-7024816-1551809443-5156.jpeg.jpg">https://img.discogs.com/HiYKJHUpOwPfhe-WVsjglhK02TU=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-7024816-1551809443-5156.jpeg.jpg</thumb>',NULL);
