INSERT INTO "music_artist" VALUES (151,'Brian Tyler','','Person','Brian Theodore Tyler (born May 8, 1972) is an American composer, musician, conductor, arranger, and producer, known for his film, television, and video game scores. Across his 24 year career, Tyler has scored Transformers: Prime, Eagle Eye, The Expendables trilogy, Iron Man 3, Avengers: Age of Ultron with Danny Elfman, Now You See Me, and Crazy Rich Asians, among others. He also re-arranged the current fanfare of the Universal Pictures logo, originally composed by Jerry Goldsmith, for its 100th anniversary. The fanfare debuted with The Lorax (2012). Tyler also composed the 2013–2016 Marvel Studios logo which debuted with Thor: The Dark World (2013), the NFL Sunday Countdown Theme for ESPN, the Formula One theme (also used in Formula 2 and Formula 3), and five installments of the Fast & Furious franchise. He also composed the soundtrack for the Paramount TV series Yellowstone. For his work as a film composer, he has won the IFMCA Awards 2014 Composer of the Year.
INSERT INTO "music_artist" VALUES (152,'Mark Mothersbaugh','','Person','Mark Allen Mothersbaugh (; born May 18, 1950) is an American singer, songwriter, composer, multi-instrumentalist, record producer, author and visual artist.
INSERT INTO "music_artist" VALUES (153,'Alan Silvestri, Mark Graham, Jonathan Bartz, Adam Olmsted','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (154,'P!nk','','Person','Alecia Beth Moore (born September 8, 1979), known professionally as Pink (stylized as P!nk), is an American singer and songwriter. She was originally a member of the girl group Choice. In 1995, LaFace Records saw potential in Pink and offered her a solo recording contract. Her R&B-influenced debut studio album Can''t Take Me Home (2000) was certified double-platinum in the United States and spawned two Billboard Hot 100 top-ten songs: "There You Go" and "Most Girls". She gained further recognition with the collaborative single "Lady Marmalade" from the Moulin Rouge! soundtrack, which topped many charts worldwide. Refocusing her sound to pop rock with her second studio album Missundaztood (2001), the album sold more than 13 million copies worldwide and yielded the international number-one songs "Get the Party Started", "Don''t Let Me Get Me", and "Just Like a Pill".
INSERT INTO "music_artist" VALUES (155,'Dave Brubeck','','Person','David Warren Brubeck (; December 6, 1920 – December 5, 2012) was an American jazz pianist and composer, considered one of the foremost exponents of cool jazz. Many of his compositions have become jazz standards including "In Your Own Sweet Way" and "The Duke". Brubeck''s style ranged from refined to bombastic, reflecting both his mother''s classical training and his own improvisational skills. His music is known for employing unusual time signatures as well as superimposing contrasting rhythms, meters, and tonalities.
INSERT INTO "music_artist" VALUES (156,'Idina Menzel, Aurora','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (157,'Joan Jett & The Blackhearts','','Group','Joan Jett (born Joan Marie Larkin, September 22, 1958) is an American rock singer, songwriter, composer, musician, record producer, and actress. Jett is best known for her work as the frontwoman of her band Joan Jett & the Blackhearts, and for earlier founding and performing with the Runaways, which recorded and released the hit song "Cherry Bomb". With The Blackhearts, Jett is known for her rendition of the song "I Love Rock ''n Roll" which was number-one on the Billboard Hot 100 for seven weeks in 1982. Jett''s other notable songs include "Bad Reputation", "Crimson and Clover", "Do You Wanna Touch Me (Oh Yeah)", "Light of Day", "I Hate Myself for Loving You" and "Dirty Deeds".
INSERT INTO "music_artist" VALUES (158,'The Zombies','','Group','The Zombies are an English rock band formed in 1960 in St Albans and led by keyboardist and vocalist Rod Argent and vocalist Colin Blunstone. The group scored a British and American hit in 1964 with "She''s Not There". In the US, two further singles—"Tell Her No" in 1965 and "Time of the Season" in 1968—were also successful. Their 1968 album Odessey and Oracle is ranked number 100 on Rolling Stone''s list of the 500 Greatest Albums of All Time. The Zombies were inducted into the Rock and Roll Hall of Fame in 2019. 
INSERT INTO "music_artist" VALUES (159,'The Sneepers','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (160,'Tyler Bates & James Gunn','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (161,'John Williams','','Person','John Towner Williams (born February 8, 1932) is an American composer, conductor, pianist and trombonist. In a career that has spanned nearly seven decades, he has composed some of the most popular, recognizable, and critically acclaimed film scores in cinematic history. Williams has won 25 Grammy Awards, seven British Academy Film Awards, five Academy Awards, and four Golden Globe Awards. With 52 Academy Award nominations, he is the second most-nominated individual, after Walt Disney. His compositions are considered the epitome of film music. In 2005, the American Film Institute selected Williams''s score to 1977''s Star Wars as the greatest film score of all time. The Library of Congress also entered the Star Wars soundtrack into the National Recording Registry for being "culturally, historically, or aesthetically significant".Williams has composed for many critically acclaimed and popular movies, including the Star Wars saga, Jaws, Close Encounters of the Third Kind, Superman, E.T. the Extra-Terrestrial, Home Alone, the Indiana Jones films, the first two Jurassic Park films, Schindler''s List, and the first three Harry Potter films. Williams has also composed numerous classical concertos and other works for orchestral ensembles and solo instruments. He served as the Boston Pops'' principal conductor from 1980 to 1993 and is its laureate conductor. He has been associated with director Steven Spielberg since 1974, composing music for all but five of his feature films, and George Lucas, with whom he has worked on both of Lucas'' main franchises.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/53b106e7-0cc6-42cc-ac95-ed8d30a3a98e/artistthumb/williams-john-4ffcc5e608925.jpg">https://assets.fanart.tv/fanart/music/53b106e7-0cc6-42cc-ac95-ed8d30a3a98e/artistthumb/williams-john-4ffcc5e608925.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets