INSERT INTO "music_artist" VALUES (162,'Capital Cities','','Group','Capital Cities is an American pop duo from Los Angeles, California, formed in 2010 by Ryan Merchant (vocals, keyboard, guitar) and Sebu Simonian (vocals, keyboard). Their debut EP was released on June 7, 2011, with lead single "Safe and Sound" which became their first top ten hit single. The band currently consists of Ryan Merchant, Sebu Simonian, Manny Quintero on bass guitar, Spencer Ludwig on trumpet, Nick Merwin on guitar and Channing Holmes on drums.
INSERT INTO "music_artist" VALUES (163,'Daryl Hall, Daryl Hall & John Oates','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (164,'Sixpence None The Richer','','Group','Sixpence None the Richer (also known as Sixpence) is an American Christian alternative rock band that formed in New Braunfels, Texas, eventually settling in Nashville, Tennessee. They are best known for their songs "Kiss Me" and "Breathe Your Name" and their covers of "Don''t Dream It''s Over" and "There She Goes". The name of the band is inspired by a passage from the book Mere Christianity by C. S. Lewis. The band received two Grammy Award nominations, Best Pop Performance by a Duo or Group with Vocals for "Kiss Me" and Grammy Award for Best Rock Gospel Album for Sixpence None the Richer (1997). 
INSERT INTO "music_artist" VALUES (165,'Брайан Тайлер','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (166,'2WEI','','Group','2WEI or 2WEI Music is a composer team founded by Christian Vorländer and Simon Heeger in early 2016. The group is based in Hamburg, Germany. Their music has been featured in numerous movie trailers including Wonder Woman and Darkest Hour.  Christian Vorländer and Simon Heeger have known each other since college, after which they pursued different career paths. Vorländer began working for Hans Zimmer and Junkie XL in Los Angeles, while Heeger worked at advertising music houses like Mophonics and Yessian.Vorländer returned to Germany in 2015, and in 2016 they joined forces and formed 2WEI, combining their skills from the advertising and film score music world.Since then, the group has had a continuous success, licensing their tracks for various promotional campaigns. Most recently their tracks have been used in a series of animations created by YouTube user SAD-ist, based on events in the Dream SMP, a Minecraft server dedicated to improvisational role-playing. The popularity of these animations resulted in the group providing SAD-ist with an unreleased track to use specifically for her animation, as well as providing the sound design.The composer duo has had their tracks promoted to various trailer houses and music editors by Position Music, the label which they are currently working with. Soon after, their music was chosen to be featured in various major Hollywood movie trailers. 
INSERT INTO "music_artist" VALUES (167,'Van Halen','','Group','Van Halen ( van HAY-len) were an American rock band formed in Pasadena, California in 1974. Credited with "restoring hard rock to the forefront of the music scene", Van Halen was known for its energetic live shows and for the virtuosic talent of its prodigy lead guitarist, Eddie Van Halen. The band was inducted into the Rock and Roll Hall of Fame in 2007.
INSERT INTO "music_artist" VALUES (168,'Beyoncé & Donald Glover & Billy Eichner & Seth Rogen','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (169,'Various Аrtists','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (170,'Propellerheads','','Group','Propellerheads were an English electronic music duo, formed in 1995 in Bath and consisting of Will White and Alex Gifford. Their first release was an EP named Dive!, released in 1996 through the independent label Wall of Sound. They gained fame the next year by providing a remix for James Bond movie composer David Arnold''s Bond tribute album Shaken & Stirred: The David Arnold James Bond Project covering John Barry''s "On Her Majesty''s Secret Service", the theme song to the sixth James Bond film, re-orchestrated by Arnold. They also collaborated with Arnold on the track "Backseat Driver" for the soundtrack of the Bond film Tomorrow Never Dies. The single "History Repeating" followed, a collaboration with Shirley Bassey (also well known for her James Bond music), fusing big beat with jazz. "History Repeating" was used as the theme for So Graham Norton and was also featured in the Farrelly Brothers'' film There''s Something About Mary.
INSERT INTO "music_artist" VALUES (171,'Marvin Gaye, Tammi Terrell','','','','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/y-UQ8aZiFjS03vhe0BI7qUj1TvU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-517766-1447941780-2795.jpeg.jpg">https://img.discogs.com/ACQS7wmsk0csyj0F370xRpVQMZc=/359x250/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-517766-1447941780-2795.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/hDQBM6v78seyTbnWpvlhOWxTyP0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-517766-1344997986-2752.jpeg.jpg">https://img.discogs.com/iDjqw3EdeoBnwqTRpPDeY9AtkLM=/600x557/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-517766-1344997986-2752.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Bowfl0mcu5BSC85nNeh142Jqo4E=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-517766-1169713072.jpeg.jpg">https://img.discogs.com/hX6k46sEDg-SNmPhWSKK0LYQfIc=/358x470/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-517766-1169713072.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/r94qpSHAbdhiHHsMOrb-u5dukic=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-517766-1169713114.jpeg.jpg">https://img.discogs.com/0Ci06xuthNFAD9Tj0RR2f81EzJw=/482x593/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-517766-1169713114.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/bWbwqw_GTGIIR2FopEMniDXlsNo=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-517766-1344998054-6473.jpeg.jpg">https://img.discogs.com/ss5uc7B3Uu_nSs0KHVOG8Dl_OGA=/436x480/smart/filters:strip_icc():format(jpeg):mode_rgb():quali