INSERT INTO "music_artist" VALUES (174,'Audiomachine','','Other','Audiomachine is an American production music company based in Los Angeles, California. The company was founded by Paul Dinletir and Carol Sovinski in August 2005, producing music composed by Paul Dinletir and Kevin Rix. Audiomachine mainly produces music for movie trailers and advertisements, but recently its music has also been featured in the 2010, 2012 and 2014 Olympic games official program labeled as Epic Music.Many of Audiomachine''s tracks have been featured in theatrical movie trailers, including those of Avatar, The Chronicles of Narnia films, Iron Man,  Venom, Avengers: Endgame, and others.
INSERT INTO "music_artist" VALUES (175,'Paul Mauriat','','Person','Paul Julien André Mauriat (French: [pɔl mɔʁja] or [moʁja]; 4 March 1925 – 3 November 2006) was a French orchestra leader, conductor of Le Grand Orchestre de Paul Mauriat, who specialized in the easy listening genre. He is best known in the United States for his million-selling remake of André Popp''s "Love is Blue", which was #1 for 5 weeks in 1968. Other recordings for which he is known include "El Bimbo", "Toccata", "Love in Every Room/Même si tu revenais", and "Penelope". 
