INSERT INTO "music_artist" VALUES (180,'Danny Elfman','','Person','Daniel Robert Elfman (born May 29, 1953) is an American composer, singer, and songwriter. He came to prominence as the singer-songwriter for the new wave band Oingo Boingo in the early 1980s. Since the 1990s Elfman has garnered international recognition for composing over 100 feature film scores, as well as compositions for television, stage productions, and the concert hall.
INSERT INTO "music_artist" VALUES (181,'John Newman','','Person','John William Peter Newman (born 16 June 1990) is an English singer, songwriter, musician and record producer. He is best known for the track "Love Me Again" which peaked at number one on the UK Singles Chart in July 2013 and appeared in FIFA 14, as well as co-writing and singing on Rudimental''s 2012 singles "Feel the Love" and "Not Giving In", which peaked at number one and number 14 on the chart, respectively. In 2014, he featured in the Calvin Harris single "Blame", which also topped the UK charts.
INSERT INTO "music_artist" VALUES (182,'Survivor','','Group','Survivor are an American rock band, formed in Chicago in 1978 by Jim Peterik and Frankie Sullivan. The band achieved its best success in the 1980s, producing many charting singles, especially in the United States. The band is best-known for its double-platinum-certified 1982 hit "Eye of the Tiger", the theme song for the 1982 motion picture Rocky III; that single spent six weeks at number one in the US. The band continued to chart in the mid-1980s with singles like "Burning Heart" (US number 2), "The Search Is Over" (US number 4), "High on You" (US number 8), "Is This Love" (US number 9), and "I Can''t Hold Back" (US number 13). 
INSERT INTO "music_artist" VALUES (183,'The Script','','Group','The Script are an Irish rock band formed in 2007 in Dublin, Ireland. They first released music in 2008. The band consists of lead vocalist and keyboardist Daniel O''Donoghue, lead guitarist Mark Sheehan, and drummer Glen Power. The band moved to London after signing to Sony Label Group imprint Phonogenic and released their eponymous debut album in August 2008, preceded by the successful singles "The Man Who Can''t Be Moved" and "Breakeven". The album peaked at number one in both Ireland and the UK. Their next three albums, Science & Faith (2010), #3 (2012) and No Sound Without Silence (2014), all topped the album charts in Ireland and the UK, while Science & Faith reached number three in the US. Hit singles from the albums include "For the First Time", "Nothing", "Hall of Fame" and "Superheroes". The band''s fifth studio album, Freedom Child, was released on 1 September 2017, and features the UK Top 20 single "Rain".
INSERT INTO "music_artist" VALUES (184,'Юлианна Караулова','','Person','Yulianna Yurievna Karaulova (Russian: Юлианна Юрьевна Караулова; born April 24, 1988 in Moscow) is a Russian singer, former lead singer of 5sta Family, and the finalist of Fabrika Zvyozd 5.
INSERT INTO "music_artist" VALUES (185,'Sigma','','Group','Sigma are a British drum and bass DJ and record production duo consisting of Cameron James "Cam" Edwards and Joseph Aluin "Joe" Lenzie. They met at Leeds University at drum and bass nights. Their 2010 collaboration with DJ Fresh, "Lassitude", peaked at number 98 on the UK Singles Chart. Their single "Nobody to Love" topped the UK Singles Chart, becoming their first UK number one. Their second was the follow-up single "Changing", featuring Paloma Faith. 
INSERT INTO "music_artist" VALUES (186,'Jeremih','','Person','Jeremy Phillip Felton (born July 17, 1987), known professionally as Jeremih ( JERR-əm-eye), is an American singer, songwriter, rapper, and record producer. In 2009, he signed a record deal with Def Jam Recordings. Jeremih''s commercial debut single, "Birthday Sex", peaked at number four on the US Billboard Hot 100 chart—leading his self-titled debut album released in June that year, reaching number six on the US Billboard 200 chart. Jeremih''s success continued with the release of his second album, All About You, led by the single "Down on Me", which also reached the top five of the Billboard Hot 100. In 2014, his single "Don''t Tell ''Em" with YG became his third top-ten hit on the Billboard Hot 100. After multiple delays, Jeremih released his third studio album, Late Nights in 2015. Jeremih''s latest project, a collab album with Ty Dolla Sign titled MihTy was released on August 24, 2018. Born in Chicago, Illinois, Jeremih began playing drums at the age of three and is able to play the saxophone, several percussion instruments and piano/keyboards. He attended Morgan Park High School, where he was part of the marching band as well as a Latin jazz band. He also learned to play percussion instruments like congas and timbales.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/1c009a08-74d1-4682-bc56-8bfbe9e66b62/artistthumb/jeremih-500e1056c2020.jpg">https://assets.fanart.tv/fanart/music/1c009a08-74d1-4682-bc56-8bfbe9e66b62/artistthumb/jeremih-500e1056c2020.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/bk4fJLDozvGgOXHixPaOx8cPTrI=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1502171-1300836996.jpeg.jpg">https://img.discogs.com/dJP1-bK0lBEbeeQ5rNZuKVyXwbs=/500x500/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1502171-1300836996.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/A0Ts4Ub5j-aXtXoWDJjqYo6l5rU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1502171-1530880345-2701.jpeg.jpg">https://img.discogs.com/pCVT0y7nujEgl1rbo4JVJHZBSH8=/600x337/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1502171-1530880345-2701.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/qeOgHrLhhw27FTzOxaTBW-euYRg=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1502171-1530880348-6011.jpeg.jpg">https://img.discogs.com/ogIb5tg-sdmJHaR_61vsq2w_L8w=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1502171-1530880348-6011.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/1c009a08-74d1-4682-bc56-8bfbe9e66b62/musiclogo/jeremih-4f46873a36ba5.png">https://assets.fanart.tv/fanart/music/1c009a08-74d1-4682-bc56-8bfbe9e66b62/musiclogo/jeremih-4f46873a36ba5.png</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/1c009a08-74d1-4682-bc56-8bfbe9e66b62/artistbackground/jeremih-500e114b0a66f.jpg">https://assets.fanart.tv/fanart/music/1c009a08-74d1-4682-bc56-8bfbe9e66b62/artistbackground/jeremih-500e114b0a66f.jpg</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/1c009a08-74d1-4682-bc56-8bfbe9e66b62/artistbackground/jeremih-4f46888a3643b.jpg">https://assets.fanart.tv/fanart/music/1c009a08-74d1-4682-bc56-8bfbe9e66b62/artistbackground/jeremih-4f46888a3643b.jpg</thumb>','1c009a08-74d1-4682-bc56-8bfbe9e66b62');
INSERT INTO "music_artist" VALUES (187,'Miley Cyrus','','Person','Miley Ray Cyrus ( MY-lee; born Destiny Hope Cyrus, November 23, 1992) is an American singer, songwriter, and actress. Noted for her distinctive raspy voice, her music incorporates elements of varied styles and genres, including pop, country pop, hip hop, experimental, and rock. Cyrus has attained the most US Billboard 200 top-five albums in the 21st century by a female artist, with a total of thirteen entries. Her personal life, public image, and performances have often sparked controversy and received widespread media coverage.
INSERT INTO "music_artist" VALUES (188,'Seal','','Person','Henry Olusegun Adeola Samuel (born 19 February 1963), known professionally as Seal, is a British singer-songwriter. He has sold over 20 million records worldwide, with hit songs "Crazy" and "Killer", the latter of which went to number one in the UK, and his most celebrated song, "Kiss from a Rose", was released in 1994.
INSERT INTO "music_artist" VALUES (189,'Panic! At The Disco','','Group','Panic! at the Disco is the solo project of American musician Brendon Urie. It was originally a pop rock band from Las Vegas, Nevada, formed in 2004 by childhood friends Urie, Ryan Ross, Spencer Smith and Brent Wilson. They recorded their first demos while they were in high school. Shortly after, the band recorded and released their debut studio album, A Fever You Can''t Sweat Out (2005). Popularized by the second single, "I Write Sins Not Tragedies", the album was certified triple platinum in the US. In 2006, founding bassist Brent Wilson was fired from the band during an extensive world tour and subsequently replaced by Jon Walker. The band''s second album, Pretty. Odd. (2008), was preceded by the single "Nine in the Afternoon". That album marked a significant departure from the sound of the band''s debut.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b9472588-93f3-4922-a1a2-74082cdf9ce8/artistthumb/panic-at-the-disco-5f4b2eef5839e.jpg">https://assets.fanart.tv/fanart/music/b9472588-93f3-4922-a1a2-74082cdf9ce8/artistthumb/panic-at-the-disco-5f4b2eef5839e.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b9472588-93f3-4922-a1a2-74082cdf9ce8/artistthumb/panic-at-the-disco-5f4b088dceddc.jpg">https://assets.fanart.tv/fanart/music/b9472588-93f3-4922-a1a2-74082cdf9ce8/artistthumb/panic-at-the-disco-5f4b088dceddc.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b9472588-93f3-4922-a1a2-74082cdf9ce8/artistthumb/panic-at-the-disco-5129400fc407b.jpg">https://assets.fanart.tv/fanart/music/b9472588-93f3-4922-a1a2-74082cdf9ce8/artistthumb/panic-at-the-disco-5129400fc407b.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/fGYHJxFSVtDTK0EMdfh4TftuK8c=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A