INSERT INTO "music_artist" VALUES (190,'AC/DC','','Group','DC, D.C., Dc, or dc may refer to: 
INSERT INTO "music_artist" VALUES (191,'Scorpions','','Group','Scorpions are a German rock band formed in 1965 in Hanover by Rudolf Schenker. Since the band''s inception, its musical style has ranged from hard rock, heavy metal, and glam metal. The lineup from 1978 to 1992 was the most successful incarnation of the group, and included Klaus Meine (vocals), Rudolf Schenker (rhythm guitar), Matthias Jabs (lead guitar), Francis Buchholz (bass), and Herman Rarebell (drums). The band''s only continuous member has been Schenker, although Meine has appeared on all of Scorpions'' studio albums, while Jabs has been a consistent member since 1978, and bassist Paweł Mąciwoda and drummer Mikkey Dee have been in the band since 2003 and 2016 respectively.During the mid-1970s, with guitarist Uli Jon Roth part of the line-up, the music of the Scorpions was defined as hard rock. After the departure of Roth in 1978 and short-lived reunion with Schenker''s brother Michael, Matthias Jabs joined and, following the guidance of producer Dieter Dierks, the Scorpions changed their sound towards hard rock/heavy metal, mixed with rock power ballads. Throughout the 1980s the group received positive reviews and critical acclaim from music critics, and experienced commercial success with the albums Animal Magnetism (1980), Blackout (1982), Love at First Sting (1984), the live recording World Wide Live (1985), Savage Amusement (1988) and Best of Rockers ''n'' Ballads (1989), which is their best-selling compilation album.Scorpions'' eleventh studio album Crazy World (1990) was also well-received, and included the song "Wind of Change", a symbolic anthem of the political changes in Eastern Europe in the late 1980s and early 1990s and the fall of the Berlin Wall. It is one of the best-selling singles in the world with over fourteen million copies sold. Scorpions have sold over 110 million records in total. They have released 18 studio albums, 27 compilation albums and 74 singles. Six of their singles have reached number one on the charts in different countries.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c3cceeed-3332-4cf0-8c4c-bbde425147b6/artistthumb/scorpions-5bbf97187c1e1.jpg">https://assets.fanart.tv/fanart/music/c3cceeed-3332-4cf0-8c4c-bbde425147b6/artistthumb/scorpions-5bbf97187c1e1.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c3cceeed-3332-4cf0-8c4c-bbde425147b6/artistthumb/scorpions-4fe5e5dab02a6.jpg">https://assets.fanart.tv/fanart/music/c3cceeed-3332-4cf0-8c4c-bbde425147b6/artistthumb/scorpions-4fe5e5dab02a6.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c3cceeed-3332-4cf0-8c4c-bbde425147b6/artistthumb/scorpions-54e307e19e7bd.jpg">https://assets.fanart.tv/fanart/music/c3cceeed-3332-4cf0-8c4c-bbde425147b6/artistthumb/scorpions-54e307e19e7bd.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/mhOQFUhvL4tJ54IZFkA6LD3WDYc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-63552-1142367930.jpeg.jpg">https://img.discogs.com/Tw8nNKRAHwtn7URV3Sm0lx6YE2Y=/600x394/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-63552-1142367930.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/IorwD-NxhQMb9thiD9soNKXnhqQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-63552-1149550908.jpeg.jpg">https://img.discogs.com/lQCUV7MeAC9_I6eEQKVZ0hbI1Pg=/600x466/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-63552-1149550908.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/HcGWKdcV-1CpSyAgcOLHqKYLQA4=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-63552-1473699897-1354.jpeg.jpg">https://img.discogs.com/IOrxBNoQU4MZC34eBaN2eIqCYJo=/600x400/smart/filt