INSERT INTO "music_artist" VALUES (192,'Сергей Лазарев','','Person','Sergey Vyacheslavovich Lazarev (Russian: Серге́й Вячесла́вович Ла́зарев, IPA: [sʲɪrˈɡʲej vʲɪt͡ɕɪsˈlavəvʲɪt͡ɕ ˈlazərʲɪf], born 1 April 1983) is a Russian singer, dancer and actor. He is most famous for his singing career, when he rose to fame as a member of the group Smash!!. The group broke up in 2006. Since then Lazarev has pursued a solo career. He represented Russia in the Eurovision Song Contest 2016 in Stockholm, Sweden, and finished in third place, coming first in the televote. He represented Russia again at Eurovision Song Contest 2019 in Tel Aviv, Israel with the song "Scream", and similarly finished in third place. Lazarev was born in Moscow on 1 April 1983. From age of four, Lazarev practiced artistic gymnastics, but stopped due to his parents'' divorce. Subsequently, Lazarev started singing in a children''s choir and became interested in performing. 
INSERT INTO "music_artist" VALUES (193,'Dimitrios Kontopoulos, Филипп Киркоров','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (194,'Maroon 5','','Group','Maroon 5 is an American pop rock band from Los Angeles, California. It currently consists of lead vocalist Adam Levine, keyboardist and rhythm guitarist Jesse Carmichael, lead guitarist James Valentine, drummer Matt Flynn, keyboardist PJ Morton and multi-instrumentalist Sam Farrar. Original members Levine, Carmichael, bassist Mickey Madden, and drummer Ryan Dusick first came together as Kara''s Flowers in 1994, while they were still in high school. 
INSERT INTO "music_artist" VALUES (195,'The White Stripes','','Group','The White Stripes were an American rock duo from Detroit, Michigan formed in 1997. The group consisted of Jack White (songwriter, vocals, guitar, piano, and mandolin) and his one-time wife Meg White (drums and vocals). After releasing several singles and three albums within the Detroit music scene, the White Stripes rose to prominence in 2002 as part of the garage rock revival scene. Their successful and critically acclaimed albums White Blood Cells and Elephant drew attention from a large variety of media outlets in the United States and the United Kingdom. The single "Seven Nation Army", which used a guitar and an octave pedal to create the iconic opening riff, became one of their most recognizable songs. The band recorded two more albums, Get Behind Me Satan in 2005 and Icky Thump in 2007, and dissolved in 2011 after a lengthy hiatus from performing and recording.The White Stripes used a low-fidelity approach to writing and recording. Their music featured a melding of garage rock and blues influences and a raw simplicity of composition, arrangement, and performance. The duo were also noted for their fashion and design aesthetic which featured a simple color scheme of red, white, and black—which was used on every album and single cover the band released—as well as the band''s fascination with the number three. The band''s discography consists of six studio albums, two live albums, one extended play (EP), one concert film, one tour documentary, 26 singles, and 14 music videos. Their last three albums each won the Grammy Award for Best Alternative Music Album.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/11ae9fbb-f3d7-4a47-936f-4c0a04d3b3b5/artistthumb/white-stripes-the-4fabbf088c81d.jpg">https://assets.fanart.tv/fanart/music/11ae9fbb-f3d7-4a47-936f-4c0a04d3b3b5/artistthumb/white-stripes-the-4fabbf088c81d.jpg</thumb><thumb spoof="" cache="" aspect="thu