INSERT INTO "music_artist" VALUES (200,'Damien Leith','','Person','Damien Leo Leith (born 18 January 1976, in Dublin) is an Irish-Australian singer–songwriter. He was the winner of the Network Ten music contest Australian Idol 2006. Since winning the title, Leith has released nine studio albums, four of which peaked in the top two of the ARIA Charts, including two number ones. He has been awarded seven platinum and one gold certification for albums and singles by ARIA, which equates to sales of just over half a million. As a teenager Leith formed a family band, "Leaf", with his sister Áine and brothers Paul and Darren. Leaf recorded in New York City and then again later under the new name "Releaf", which made an appearance in the Irish Top 100. After moving to Sydney, he played in a number of high-profile venues, as front-man for a band known as Revelate. His first Australian performance was at The Basement in Sydney''s Circular Quay.
INSERT INTO "music_artist" VALUES (201,'Soundtrack','','Group','','','1bf7c8de-dcd1-4274-b27d-c527a182c73e');
INSERT INTO "music_artist" VALUES (202,'Black Eyed Peas','','Group','Black Eyed Peas (also known as The Black Eyed Peas) is an American musical group, consisting of rappers will.i.am, apl.de.ap,  Taboo and J. Rey Soul. Originally an alternative hip hop group, they subsequently refashioned themselves as a more marketable pop-rap act. Although the group was founded in Los Angeles in 1995, it was not until the release of their third album, Elephunk, in 2003, that they achieved high record sales. 
INSERT INTO "music_artist" VALUES (203,'Allan Pineda/Stacy Ferguson/Van Musser, Thomas/William Adams','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (204,'Dnce','','Group','DNCE is an American dance-rock band. The group consists of vocalist Joe Jonas, drummer Jack Lawless, bassist and keyboardist Cole Whittle, and guitarist JinJoo Lee. The group signed with Republic Records, who released their debut single, "Cake by the Ocean", in September 2015. The song reached the top 10 on several charts, including on the US Billboard Hot 100, where it peaked at No. 9. Their debut extended play, Swaay, was released about a month later. Their self-titled debut studio album was released in November 2016. They were also nominated for Favorite New Artist for the 2016 Kids'' Choice Awards and Best Song to Lip Sync and Best Anthem for the 2016 Radio Disney Music Awards. The group performed at the 2017 Fashion Meets Music Festival. 
INSERT INTO "music_artist" VALUES (205,'Earth Wind And Fire','','Group','Earth, Wind & Fire (EW&F or EWF) is an American band that has spanned the musical genres of R&B, soul, funk, jazz, disco, pop, dance, Latin, and Afro pop. They have been described as one of the most innovative and are among the most commercially successful acts of all time. Rolling Stone called them "innovative, precise yet sensual, calculated yet galvanizing" and declared that the band "changed the sound of black pop". VH1 has also described EWF as "one of the greatest bands" ever.The band was founded in Chicago by Maurice White in 1969, having grown out of a previous band known as the Salty Peppers. Other prominent members of EWF have included Philip Bailey, Verdine White, Ralph Johnson, Larry Dunn, Al McKay, Roland Bautista, Robert Brookins, Sonny Emory, Fred Ravel, Ronnie Laws, Sheldon Reynolds and Andrew Woolfolk. The band is known for its kalimba sound, dynamic horn section, energetic and elaborate stage shows, and the contrast between Philip Bailey''s falsetto vocals and Maurice White''s baritone.The band has won six Grammys from their 17 nominations and four American Music Awards out of 12 nominations. They have been inducted into the Rock and Roll Hall of Fame, the Vocal Group Hall of Fame, the NAACP Image Award Hall of Fame, and Hollywood''s Rockwalk, in addition to receiving a star on the Hollywood Walk of Fame. With sales of over 90 million records, they are one of the world''s best-selling bands of all time. The band has also received an ASCAP Rhythm & Soul Heritage Award, BET Lifetime Achievement Award, and the Soul Train Legend Award, as well as a NARAS Signature Governor''s Award, a Grammy Lifetime Achievement Award, the 2012 Congressional Horizon Award, and the Kennedy Center Honors in 2019. 
INSERT INTO "music_artist" VALUES (206,'Natalia Oreiro','','Person','Natalia Marisa Oreiro Iglesias (Spanish pronunciation: [naˈtalja oˈɾejɾo]; born 19 May 1977) is an Uruguayan singer, actress, and fashion designer. Oreiro began her career in telenovelas. Since 2008 she has switched to work primarily in films. Oreiro has worked on social awareness shows and events for organizations like Greenpeace and UNICEF, the latter of which designated her as ambassador for Argentina and Uruguay in September 2011. She has been included in Esquire magazine''s "The Sexiest Woman Alive Atlas" list. 
INSERT INTO "music_artist" VALUES (207,'PandoraRadio','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (208,'SEREBRO','','Group','Serebro (Russian: Серебро, IPA: [sʲɪrʲɪˈbro] (listen), lit. ''Silver''; stylized as SEREBRO) was a Russian girl group formed by their manager and producer Maxim Fadeev. Serebro was formed in 2007, consisting of Marina Lizorkina, Olga Seryabkina, and Elena Temnikova as a submitted proposal for consideration by Channel One Russia for the Eurovision Song Contest 2007. Serebro was selected to represent Russia at the 2007 Contest with the song titled "Song #1". They subsequently placed third at the contest, scoring a total of 207 points. Serebro was then officially signed to Fadeev''s record label Monolit Records, and in 2012, the group had additional releases produced by Sony Music Entertainment and Ego Music. In 2009, Lizorkina announced her departure from the group; she was subsequently replaced by Anastasia Karpova. Karpova left the group in 2013 and was replaced by Dasha Shashina, who left in 2016. Temnikova left the group in 2014 due to health reasons, and Polina Favorskaya, who replaced Temnikova, left the group in 2017. Favorskaya was later replaced by Morgunova.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Z0Q5npqglHkWBBr3N5M1E7cYQbM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-830456-1516122977-8640.jpeg.jpg">https://img.discogs.com/NXSKdQBdgF-Cha21lbKb9DhdWV8=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-830456-1516122977-8640.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Ksh4qrcqWlxSFEoZNq3ZZuu0EAk=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-830456-1496660855-7227.jpeg.jpg">https://img.discogs.com/e3nyX_QwZ3VT0kb4FTw6Gw8FxVY=/600x599/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-830456-1496660855-7227.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="htt