INSERT INTO "music_artist" VALUES (209,'Сати Казанова','','Person','Sataney Setgalievna Kazanova (Russian: Сатаней Сетгалиевна Казанова), better known as Sati Kazanova (Russian: Сати Казанова), (born 2 October 1982 in Kabardino-Balkaria) is a Russian singer, fashion model, actress and TV personality. Until May 2010, she was one of the three vocalists of the Russian pop girl group Fabrika (Russian: Фабрика; Factory in English). In 2002, she took part in the first season of the Russian talent show Star Factory as a member of Fabrika, where they finished second.
