INSERT INTO "music_artist" VALUES (211,'Luis Fonsi','','Person','Luis Alfonso Rodríguez López-Cepero (born April 15, 1978), known by his stage name Luis Fonsi (Spanish pronunciation: [ˈlwis ˈfonsi]), is a Puerto Rican singer. He is known for multiple songs, one of them being "Despacito" featuring rapper Daddy Yankee.
