INSERT INTO "music_artist" VALUES (214,'Camila Cabello','','Person','Karla Camila Cabello Estrabao (; Spanish: [kaˈmila kaˈβeʎo]; born March 3, 1997) is a Cuban-born American singer and songwriter. She rose to prominence as a member of the girl group Fifth Harmony, formed on The X Factor USA in 2012, signing a joint record deal with Syco Music and Epic Records. While in Fifth Harmony, Cabello began to establish herself as a solo artist with the release of the collaborations "I Know What You Did Last Summer" with Shawn Mendes, and "Bad Things" with Machine Gun Kelly, the latter reaching number four on the US Billboard Hot 100. After leaving the group in late 2016, Cabello released several other collaborations, including "Hey Ma" with Pitbull and J Balvin for The Fate of the Furious soundtrack (2017), and her debut solo single "Crying in the Club".
