INSERT INTO "music_artist" VALUES (217,'Stevie Wonder','','Person','Stevland Hardaway Morris (né Judkins; born May 13, 1950), known professionally as Stevie Wonder, is an American singer, songwriter, musician and record producer. A prominent figure in popular music during the second half of the 20th century, Wonder is one of the most successful songwriters and musicians. A virtual one-man band, his use of synthesizers and further electronic musical instruments during the 1970s reshaped the conventions of R&B. He also helped drive the genre into the album era, crafting his LPs as cohesive, consistent socially conscious statements with complex compositions. Wonder is often hailed as a "genius", and has been credited as a pioneer and influence to musicians of various genres including rhythm and blues, pop, soul, gospel, funk, and jazz.
INSERT INTO "music_artist" VALUES (218,'G-Eazy & Kehlani','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (219,'2 Chainz','','Person','Tauheed K. Epps (born September 12, 1977), known professionally as 2 Chainz, is an American rapper, songwriter, media personality, and basketball player. Born and raised in College Park, Georgia, he initially gained recognition for being one-half of the Southern hip hop duo Playaz Circle, alongside his longtime friend and fellow rapper Earl "Dolla Boy" Conyers. The duo was signed to fellow Georgia-based rapper Ludacris'' Disturbing tha Peace label, and are best known for their debut single "Duffle Bag Boy" (featuring Lil Wayne).
INSERT INTO "music_artist" VALUES (220,'Wiz Khalifa','','Person','Cameron Jibril Thomaz (born September 8, 1987), better known by his stage name Wiz Khalifa, is an American rapper, singer, and songwriter. He released his debut album, Show and Prove in 2006, and signed to Warner Bros. Records in 2007. His Eurodance-influenced single, "Say Yeah", received urban radio airplay, charting on the Rhythmic Top 40 and Hot Rap Tracks charts in 2008, becoming his first minor hit.Thomaz parted with Warner Bros. and released his second album, Deal or No Deal, in November 2009. He released the mixtape Kush and Orange Juice as a free download in April 2010; he then signed with Atlantic Records. Thomaz then adopted a more radio-friendly, pop-oriented approach with his debut single for Atlantic, "Black and Yellow". The song, a tribute to his hometown of Pittsburgh, debuted at number 100 and eventually peaked at number 1 on the Billboard Hot 100. The song became the lead single for his third album, Rolling Papers in March 2011; also spawning the Top 40 singles "Roll Up" and "No Sleep".The albums success was followed up with O.N.I.F.C. in December 2012, which was backed by the singles "Work Hard, Play Hard" and "Remember You" (featuring The Weeknd). Wiz released his fifth album Blacc Hollywood in August 2014, backed by the lead single "We Dem Boyz".','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f5dfa020-ad69-41cd-b3d4-fd7af0414e94/artistthumb/khalifa-wiz-50759f92f23c3.jpg">https://assets.fanart.tv/fanart/music/f5dfa020-ad69-41cd-b3d4-fd7af0414e94/artistthumb/khalifa-wiz-50759f92f23c3.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f5dfa020-ad69-41cd-b3d4-fd7af0414e94/artistthumb/khalifa-wiz-50759f92f3048.jpg">https://assets.fanart.tv/fanart/music/f5dfa020-ad69-41cd-b3d4-fd7af0414e94/artistthumb/khalifa-wiz-50759f92f3048.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.