INSERT INTO "music_artist" VALUES (223,'The Weeknd','','Person','Abel Makkonen Tesfaye (born February 16, 1990), known professionally as the Weeknd, is a Canadian singer, songwriter, and record producer. Among the world''s best selling musical artists with over 75 million records sold and on the list of most-streamed artists on Spotify, The Weeknd has won many accolades, including three Grammy Awards, five American Music Awards, nineteen Billboard Music Awards, two MTV Video Music Awards, nine Juno Awards, five SOCAN awards and one Brit Award, and has been nominated for an Academy Award. He holds several chart records, being the first artist to simultaneously hold the top three positions on the Billboard Hot R&B Songs chart with "Can''t Feel My Face", "Earned It", and "The Hills". In February 2015, he was awarded the Allan Slaight Award by Canada''s Walk of Fame. In 2017, he was featured on the cover of Forbes for his annual earnings of $92 million. Elton John listed him as one of the 100 Most Influential People of 2020 in Time. Tesfaye has a notable voice with a soaring falsetto and its singular tremolo. He has influenced artists in many contemporary music styles including pop, hip hop, and rhythm and blues.The Weeknd began his recording career in 2010, anonymously uploading several songs to YouTube. A year later, the Weeknd released the mixtapes House of Balloons, Thursday, and Echoes of Silence, and quickly earned a following and critical recognition from several mainstream publications due to his dark style of Contemporary R&B and the mystique surrounding his identity. In 2012, he signed with Republic Records and re-released the mixtapes in the compilation album Trilogy (2012).','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/c8b03190-306c-4120-bb0b-6f2ebfc06ea9/artistthumb/weeknd-the-57a36289b5830.jpg">https://assets.fanart.tv/fanart/music/c8b03190-306c-4120-bb0b-6f2ebfc06ea9/artistthumb/weeknd-the-57a36289b5830.jpg</thu