nart/music/c8b03190-306c-4120-bb0b-6f2ebfc06ea9/artistbackground/weeknd-the-579f4a2fe34f1.jpg</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/c8b03190-306c-4120-bb0b-6f2ebfc06ea9/artistbackground/the-weeknd-4ee693dd07fe9.jpg">https://assets.fanart.tv/fanart/music/c8b03190-306c-4120-bb0b-6f2ebfc06ea9/artistbackground/the-weeknd-4ee693dd07fe9.jpg</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/c8b03190-306c-4120-bb0b-6f2ebfc06ea9/artistbackground/weeknd-the-502a99d94aa39.jpg">https://assets.fanart.tv/fanart/music/c8b03190-306c-4120-bb0b-6f2ebfc06ea9/artistbackground/weeknd-the-502a99d94aa39.jpg</thumb>','c8b03190-306c-4120-bb0b-6f2ebfc06ea9');
INSERT INTO "music_artist" VALUES (224,'Ed Sheeran [drivemusic.me]','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (225,'Eurythmics','','Group','Eurythmics were a British pop duo consisting of members Annie Lennox and Dave Stewart. Stewart and Lennox were both previously in The Tourists, a band which broke up in 1980; Eurythmics were formed later that year in Wagga Wagga, Australia. The duo released their first studio album, In the Garden, in 1981 to little success, but went on to achieve global success when their second album Sweet Dreams (Are Made of This), was released in 1983. The title track became a worldwide hit which topped the charts in various countries including the US. The duo went on to release a string of hit singles and albums before they split up in 1990. By this time, Stewart was a sought-after record producer, while Lennox began a solo recording career in 1992 with her debut album Diva. After almost a decade apart, Eurythmics reunited to record their ninth album, Peace, released in late 1999. They reunited again in 2005 to release the single "I''ve Got a Life", as part of a new Eurythmics compilation album, Ultimate Collection.
INSERT INTO "music_artist" VALUES (226,'Clean Bandit','','Group','Clean Bandit are a Grammy-winning British electronic music group formed in Cambridge, England in 2008. They have had 4 number 1 hits and 10 top ten hits in the UK. They direct and produce their own music videos, many of which have been nominated for Brit Awards and VMAs, while Rockabye has over 2 Billion views on YouTube. The group currently consists of founder Grace Chatto and brothers Jack and Luke Patterson. Jack Patterson is the principal songwriter and has been awarded two Ivor Novellos for the writing of Rather Be. Many of their projects are known for blending elements of both classical and dance music, and featuring guest vocalists. Notable collaborators include Marina, Demi Lovato, Jess Glynne, Anne-Marie, Sean Paul, Zara Larsson, Julia Michaels, Luis Fonsi, Ellie Goulding, Iann Dior, Mabel, and Lizzo.
INSERT INTO "music_artist" VALUES (227,'Sean Paul & Anne-Marie','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (228,'Ajr','','Group','AJR is an American indie pop trio composed of multi-instrumentalist brothers Adam, Jack, and Ryan Met. Their most successful songs include "I''m Ready", "Burn the House Down", "Way Less Sad", "Weak", and "Bang!". In 2019, their third album Neotheater debuted at number 8 on the Billboard 200, and hit number one on the Top Rock Albums chart. "Bang!" is their highest-charting song and only song to reach the top 10, peaking at number 8 on the Billboard Hot 100 on January 22, 2021.The name "AJR" comes from the first initials of the three brothers, Adam, Jack, and Ryan. The band writes, produces, and mixes their material in the living room of their apartment in New York City. Their musical style has been described as "eclectic," combining elements of pop, doo-wop, electronic, and dubstep. 
INSERT INTO "music_artist" VALUES (229,'John Legend','','Person','John Roger Stephens (born December 28, 1978), known professionally as John Legend, is an American singer, songwriter, record producer, actor, film producer, and philanthropist. Prior to the release of Legend''s debut album Get Lifted (2004), he collaborated with already-established artists and signed to Kanye West''s GOOD Music. Legend has sung on Jay-Z''s "Encore", Alicia Keys''s "You Don''t Know My Name", Dilated Peoples'' "This Way", Slum Village''s "Selfish", Fort Minor''s "High Road", and played piano on Lauryn Hill''s "Everything Is Everything". Legend''s single "All of Me" from his fourth studio album Love in the Future (2013) was a Billboard Hot 100 number-one hit.
INSERT INTO "music_artist" VALUES (230,'Lilly Wood & The Prick','','Group','Lilly Wood and the Prick (also known as Lilly Wood and LILLYWOOD) is a French folk pop duo composed of Nili Hadida and Benjamin Cotto. Although the duo is French, Nili was born in Israel. They are best known for their single "Prayer in C", which was remixed and released as a single in 2014 by German DJ and producer Robin Schulz; the song has topped the charts in Austria, Belgium, France, Germany, Israel, Lebanon, Italy, the Netherlands, Spain, Switzerland and the United Kingdom. 
INSERT INTO "music_artist" VALUES (231,'Quest Pistols Show','','Group','Quest Pistols Show (before 2014, Quest Pistols) are a Ukrainian pop-rock band formed in 2007, originally consisting of Anton Savlepov (vocals, guitar), Nikita Goruk (vocals, bass), and Konstantin ''Kostya'' Borovsky (vocals, keyboard). In 2012 Kostya left the band and was replaced by Daniel Joy. The band began as a group of dancers in a show called "Quest Ballet". On April 1, 2007 they took part as singers during the show "Chance" as an April Fools prank with the song "Я устал" and received over 60,000 positive votes. After their success, the group decided to become a band. Since their formation, the band has released the studio albums: Dlja tebja, in 2007 and Superklass in 2009; and one EP "Волшебные краски + ROCK’N''ROLL и кружева" in 2008, and now the single ''Forget Everything'' in 2013 (later added to the album ''Shards of Ice''). This song marks the start of ''a new stage'' of the band, completely different from the usual image. The press team commented; ''With this release, they start the next level in their musical career, it''s changed not only the style of sound, but the pitch, perception, positioning, and also the choice of material.'' Most recently, the band released ''Shards of Ice'', which takes the band in a more electronic and synthpop direction.
INSERT INTO "music_artist" VALUES (232,'Александр Рыбак','','Person','Alexander Igorevich Rybak  (Russian: Александр Игоревич Рыбак) or Alyaxandr Iharavich Rybak (Belarusian: Аляксандр Ігаравіч Рыбак; born 13 May 1986), is a Belarusian-Norwegian singer-composer, violinist, pianist and actor.Though based in Oslo, Rybak extensively worked on television programmes and on tours in Russia, Belarus, Ukraine and Sweden throughout the early 2010s. Singing in mainly English and Russian, Rybak, in his early twenties, held on to a teen idol status in Scandinavia, Eastern Europe, and to a certain extent in Western Asia. His debut album, Fairytales, charted in the top 20 in nine European countries, including a top position in Norway and Russia. After two pop albums in 2009 and 2010, Rybak desired to be more of a family-orientated artist, focusing on children''s and classical music alongside and frequently performed with youth orchestras throughout the world.Rybak is known for his extensive involvement in the Eurovision Song Contest. Representing Norway in the 2009 contest in Moscow, Russia, he won the competition with 387 points—the highest tally any country has achieved in the history of Eurovision under the then voting system—with "Fairytale", a song he wrote and composed. Winning at the age of 23, Rybak remains the youngest solo male winner of the contest and the only Belarusian-born winner. His win was celebrated all across Europe for crushing stereotypes about the contest, such as needing an over-the-top performance or the negative influence of neighbour voting.Since then Rybak has been involved several times in the contest. He represented Norway again in the Eurovision Song Contest 2018 in Lisbon, Portugal, with the song "That''s How You Write a Song", winning the second semi-final and finishing in 15th place in the Grand Final. He provided as an opening act to the Grand Final in 2010 and as an interval act in 2012 and 2016. Rybak has frequently provided commentary on the contest, working as a journalist in 2011, as once-off judge on the Belgian preselection in 2016 and as commentator on his personal social media.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ipEZeSgcgGuK6WMhjkbljSs2EC0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1442102-1527343859-7987.jpeg.jpg">https://img.discogs.com/-yQzndQjNYrtxdY19DijXIJN9g0=/400x300/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1442102-1527343859-7987.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/awNUHgb15PBDzHdT0Is6j1HAkoI=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1442102-1242561654.jpeg.jpg">https://img.discogs.com/w2fPfJstzHGedq8WYWR3r165wTc=/582x450/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1442102-1242561654.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ifobA0SYkHU5LA4loQFbJ0sBzXo=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1442102-1242581998.jpeg.jpg">https://img.discogs.com/ZHDu_FiXdCDCp5MNtpKBrnOF0zc=/400x300/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1442102-1242581998.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ZjQvsqq3D8ArFA7gKVOuwVDZ_yQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1442102-1527343847-2316.png.jpg">https://img.discogs.com/rKQpJ6_ysFd_EHBpeg13eio9YrQ=/500x500/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1442102-1527343847-2316.png.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/F24azIl9w-JG1Ygj6SEslCOSKu8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1442102-1527343858-8557.jpeg.jpg">https://img.discogs.com/NXTncZ_OEQkhbrRu