INSERT INTO "music_artist" VALUES (233,'Дима Билан','','Person','Dima Nikolayevich Bilan (Russian: Дима Никола́евич Била́н; born Viktor Nikolayevich Belan (Russian: Виктор Николаевич Белан); 24 December 1981), is a Russian singer, songwriter, and actor. He represented Russia at the Eurovision Song Contest 2006 with "Never Let You Go", finishing second, and he won the contest in 2008 in Belgrade, with the song "Believe". He has had several Russian number one hit records. He is sometimes referred to as "Russia''s Iglesias" due to his similarity to the Spanish singer. Dima Bilan was born as Viktor Belan in Ust-Dzheguta in the autonomous republic Karachay-Cherkessia in a mixed family of Tatar, Karachay and Russian heritage. Bilan''s father was born in Kabardino-Balkaria and his mother in Tatarstan. His parents had an age gap of 14 years; Bilan''s mother was just 16 when Bilan was born, his father was 30. After having briefly lived in Tatarstan as a child, Bilan''s family relocated to Maysky in Kabardino-Balkaria.Bilan started playing bayan in the fifth class of school and participated in different music contests as a child. He became interested in music as he enjoyed singing during school and started to write letters to the Gnessin Musical College, asking them for entrance requirements. Although the musical college did not respond to his writings, he still went to the auditions and managed to enroll.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/dFSmICy6A4K3jc0Ct8uif3cK0eI=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-753172-1486992086-4424.jpeg.jpg">https://img.discogs.com/gaD24U1eZV3mbLfMdXv-mRNM4cg=/600x628/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-753172-1486992086-4424.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/E76sA2dQHL7ic_WBg0VO64vkdzc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/disco