INSERT INTO "music_artist" VALUES (234,'Земфира','','Group','Zemfira, born Zemfira Talgatovna Ramazanova (Russian: Земфира Талгатовна Рамазанова, Bashkir: Земфира Тәлғәт ҡыҙы Рамаҙанова, Tatar: Земфира Тәлгать кызы Рамазанова; born 26 August 1976 in Ufa, Bashkortostan) is a Russian rock musician. She has been performing since 1998 and has been popular in Russia and other former Soviet republics. To date Zemfira has sold over 3 million records. An ethnic Volga Tatar, she was born in a typical middle-class family – her mother is a doctor, and her father is a history teacher.  At the age of 4, Zemfira became interested in music and entered a music school the following year (where she studied piano performance and voice) and writing her first song when she was seven years old.  Her older brother Ramil introduced her to rock music, which became her real passion – she listened to Black Sabbath, Nazareth and Queen, learning to play the guitar.  In the 7th grade, Zemfira split her time between music and basketball, becoming the captain of the Russian Girls’ Junior Basketball Team by 1990.  She began to lose interest in classical music, preferring instead to hang out with friends in the streets of Ufa and covering songs by Russian rock groups such as Kino, Nautilus Pompilius and Aquarium (who reached the peak of their popularity in the early 1990s).
INSERT INTO "music_artist" VALUES (235,'Макsим','','Person','Marina Sergeyevna Abrosimova (Russian: Марина Сергеевна Абросимова; born 10 June 1983), better known under her stage name MakSim (Russian: МакSим; earlier – Maxi-M) is a Russian singer, songwriter and a music producer.
INSERT INTO "music_artist" VALUES (236,'Руки Вверх','','Group','Ruki Vverh! (Russian: Руки Вверх, meaning "Hands Up!") is a Russian pop and techno former band and current solo act by Sergey Zhukov. The band came to prominence in the 1990s. Breathe Evenly (1997)
INSERT INTO "music_artist" VALUES (237,'Секрет','','Group','Secret (Russian: Секрет, lit.: Secret) was a Soviet Russian rock and roll band founded in 1982 in Leningrad. The band''s musical style and image were inspired from 1950s and 1960s western music, in particular by The Beatles. The band''s name was inspired by the Beatles song ''Do You Want to Know a Secret?''. Secret called themselves a "Beat Quartet" and were, along with Bravo, a part of Soviet rock and roll revival of 1980s.
INSERT INTO "music_artist" VALUES (238,'Adele','','Person','Adele Adkins is an English Soul singer from West Norwood, in South London (born 5 May, 1988 in Tottenham, North London).INSERT INTO "music_artist" VALUES (239,'Coldplay','','Group','Coldplay are a British rock band formed in London in 1996. Vocalist, rhythm guitarist and pianist Chris Martin, lead guitarist Jonny Buckland, bassist Guy Berryman, and drummer Will Champion met at University College London and began playing music together from 1996 to 1998, first calling themselves Pectoralz and then Starfish before finally changing their name to Coldplay. Their creative director and former manager Phil Harvey is considered the fifth member of the band.After changing their name to Coldplay, the band recorded and released two EPs: Safety in 1998 and The Blue Room in 1999. The latter was their first release on a major record label, after signing to Parlophone. Coldplay achieved worldwide fame with the release of the song "Yellow" in 2000, followed in the same year by their debut album Parachutes, which was nominated for the Mercury Prize. The band''s second album, A Rush of Blood to the Head (2002), was released to critical acclaim. Their next release, X&Y, was the best-selling album worldwide of 2005. Their Brian Eno-produced fourth studio album, Viva la Vida or Death and All His Friends (2008) was the best-selling album worldwide of said year and earned three Grammy Awards. In 2011, Coldplay released their fifth studio album, Mylo Xyloto, which topped the charts in over 34 countries and was the UK''s best-selling rock album of 2011. The band have since released Ghost Stories (2014), A Head Full of Dreams (2015) and Everyday Life (2019).','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/cc197bad-dc9c-440d-a5b5-d52ba2e14234/artistthumb/coldplay-4fbba04929c5c.jpg">https://assets.fanart.tv/fanart/music/cc197bad-dc9c-440d-a5b5-d52ba2e14234/artistthumb/coldplay-4fbba04929c5c.j