INSERT INTO "music_artist" VALUES (240,'Idina Menzel','','Person','Idina Kim Menzel (; née Mentzel; born May 30, 1971) is an American actress, singer, and songwriter. A winner of one Tony Award, and a nominee for two more, Menzel is known for her powerful mezzo-soprano voice and signature belting technique. Achieving success in stage and screen, she is one of the most prolific Broadway performers of her generation.
INSERT INTO "music_artist" VALUES (241,'Band Of Horses','','Group','Band of Horses is an American rock band formed in 2004 in Seattle by Ben Bridwell. The band has released five studio albums, including 2010''s Grammy-nominated Infinite Arms. The band''s lineup, which included Mat Brooke for the debut album, has undergone several changes. The most-recent lineup of Bridwell, Ryan Monroe, Tyler Ramsey, Bill Reynolds, and Creighton Barrett, was together several years and recorded three albums.  That lineup ceased when Ramsey and Reynolds departed in 2017. 
INSERT INTO "music_artist" VALUES (242,'Bob Dylan','','Person','Bob Dylan (born Robert Allen Zimmerman; May 24, 1941) is an American singer-songwriter, author and visual artist. Often regarded as one of the greatest songwriters of all time, Dylan has been a major figure in popular culture during a career spanning nearly 60 years. Much of his most celebrated work dates from the 1960s, when songs such as "Blowin'' in the Wind" (1963) and "The Times They Are a-Changin''" (1964) became anthems for the civil rights and anti-war movements. His lyrics during this period incorporated a range of political, social, philosophical, and literary influences, defying pop music conventions and appealing to the burgeoning counterculture.Following his self-titled debut album in 1962, which mainly comprised traditional folk songs, Dylan made his breakthrough as a songwriter with the release of The Freewheelin'' Bob Dylan the following year. The album features "Blowin'' in the Wind" and the thematically complex "A Hard Rain''s a-Gonna Fall". For many of these songs, he adapted the tunes and phraseology of older folk songs. He went on to release the politically charged The Times They Are a-Changin'' and the more lyrically abstract and introspective Another Side of Bob Dylan in 1964. In 1965 and 1966, Dylan drew controversy when he adopted electrically amplified rock instrumentation, and in the space of 15 months recorded three of the most important and influential rock albums of the 1960s: Bringing It All Back Home (1965), Highway 61 Revisited (1965) and Blonde on Blonde (1966). Commenting on the six-minute single "Like a Rolling Stone" (1965), Rolling Stone wrote: "No other pop song has so thoroughly challenged and transformed the commercial laws and artistic conventions of its time, for all time."In July 1966, Dylan withdrew from touring after a motorcycle accident. During this period, he recorded a large body of songs with members of the Band, who had previously backed him on tour.',