INSERT INTO "music_artist" VALUES (243,'Hozier','','Person','Andrew John Hozier-Byrne (born 17 March 1990), known mononymously as Hozier ( HOH-zee-ər), is an Irish singer, songwriter, and musician. His music primarily draws from folk, soul, and blues, often using religious and literary themes. He had his international breakthrough after releasing his debut single "Take Me to Church", which has been certified multi-platinum in several countries.
INSERT INTO "music_artist" VALUES (244,'Michael Buble','','Person','Michael Steven Bublé  (IPA:  boo-BLAY; born September 9, 1975) is a Canadian singer, songwriter, and record producer. His first album reached the top ten in Canada and the United Kingdom. He found a worldwide audience with his 2005 album It''s Time as well as his 2007 album Call Me Irresponsible – which reached number one on the Canadian Albums Chart, the UK Albums Chart, the US Billboard 200, the Australian ARIA Albums Chart and several European charts. Bublé''s 2009 album Crazy Love debuted at number one on the US Billboard 200 after three days of sales, and remained there for two weeks. It was also his fourth number one album on Billboard''s Top Jazz Albums chart. His 2011 holiday album, Christmas, was in first place on the Billboard 200 for the final four weeks of 2011 and the first week of 2012, totalling five weeks atop the chart, it also made the top 5 in the United Kingdom. With this, Christmas became his third-consecutive number-one album on the chart. To Be Loved was released in April 2013. Bublé has sold over 40 million records worldwide, and won numerous awards, including four Grammy Awards and multiple Juno Awards. Bublé is a dual citizen of Canada and Italy.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/611700cf-27f0-4dc9-ae80-c513a767853e/artistthumb/bubl-michael-4fd5ce284a103.jpg">https://assets.fanart.tv/fanart/music/611700cf-27f0-4dc9-ae80-c513a767853e/artistthumb/bubl-michael-4fd5ce284a103.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/611700cf-27f0-4dc9-ae80-c513a767853e/artistthumb/bubl-michael-4fd5ce284fc60.jpg">https://assets.fanart.tv/fanart/music/611700cf-27f0-4dc9-ae80-c513a767853e/artistthumb/bubl-michael-4fd5ce284fc60.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/611700cf-27f0-4dc9-ae80-c513a767853e/artistthumb/bubl-michael-4