INSERT INTO "music_artist" VALUES (245,'Alan Walker','','Person','Anglo-Norwegian EDM producer.INSERT INTO "music_artist" VALUES (246,'Harry Nilsson','','Person','Harry Edward Nilsson III (June 15, 1941 – January 15, 1994), known professionally as Nilsson, was an American singer-songwriter who achieved the peak of his commercial success in the early 1970s. His work is characterized by pioneering vocal overdub experiments, returns to the Great American Songbook, and fusions of Caribbean sounds. A tenor with a 3+1⁄2 octave range, Nilsson was one of the few major pop-rock recording artists to achieve significant commercial success without ever performing major public concerts or undertaking regular tours. The craft of his songs and the defiant attitude he projected remain touchstones for later generations of indie rock musicians.Born in Brooklyn, Nilsson moved to Los Angeles as a teenager to escape his family''s poor financial situation. While working as a computer programmer at a bank, he grew interested in musical composition and close-harmony singing, and was successful in having some of his songs recorded by various artists such as the Monkees. In 1967, he debuted on RCA Victor with the LP Pandemonium Shadow Show, followed by a variety of releases that include a collaboration with Randy Newman (Nilsson Sings Newman, 1970) and the original children''s story The Point! (1971). His most commercially successful album, Nilsson Schmilsson (1971), produced the international top 10 singles "Without You" and "Coconut". His other top 10 hit, "Everybody''s Talkin''" (1968), was featured prominently in the 1969 film Midnight Cowboy. A version of Nilsson''s "One", released by Three Dog Night in 1969, also reached the U.S. top 10.During a 1968 press conference, the Beatles were asked what their favorite American group was and answered "Nilsson".','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/e5963d26-01fa-40f5-b200-e0127f410a45/artistthumb/nilsson-harry-52c90cf74e707.jpg">https://assets.fanart.tv/fanart/music/e5963d26-01fa-40f5-b200-e0127f410a45/artistthumb/nilsson-harry-52c90cf74e707.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/e5963d26-01fa-40f5-b200-e0127f410a45/artistthumb/nilsson-harry-52c90d02cb511.jpg">https://assets.fanart.tv/fanart/music/e5963d26-01fa-40f5-b200-e0127f410a45/artistthumb/nilsson-harry-52c90d02cb511.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/e5963d26-01fa-40f5-b200-e0127f410a45/artistthumb/nilsson-harry-502a4b2aafe84.jpg">https://assets.fanart.tv/fanart/music/e5963d26-01fa-40f5-b200-e0127f410a45/artistthumb/nilsson-harry-502a4b2aafe84.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/UxD6kHwheVbjmSa9xi9Qaqsiq4o=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-152685-1619839119-1933.jpeg.jpg">https://img.discogs.com/7PNJYOPAaPgyBiEzrJu932yHxW8=/600x450/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-152685-1619839119-1933.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/x1IFpVToI_r8jZbiYHa3ikWqJmQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-152685-1619839122-9175.png.jpg">https://img.discogs.com/8LqFw1Nn35T3AD2sNV3HVe_Abes=/600x608/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-152685-1619839122-9175.png.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/Odakky9E-dwN_IlHrlLuYK2zgLU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-152685-1619839119-2211.jpeg.jpg">https://img.discogs.com/3wVz5VCN_L6Y6cwCm-J5T47OiCM=/600x800/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-152685-1619839119-2211.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" pre