INSERT INTO "music_artist" VALUES (248,'Radiohead','','Group','Radiohead are  an English rock band formed in Abingdon, Oxfordshire, in 1985. The band consists of Thom Yorke (vocals, guitar, piano, keyboards), brothers Jonny Greenwood (lead guitar, keyboards, other instruments) and Colin Greenwood (bass), Ed O''Brien (guitar, backing vocals) and Philip Selway (drums, percussion). They have worked with producer Nigel Godrich and cover artist Stanley Donwood since 1994. Radiohead''s experimental approach is credited with advancing the sound of alternative rock.
INSERT INTO "music_artist" VALUES (249,'The Chainsmokers','','Group','| name             = The Chainsmokers
INSERT INTO "music_artist" VALUES (250,'Sam Smith','','Person','Samuel Frederick Smith (born 19 May 1992) is an English singer and songwriter. They rose to prominence in October 2012 after being featured on Disclosure''s breakthrough single "Latch", which peaked at number eleven on the UK Singles Chart. Smith was subsequently featured on Naughty Boy''s "La La La", which became a number one single in May 2013. In December 2013, they were nominated for the 2014 Brit Critics'' Choice Award and the BBC''s Sound of 2014 poll, winning both.Smith''s debut studio album, In the Lonely Hour, was released in May 2014 on Capitol Records UK. The album''s lead single, "Lay Me Down", was released prior to "La La La". The album''s second single, "Money on My Mind", became Smith''s second number one single in the UK. The third single, "Stay with Me", was an international success, reaching number one in the UK and number two on the US Billboard Hot 100, while their singles "I''m Not the Only One" and "Like I Can" reached the top ten in the UK. The album won four awards, at the 57th Annual Grammy Awards, including Best Pop Vocal Album, Best New Artist, Record of the Year, Song of the Year, and nominations for Album of the Year and Best Pop Solo Performance.
INSERT INTO "music_artist" VALUES (251,'Natasha Bedingfield','','Person','Natasha Anne Bedingfield (born 26 November 1981) is a British singer and songwriter. Bedingfield released her debut album, Unwritten, in 2004, which contained primarily up-tempo pop songs and was influenced by R&B music. It enjoyed international success with more than 2.3 million copies sold worldwide. Bedingfield received a Grammy Award nomination for Best Female Pop Vocal Performance for the title track "Unwritten", and at the 2005 and 2006 Brit Awards, she was nominated for Best British Female Artist. Unwritten also produced her only UK number one, "These Words".
INSERT INTO "music_artist" VALUES (252,'Roxette','','Group','Roxette was a Swedish pop rock duo, consisting of Marie Fredriksson (vocals and keyboards) and Per Gessle (vocals and guitar). Formed in 1986, the duo became an international act in the late 1980s, when they released their breakthrough second album Look Sharp! Their third album Joyride, which was released in 1991, became just as successful as its predecessor. Roxette went on to achieve nineteen UK Top 40 hits and several US Hot 100 hits, including four US number-ones with "The Look", "Listen to Your Heart", "It Must Have Been Love", featured on the soundtrack of Pretty Woman, and "Joyride". Their other hits include "Dressed for Success", "Dangerous", and "Fading Like a Flower".Before coming together to form the duo, Fredriksson and Gessle were already established artists in Sweden, she having released a number of solo albums and he being the lead singer and songwriter of Gyllene Tider, a band that had three No. 1 albums. On the advice of the managing director of their record label, the two came together to record "Neverending Love", which became a hit single in Sweden.
INSERT INTO "music_artist" VALUES (253,'Sia','','Person','Sia Kate Isobelle Furler ( SEE-ə; born 18 December 1975) is an Australian singer, songwriter, voice actress and director. She started her career as a singer in the acid jazz band Crisp in the mid-1990s in Adelaide. In 1997, when Crisp disbanded, she released her debut studio album, titled OnlySee, in Australia. She moved to London and provided vocals for the British duo Zero 7. Sia released her second studio album, Healing Is Difficult, in 2000, and her third studio album, Colour the Small One, in 2004.
INSERT INTO "music_artist" VALUES (254,'Scorpions, Koen Van Baal','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (255,'Aerosmith','','Group','Aerosmith is an American rock band formed in Boston in 1970. The group consists of Steven Tyler (lead vocals), Joe Perry (guitar), Tom Hamilton (bass), Joey Kramer (drums) and Brad Whitford (guitar). Their style, which is rooted in blues-based hard rock, has also incorporated elements of pop rock, heavy metal, glam metal, and rhythm and blues, and has inspired many subsequent rock artists. They are sometimes referred to as "the Bad Boys from Boston" and "America''s Greatest Rock and Roll Band". The primary songwriting team of Tyler and Perry is often known as the "Toxic Twins".
INSERT INTO "music_artist" VALUES (256,'Grant Gustin','','Person','Thomas Grant Gustin (born January 14, 1990) is an American actor and singer. He is known for his role as Barry Allen / The Flash on the CW series The Flash as part of the Arrowverse television franchise, and for his role as Sebastian Smythe on the Fox series Glee. Thomas Grant Gustin was born on January 14, 1990, in Norfolk, Virginia. He is the son of Tina Haney, a pediatric nurse, and Thomas Gustin, a college professor. During his high school years, he attended the Governor''s School for the Arts program in Norfolk for musical theater. He also went to Hurrah Players Incorporated which is a theater organization in Virginia. In 2008, he graduated from Granby High School and went on to attend the BFA Music Theater Program at Elon University in North Carolina for two years. He has been a friend of actor Chris Wood since college. Gustin''s first known screen role came while he was still in high school in the film Rain (2004). In this student film, by director/producer Neil Grochmal, during his studies at Regent University.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/GJ6TrvUQQRaSnAPm0av-rco2HJ8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3092800-1514427396-2398.jpeg.jpg">https://img.discogs.com/EJ9IEqSgv19pgdZr6jy1qAGIbzw=/600x900/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3092800-1514427396-2398.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/_B4YYCoGDk9il8jWe81cVHokJZc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3092800-1514427396-2729.jpeg.jpg">https://img.discogs.com/60YNgEBQe3ppfryPLfvYPnxo2Oc=/600x400/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3092800-1514427396-2729.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/ojzzs2UBWm5mgFmYf_TachCe7HU=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3092800-1514427396-2589.jpeg.jpg">https://img.discogs.com/RbvtWNdPugUuMpqD1weNdXyIvsQ=/600x500/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3092800-1514427396-2589.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/8YAfeh5KddxGIdcP7ao2UCePqsQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3092800-1389042476-8075.jpeg.jpg">https://img.discogs.com/HtrSv4EXPoFpbzY4MGcYelTq7-4=/550x338/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3092800-1389042476-8075.jpeg.jpg</thumb>','0059a71f-c33a-4c57-b7f3-bb0657f80f1f');
INSERT INTO "music_artist" VALUES (257,'Justin Hurwitz','','Person','Justin Gabriel Hurwitz (born January 22, 1985) is an American film composer and a television writer. He is best known for his longtime collaboration with director Damien Chazelle, scoring each of his films: Guy and Madeline on a Park Bench (2009), Whiplash (2014), La La Land (2016), and First Man (2018).For La La Land, he won two Academy Awards: Best Original Score and Best Original Song (for "City of Stars") as well as the Golden Globe Awards for Best Original Score and Best Original Song (for "City of Stars"), and the BAFTA Award for Best Film Music. For First Man, he won the Golden Globe Award for Best Original Score. Hurwitz was born in California, the son of Gail (née Halabe), a professional ballet dancer turned registered nurse, and Ken Hurwitz, a writer. He is of Jewish descent (from Russia, Poland, Damascus in Syria, and Beirut in Lebanon). His family moved to Wisconsin in 1998 where he attended Nicolet High School.Hurwitz attended Harvard University, where he was roommates with director Damien Chazelle. They collaborated on a student film that would become Guy and Madeline on a Park Bench, which was released in 2009. While in school, Hurwitz was a member of the Harvard Lampoon and was an original member of the indie-pop band Chester French with Chazelle. After college, Hurwitz and Chazelle moved to Los Angeles where Hurwitz wrote comedy for the sitcom The League and one episode of The Simpsons. Thanks to the success of Guy and Madeline, they were able to obtain financing for their next collaboration, the 2014 film Whiplash – with Hurwitz scoring the film and Chazelle writing and directing.','','f850888c-8465-4dd4-b618-730edf07beab');
INSERT INTO "music_artist" VALUES (258,'Kaleo','','Group','Kaleo (stylized as KALEO) is an Icelandic blues rock band which formed in Mosfellsbær in 2012. It consists of lead vocalist and guitarist JJ, drummer David Antonsson, bassist Daniel Kristjansson, lead guitarist Rubin Pollock and harmonicist Þorleifur Gaukur Davíðsson. They have released three studio albums, Kaleo (2013), A/B (2016) and Surface Sounds (2021) as well as an EP, Glasshouse (2013). A/B has sold over one million albums worldwide. One of the singles from A/B, "Way Down We Go", was certified double platinum in the US and reached number one on the Billboard Alternative Songs chart on 20 August 2016. Kaleo received a Grammy nomination in 2017 for Best Rock Performance for the song "No Good".Surface Sounds, their third studio album, was released on 23 April 2021. 
INSERT INTO "music_artist" VALUES (259,'Naughty Boy, Beyonce and Arrow Benjamin','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (260,'Notre Dame de Paris','','Choir','','','d8c712ba-d87c-4ddd-b5ed-cdec28a1a549');
INSERT INTO "music_artist" VALUES (261,'Sting','','Person','Gordon Matthew Thomas Sumner  (born 2 October 1951), known professionally as Sting, is an English musician and actor. He was the principal songwriter, lead singer, and bassist for new wave rock band the Police from 1977 to 1984. He launched a solo career in 1985, and has included elements of rock, jazz, reggae, classical, new-age, and worldbeat in his music.As a solo musician and a member of the Police, Sting has received 17 Grammy Awards: he won Song of the Year for "Every Breath You Take", three Brit Awards, including Best British Male Artist in 1994 and Outstanding Contribution in 2002, a Golden Globe, an Emmy and four nominations for the Academy Award for Best Original Song. In 2019, he received a BMI Award for "Every Breath You Take" becoming the most-played song in radio history. In 2002, Sting received the Ivor Novello Award for Lifetime Achievement from the British Academy of Songwriters, Composers and Authors and was also inducted into the Songwriters Hall of Fame. He was inducted into the Rock and Roll Hall of Fame as a member of the Police in 2003. In 2000, he received a star on the Hollywood Walk of Fame for recording. In 2003, Sting received a CBE from Elizabeth II at Buckingham Palace for services to music. He was made a Kennedy Center Honoree at the White House in 2014, and was awarded the Polar Music Prize in 2017.With the Police, Sting became one of the world''s best-selling music artists. Solo and with the Police combined, he has sold over 100 million records.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/7944ed53-2a58-4035-9b93-140a71e41c34/artistthumb/sting-541b4f901b361.jpg">https://assets.fanart.tv/fanart/music/7944ed53-2a58-4035-9b93-140a71e41c34/artistthumb/sting-541b4f901b361.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/7944ed53-2a58-4035-9b93-140a71e41c34/artistthumb/sting-4fda0472ef86