INSERT INTO "music_artist" VALUES (262,'Баста','','Person','Vasiliy Mikhaylovich Vakulenko (Russian: Василий Михайлович Вакуленко; born 20 April 1980), better known by stage name Basta, and also known as Noggano, is a Russian rapper, producer and radio host. Basta''s father was an army officer who had served in Belarus during the 1980s. He studied at the local musical college, but did not graduate. 
INSERT INTO "music_artist" VALUES (263,'Грибы','','Group','','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/l_Opok9-oZdGQ_BIF1A8VhSGXSQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4281100-1575819317-2146.jpeg.jpg">https://img.discogs.com/alponTJiHaYrnO-Bmam0mBh8pU8=/381x378/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4281100-1575819317-2146.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/4jitmarkk3q5NO5b67Zz-2LDzl4=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4281100-1575819317-4171.jpeg.jpg">https://img.discogs.com/K9O_XHyUkj7F_ewdB-cpQo0ppTk=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4281100-1575819317-4171.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/SBIW73KSkuknpztNTxHyGWO9xpM=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4281100-1493155696-3655.jpeg.jpg">https://img.discogs.com/D-SL5LNsTFH5338g5uCzaj07ZX0=/600x364/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4281100-1493155696-3655.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/tvgYhK4LYt30pl5OFIBzhP-hyxo=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4281100-1493155697-4088.jpeg.jpg">https://img.discogs.com/L4RCNcLFwGm9dNj0kSgQYNMBI-0=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4281100-1493155697-4088.jpeg.jpg</thumb>','c4bb3fea-705e-4129-b26a-acddbc6bd9ee');
INSERT INTO "music_artist" VALUES (264,'Макс Корж','','Person','Maksim Anatolievich Korzh (Russian: Максим Анатольевич Корж; Belarusian: Максім Анатолевіч Корж; born November 23, 1988), professionally known as Max Korzh (Russian: Макс Корж) is a Belarusian singer and songwriter. At a young age Max Korzh was enrolled into music school by his parents. At the age of 16, Korzh started his first band called “Lun Clan”, alongside his friends but the band didn''t last long and dissolved. Korzh was a part of a couple other projects, although none of them proved to be successful. In his teen years he used to record songs in Belarusian.
INSERT INTO "music_artist" VALUES (265,'Монеточка','','Person','Monetochka (Russian: Моне́точка, lit. ''Little Coin'') is the stage name of Elizaveta Andreevna Gyrdymova (Russian: Елизаве́та Андре́евна Гырды́мова, born 1 June 1998), a Russian singer-songwriter. Gyrdymova was born on 1 June 1998 in Yekaterinburg. From childhood, Gyrdymova enjoyed writing poetry and published her work on the site Stihi.ru as a teenager.In 2014, she entered tenth grade at the Specialized Educational and Scientific Center of the Ural Federal University. In 2016, she enrolled in correspondence courses in film production at the Gerasimov Institute of Cinematography in Moscow. She chose the school because of her love of classic cinema.Since September 2016, Gyrdymova has continued her studies, and her first internship was at the ETV channel in her native Yekaterinburg, where she released joint projects with the poet Alexandra Aksyonova. She then worked for some time as a producer at ETV. 
INSERT INTO "music_artist" VALUES (266,'Sigrid','','Person','Sigrid Solbakk Raabe (born 5 September 1996), known mononymously as Sigrid, is a Norwegian singer and songwriter. In 2017, she released her debut EP, Don''t Kill My Vibe, and later won the BBC Music Sound of 2018. Her single "Strangers" reached number 10 on the UK Singles Chart, and in March 2019, she released her debut studio album, Sucker Punch, which debuted at number one on Norwegian charts and at number four on the UK Albums Chart. Sigrid Solbakk Raabe was born in Ålesund to Håkon Raabe and Anette Sølberg Solbakk on 5 September 1996. She has older siblings, a brother, Tellef (also a musician), and sister, Johanne. During her childhood, she was inspired by Adele, Joni Mitchell, and Neil Young; but in her early youth she planned to become a teacher or lawyer, thinking a career in music would be too uncertain. When she was 17, she and Johanne started a band called Sala Says Mhyp, which was named after their late cat, Sala. Sigrid began her career in 2013 by releasing her debut single, "Sun". The song was seen as her national breakthrough in Norway. She signed to Petroleum Records the following year, and performed at festivals such as Øyafestivalen.In 2016, Sigrid signed with Island Records.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/5u6aY6WcK6wTTCGKDS4N5rmTnK8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-5592842-1490277941-5465.jpeg.jpg">https://img.discogs.com/Zb8lGOHl1Wu5QO9t22VyyunIP4I=/600x520/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-5592842-1490277941-5465.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/b0Tb_pztAWkS7yccMBuxn6lM-hI=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-5592842-1543485840-7566.jpeg.jpg">https://img.discogs.com/joUwMvrVtDqiDRl1NKePZQ26bFw=/600x800/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-5592842-1543485840-7566.jpeg.jpg</thumb>','73183948-2489-41cb-9a2d-8be5071971a5');
INSERT INTO "music_artist" VALUES (267,'Ed Sheeran','','Person','Edward Christopher Sheeran  (; born 17 February 1991) is an English singer, songwriter, musician, record producer, actor, and businessman. After first recording music in 2004, he began gaining attention through YouTube. In early 2011, Sheeran independently released the extended play, No. 5 Collaborations Project. He signed with Asylum Records the same year.
INSERT INTO "music_artist" VALUES (268,'Jordan Fisher, Lin-Manuel Miranda','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (269,'Игорь Корнелюк','','Person','Igor Yevgenyevich Kornelyuk (Russian: Игорь Евгеньевич Корнелюк), born on November 16, 1962 in Brest (Belarus), is a Soviet and Russian musician, singer and composer. Igor Kornelyuk started studying music at the local musical school in Brest when he was 6 years old. At the age of 12, he played keyboards in the ensemble of the Palace of Dance Culture in Brest.  
INSERT INTO "music_artist" VALUES (270,'Akoahe','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (271,'Beyonce','','Person','Beyoncé Giselle Knowles-Carter ( bee-YON-say; née Knowles; born September 4, 1981) is an American singer and actress. Born and raised in Houston, Texas, Beyoncé performed in various singing and dancing competitions as a child. She rose to fame in the late 1990s as the lead singer of Destiny''s Child, one of the best-selling girl groups of all time. Their hiatus saw the release of her first solo album, Dangerously in Love (2003), which featured the US Billboard Hot 100 number-one singles "Crazy in Love" and "Baby Boy".
INSERT INTO "music_artist" VALUES (272,'Blur','','Group','Blur are an English rock band. Formed in London in 1988, the group consists of singer Damon Albarn, guitarist Graham Coxon, bassist Alex James and drummer Dave Rowntree. Blur''s debut album Leisure (1991) incorporated the sounds of Madchester and shoegazing. Following a stylistic change influenced by English guitar pop groups such as the Kinks, the Beatles and XTC, Blur released Modern Life Is Rubbish (1993), Parklife (1994) and The Great Escape (1995). As a result, the band helped to popularise the Britpop genre and achieved mass popularity in the UK, aided by a chart battle with rival band Oasis in 1995 dubbed "The Battle of Britpop".
INSERT INTO "music_artist" VALUES (273,'Carla\''s Dreams','','Group','Carla''s Dreams is a Moldovan musical project. Starting in 2012, the band is an anonymous group of singers and composers who sing in Romanian, English, and Russian.Carla''s Dreams combines several musical styles, including hip hop, jazz, rock and pop. The first song produced by Carla''s Dreams was Dă-te ("Get Off"), an "underground" song with obscene content.
INSERT INTO "music_artist" VALUES (274,'DMX','','Person','Earl Simmons (December 18, 1970 – April 9, 2021), known by his stage name DMX ("Dark Man X"), was an American rapper, songwriter, and actor. He began rapping in the early 1990s and released his debut album It''s Dark and Hell Is Hot in 1998, to both critical acclaim and commercial success, selling 251,000 copies within its first week of release. DMX released his best-selling album, ... And Then There Was X, in 1999, which included the hit single "Party Up (Up in Here)". His 2003 singles "Where the Hood At?" and "X Gon'' Give It to Ya" were also commercially successful. He was the first artist to debut an album at No. 1 five times in a row on the Billboard 200 charts. Overall, DMX has sold over 74 million records worldwide.DMX was featured in films such as Belly, Romeo Must Die, Exit Wounds, Cradle 2 the Grave, and Last Hour. In 2006, he starred in the reality television series DMX: Soul of a Man, which was primarily aired on the BET cable television network. In 2003, he published a book of his memoirs entitled, E.A.R.L.: The Autobiography of DMX. Earl Simmons was born on December 18, 1970, with various accounts giving his birthplace as either Baltimore, Maryland or Mount Vernon, New York.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f3bf61f8-97d4-4e52-a73d-2ddbbe8196c8/artistthumb/dmx-507c041cd2204.jpg">https://assets.fanart.tv/fanart/music/f3bf61f8-97d4-4e52-a73d-2ddbbe8196c8/artistthumb/dmx-507c041cd2204.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f3bf61f8-97d4-4e52-a73d-2ddbbe8196c8/artistthumb/dmx-5451193079cbc.jpg">https://assets.fanart.tv/fanart/music/f3bf61f8-97d4-4e52-a73d-2ddbbe8196c8/artistthumb/dmx-5451193079cbc.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/f3bf61f8-97d4-4e52-a73d-2ddbbe8196c8/artistthumb/dmx-50cb53a551607.jpg">https://assets.fanar