INSERT INTO "music_artist" VALUES (275,'Designer','','Group','Swiss noise rock / punk band active from 1991 to 1999.','','09e9a924-a64f-4120-a85a-687297e11dfd');
INSERT INTO "music_artist" VALUES (276,'L''One','','Person','Levan Gorozia (Georgian: ლევან გოროზია, Russian: Леван Горозия) also known professionally as L''One and now more recently as just Levan Gorozia is a Georgian-Russian rapper, singer, and songwriter. Known for his solo career, for co-founding the ‘WDKTZ’ (weedkatz) project with DJ Pill.One and for co-founding the hip hop group Marselle. From April 17, 2012 till March 16, 2019, Levan Gorozia was an artist of, Black Star Inc., where he released 3 space-themed studio albums. Gorozia is also the owner of his own clothing line label, “Cosmokot”, produced under the ‘Black Star Wear’ brand. In 2019, after leaving the, ‘Black Star’ label, he lost the right to perform under the pseudonym L''One and the right to perform with the tracks created under the pseudonym L’One. Now he performs under his original name. Levan Gorozia was born in Krasnoyarsk on October 9, 1985. As a teenager, he moved to Yakutsk, where he began his career as an artist. Levan played basketball for the Yakutia national team, but following a knee injury he was forced to cease, and focused fully on his career in rap.In Yakutsk, L''One was regarded as a celebrity. He was featured in KVN. He also worked on radio and TV. After the release of the first solo album in 2005, Levan moved to Moscow along with his friend Nel, where they formed the hip-hop group Marselle.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/44XzguKE07etos4Aqus5hhDLpC0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-3148016-1374760855-1660.jpeg.jpg">https://img.discogs.com/EsohnrCoIE2oQX-OnXzpG9Cv5ZI=/600x812/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-3148016-1374760855-1660.jpeg.jpg</thumb>','8b1d89c3-6909-4e4b-8b83-c1c87ce10e26');
INSERT INTO "music_artist" VALUES (277,'Lmfao','','Group','LMFAO (an initialism for Laughing My Freaking Ass Off) is an American electronic dance music duo consisting of uncle Redfoo and nephew SkyBlu. They respectively are a son and grandson of Motown Records founder Berry Gordy. RedFoo and SkyBlu grew up in Pacific Palisades, Los Angeles, where they formed the group LMFAO in 2006 and later became part of the electro house scene. LMFAO started building a local buzz through its shows and radio play. In 2010, they were featured on David Guetta''s song "Gettin'' Over You", which charted all over Europe and the United States, including reaching number one on the UK Singles Chart.
INSERT INTO "music_artist" VALUES (278,'Noize Mc','','Person','Noize MC is the stage name of Ivan Alexandrovich Alexeyev (Russian: Иван Александрович Алексеев, born 9 March 1985), is a Russian rapper, singer and actor. 
INSERT INTO "music_artist" VALUES (279,'Rihanna','','Person','Robyn Rihanna Fenty ( ree-AN-ə; born February 20, 1988) is a Barbadian singer, actress, fashion designer, and businesswoman. Born in Saint Michael and raised in Bridgetown, Barbados, Rihanna was discovered by American record producer Evan Rogers who invited her to the United States to record demo tapes. After signing with Def Jam in 2005, she soon gained recognition with the release of her first two studio albums, Music of the Sun (2005) and A Girl like Me (2006), both of which were influenced by Caribbean music and peaked within the top ten of the US Billboard 200 chart. In 2017 she founded the fashion house Fenty as its artistic director, and became the first black woman to head a luxury brand for LVMH (Moët Hennessy Louis Vuitton) group.Rihanna''s third album, Good Girl Gone Bad (2007), incorporated elements of dance-pop and established her status as a sex symbol in the music industry. The chart-topping single "Umbrella" earned Rihanna her first Grammy Award and catapulted her to global stardom. She continued to mix pop, dance, and R&B genres on her next studio albums, Rated R (2009), Loud (2010), Talk That Talk (2011), and Unapologetic (2012), which became her first Billboard 200 number one. The albums spawned a string of chart-topping singles, including "Rude Boy", "Only Girl (In the World)", "What''s My Name?", "S&M", "We Found Love", "Diamonds", and "Stay". Her eighth album, Anti (2016), showcased a new creative control following her departure from Def Jam. It became her second US number-one album and featured the chart-topping single "Work". Rihanna has collaborations with artists such as rappers Drake, Eminem, Jay-Z, and Kanye West and singers Adam Levine, Paul McCartney, Ne-Yo, and Shakira.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/73e5e69d-3554-40d8-8516-00cb38737a1c/artistthumb/rihanna-51436ee8078e6.jpg">https://assets.fanart.tv/fanart/music/73e5