INSERT INTO "music_artist" VALUES (282,'Алексей Воробьев','','Person','Alexey Vladimirovich Vorobyov (Russian: Алексей Владимирович Воробьёв; 19 January 1988) is a Russian singer and actor who performs both in Russian and English. For international purposes Vorobyov is also credited as Alex Sparrow, a translation of his Russian name. He is best known for appearing on the Russian version of The X Factor at the age of 17 in 2005. In 2006 Vorobyov was contracted by Universal Music Russia, and in December 2007 was appointed as a goodwill ambassador for Y-PEER, a youth-based initiative of the United Nations Population Fund. Vorobyov represented Russia in the Eurovision Song Contest 2011 in Germany. Alex was born on 19 January 1988 in Tula (Russian: Тула), RSFSR, Soviet Union. His father is Head of Security, and his mother is a housewife. Alex played football as a child and played for the local youth team in Tula. At first, he wanted to pursue a career in sports but later chose to pursue music as his profession. Alex studied the accordion at the College of Music.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/e18884d8-9ee4-4e24-9315-ac33e06a21d3/artistthumb/vorobyov-alexey-530e31ff64d85.jpg">https://assets.fanart.tv/fanart/music/e18884d8-9ee4-4e24-9315-ac33e06a21d3/artistthumb/vorobyov-alexey-530e31ff64d85.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/KsqZrctFwrXApcBT-l67auaLGNA=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2910948-1368233522-3288.jpeg.jpg">https://img.discogs.com/NsfDIAfwSFM0G9_TLyOOPzagAYs=/537x768/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2910948-1368233522-3288.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/yceR5iXq9GtK8A07pP57WSznDmw=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2910948-1368233689-8819.jpeg.jpg">https://img.discogs.com/Qz5J32gwIFAd5KNhk6PNNnlPbeE=/460x316/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2910948-1368233689-8819.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/nPUjE5B3qr8xxXPfCzQ2pQyAiBQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-2910948-1368233592-5013.jpeg.jpg">https://img.discogs.com/Hh45KIY9p9-gIZK-Ub8SlI75-2c=/364x273/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-2910948-1368233592-5013.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/e18884d8-9ee4-4e24-9315-ac33e06a21d3/artistbackground/vorobyov-alexey-530cf0cac4445.jpg">https://assets.fanart.tv/fanart/music/e18884d8-9ee4-4e24-9315-ac33e06a21d3/artistbackground/vorobyov-alexey-530cf0cac4445.jpg</thumb>','e18884d8-9ee4-4e24-9315-ac33e06a21d3');
INSERT INTO "music_artist" VALUES (283,'Дискотека Авария','','Group','Diskoteka "Avaria" (Russian: Дискотека "Авария" - Disco "Accident") are a Russian band from Ivanovo, Russia. The trio consists of Anna Khokhlova (Анна Хохлова), Aleksey Borisovich Serov (Алексей Борисович Серов) and Aleksey Olegovich Ryzhov (Алексей Олегович Рыжов). Its former members include vocalist Nikolay Stagoranovich Timofeev (Николай Стагоранович Тимофеев), who left in July 2012, and rapper Oleg Yevgenyevich Zhukov (Олег Евгеньевич Жуков), who died on February 9, 2002 of cancer.
INSERT INTO "music_artist" VALUES (284,'Звери','','Group','Zveri (Beasts; Russian: Звери) is a Russian pop rock band. Zveri was formed in mid 2002 by Roman Bilyk, the lead singer of the band, better known as Roma Zver''. 
INSERT INTO "music_artist" VALUES (285,'Мот','','Person','Мот - российский рэп-исполнитель,романтик, интеллектуал. Бывший участник музыкального проекта «Soul Kitchen», с 1 марта 2013 года артист лейбла «Black Star Inc.». INSERT INTO "music_artist" VALUES (286,'Timmy Trumpet','','Person','Timothy Jude Smith (born 9 June 1982), better known by his stage name Timmy Trumpet, is an Australian musician, DJ, songwriter and record producer. He has become known internationally for playing the trumpet live and making use of jazz elements in the realm of global dance music.
INSERT INTO "music_artist" VALUES (287,'Gang Up','','','','','e598d895-dc3f-4958-9c46-906eac9ad6e2');
INSERT INTO "music_artist" VALUES (288,'J. Balvin','','Person','José Álvaro Osorio Balvín (born May 7, 1985), better known as J Balvin, is a Colombian reggaeton singer. He has been referred to as the "Prince of Reggaeton" (from Spanish: "Príncipe del Reggaetón"), and is one of the best-selling Latin music artists with sales of more than 35 million records (albums and singles) worldwide. Balvin was born in Medellín, Colombia. At age 17, he moved to the United States to learn English, where he lived in both Oklahoma and New York. He then returned to Medellín and gained popularity performing at clubs in the city.
INSERT INTO "music_artist" VALUES (289,'Martin Garrix','','Person','Martijn Gerard Garritsen (Dutch: [mɑrˈtɛi̯n ɣəˈrɑrt ˈxɑrɪtsə(n)]; born 14 May 1996), professionally known as Martin Garrix and under other pseudonyms such as Ytram and GRX, is a Dutch DJ and record producer. His most known singles are "Animals", "In the Name of Love", and "Scared to Be Lonely". He was ranked number one on DJ Mag''s Top 100 DJs list for three consecutive years (2016, 2017, and 2018).
INSERT INTO "music_artist" VALUES (290,'Little Big','','Group','Little Big is a Russian rave band founded in 2013 in Saint Petersburg. The band consists of Ilya "Ilich" Prusikin, Sergey "Gokk" Makarov, Sonya Tayurskaya, and Anton "Boo" Lissov. Their first full-length album, With Russia from Love, was released on 17 March 2014. The group has released three albums and nine singles. The band made its debut on 1 April 2013, releasing their first video "Every Day I''m Drinking". They made their first public appearance on 2 July 2013 at the club A2, opening for Die Antwoord.They have toured in Europe, Russia, and North America. "This music is really in demand. We have not invested a single penny, just shot video, and became known in Europe", Ilya Prusikin said in an interview with UTV.On 19 December 2015, the band released their second album, Funeral Rave. It was 8th on the Russian iTunes chart for the 52nd week of 2015.On 21 May 2016, videos for the songs "Give Me Your Money" and "Big Dick" received a prize at the Berlin Music Video Awards 2016. "Big Dick" won Most Trashy, and "Give Me Your Money" won third place for Best Performer.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/cbe51088-e4d8-463e-9f4e-e83fa64d3f5e/artistthumb/little-big-585555fa1bf47.jpg">https://assets.fanart.tv/fanart/music/cbe51088-e4d8-463e-9f4e-e83fa64d3f5e/artistthumb/little-big-585555fa1bf47.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/P9JJaviUOeBp4xIM_rpb4T8FY-E=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4563408-1554157112-5240.jpeg.jpg">https://img.discogs.com/yC9_uKClvg8o-BLgG610vNuTUMA=/600x450/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4563408-1554157112-5240.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/qEnXxs9Gkubd228OixCTsAJJyNQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4563408-1443166285-3785.jpeg.jpg">https://img.discogs.com/C7RGUm4ODU07PDJEUDDSIzqfp34=/600x899/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4563408-1443166285-3785.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/XKIevSWAr1rVaQWDVEFmrZ4RSGc=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-4563408-1614650825-2684.jpeg.jpg">https://img.discogs.com/fSB86bEbBFWWZwdrFECy0O3mLrQ=/600x363/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-4563408-1614650825-2684.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="clearlogo" preview="https://assets.fanart.tv/preview/music/cbe51088-e4d8-463e-9f4e-e83fa64d3f5e/hdmusiclogo/little-big-58554b59cb309.png">https://assets.fanart.tv/fanart/music/cbe51088-e4d8-463e-9f4e-e83fa64d3f5e/hdmusiclogo/little-big-58554b59cb309.png</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/cbe51088-e4d8-463e-9f4e-e83fa64d3f5e/artistbackground/little-big-585479ab4e5df.jpg">https://assets.fanart.tv/fanart/music/cbe51088-e4d8-463e-9f4e-e83fa64d3f5e/artistbackground/little-big-585479ab4e5df.jpg</thumb><thumb spoof="" cache="" aspect="fanart" preview="https://assets.fanart.tv/preview/music/cbe51088-e4d8-463e-9f4e-e83fa64d3f5e/artistbackground/little-big-54f6b0e3a8fd4.jpg">https://assets.fanart.tv/fanart/music/cbe51088-e4d8-463e-9f4e-e83fa64d3f5e/artistbackground/little-big-54f6b0e3a8fd4.jpg</thumb>','cbe51088-e4d8-463e-9f4e-e83fa64d3f5e');
