INSERT INTO "music_artist" VALUES (292,'Twenty One Pilots','','Group','Twenty One Pilots (stylized in all lowercase or as twenty øne piløts) is an American musical duo from Columbus, Ohio. The band was formed in 2009 by lead vocalist Tyler Joseph along with Nick Thomas and Chris Salih, both of whom left in 2011. Since their departure, the line-up has consisted of Joseph and drummer Josh Dun. The duo is best known for the singles "Stressed Out", "Ride", and "Heathens". The group received a Grammy Award for Best Pop Duo/Group Performance at the 59th Annual Grammy Awards for "Stressed Out". The band independently released two albums, Twenty One Pilots (2009) and Regional at Best (2011), before being signed by record label Fueled by Ramen in 2012. Their label debut, Vessel, was released in 2013 and became the second album in history on which every track received at least a gold certification, making Twenty One Pilots the first band in the history of music to see every song on two albums earn gold or platinum awards.The duo achieved breakthrough success with their fourth album, Blurryface (2015), which produced the successful singles "Stressed Out" and "Ride" and became the first album in history on which every track received at least a gold certification from the Recording Industry Association of America. The release of the single "Heathens" also made the group the first alternative artist in history to have two concurrent top five singles in the Billboard Hot 100 and the third rock act in history to have two singles simultaneously chart in the top five of the Billboard Hot 100, joining the Beatles and Elvis Presley.The duo''s fifth studio album, Trench, was released on October 5, 2018. Their sixth studio album, Scaled and Icy, was released on May 21, 2021.
INSERT INTO "music_artist" VALUES (293,'Гари Кларк','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (294,'The Cranberries','','Group','The Cranberries were an Irish rock band formed in Limerick, Ireland. Originally named the Cranberry Saw Us, the band were formed in 1989 by lead singer Niall Quinn, guitarist Noel Hogan, bassist Mike Hogan, and drummer Fergal Lawler. Quinn was replaced as lead singer by Dolores O''Riordan in 1990, and they changed their name to the Cranberries. The band classified themselves as an alternative rock group, but incorporated aspects of indie rock, jangle pop, folk rock, post-punk, and pop rock into their sound.
INSERT INTO "music_artist" VALUES (295,'Martin Solveig','','Person','Martin Laurent Picandet (French pronunciation: ​[maʁtɛ̃ lɔʁɑ̃ pikɑ̃dɛ]; born 22 September 1976), better known by his stage name Martin Solveig (French: [maʁtɛ̃ sɔlvɛɡ]), is a French DJ, singer, songwriter and record producer. He hosts a weekly radio show called C''est La Vie on radio stations worldwide, including Radio FG in his homeland.
INSERT INTO "music_artist" VALUES (296,'Zivert','','Person','Yulia Zivert (Russian: Ю́лия Зи́верт, born November 28, 1990), better known by her stage name Zivert, is a Russian singer and model. Her career started in 2017 after releasing her first singles "Чак" and "Анестезия". She gained international fame in 2018 with her single "Life". Yulia Zivert was born on 28 November 1990 in Moscow. She described music as her childhood dream since she used to make home concerts almost every day.In 2017 Zivert signed with the Russian label First Music Publishing (FMP). Her debut single called "Чак", she presented in her YouTube channel on April 1, 2017. On 17 June she released the video clip of the song. Her second single "Анестезия", was released on 15 September, with video being released on 17 January 2018.On April 6, 2018 she presented her first mini album, called «Сияй». A total of 4 tracks were listed: "Еще хочу", "Зеленые волны", "Сияй" and "Океан".On March 12, 2019, a video for the song "Life", was presented on YouTube , by then already three and a half months had been popular on various digital platforms. The video was filmed in Hong Kong.','<thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/FCbhZ4rS0KQIFduHyd94eBfibL0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-6554641-1617808998-5149.jpeg.jpg">https://img.discogs.com/vXZ0N-CT4-jzjcIYVdKq29pxVgQ=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-6554641-1617808998-5149.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/GGxT9XZMyn4U-61FNHEdaPZb2Ig=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-6554641-1617808998-6808.jpeg.jpg">https://img.discogs.com/KCTHdRvU5VAm6xhV--Cx9t5t1bc=/600x900/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-6554641-1617808998-6808.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/5r7czvuZ-BNwFNCFI3seH9VGiF8=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-6554641-1617808998-9494.jpeg.jpg">https://img.discogs.com/YIVMluylEowvXBpMC3aIm1kIAvI=/600x600/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-6554641-1617808998-9494.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/BK9e64E-BzBpJacHHzZIF9tfJjQ=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-6554641-1617808998-8875.jpeg.jpg">https://img.discogs.com/zlgvDTqbY0RW6P4Ev459OOr4KzA=/600x635/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-6554641-1617808998-8875.jpeg.jpg</thumb>','225712aa-699f-4e77-8547-93dfcdfa5666');
INSERT INTO "music_artist" VALUES (297,'Nirvana','','Group','Nirvana was an American rock band formed in Aberdeen, Washington in 1987. Founded by lead singer and guitarist Kurt Cobain and bassist Krist Novoselic, the band went through a succession of drummers before recruiting Dave Grohl in 1990. Nirvana''s success popularized alternative rock, and they were often referenced as the figurehead band of Generation X. Their music maintains a popular following and continues to influence modern rock and roll culture.
INSERT INTO "music_artist" VALUES (298,'Destiny''s Child','','Group','Destiny''s Child was an American girl group whose final and best-known lineup comprised Beyoncé Knowles, Kelly Rowland, and Michelle Williams. The group began their musical career as Girl''s Tyme, formed in 1990 in Houston, Texas. After years of limited success, the quartet comprising Knowles, Rowland, LaTavia Roberson, and LeToya Luckett were signed in 1997 to Columbia Records as Destiny''s Child. The group was launched into mainstream recognition following the release of the song "No, No, No" and their best-selling second album, The Writing''s on the Wall (1999), which contained the number-one singles "Bills, Bills, Bills" and "Say My Name". Despite critical and commercial success, the group was plagued by internal conflict and legal turmoil, as Roberson and Luckett attempted to split from the group''s manager Mathew Knowles, citing favoritism of Knowles and Rowland.
INSERT INTO "music_artist" VALUES (299,'P!nk, Pink','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (300,'System of a Down','','Group','System of a Down (also known as SoaD or simply System) is an Armenian-American heavy metal band formed in Glendale, California, in 1994. It currently consists of members Serj Tankian (lead vocals, keyboards), Daron Malakian (guitar, vocals), Shavo Odadjian (bass, backing vocals), and John Dolmayan (drums), who replaced original drummer Andy Khachaturian in 1997.The band achieved commercial success with the release of five studio albums, three of which debuted at number one on the US Billboard 200. System of a Down has been nominated for four Grammy Awards and their song "B.Y.O.B." won a Grammy Award for Best Hard Rock Performance in 2006. The band went on hiatus in 2006 and reunited in 2010. Other than two new songs in 2020 ("Protect the Land" and "Genocidal Humanoidz"), System of a Down has not released a full-length record since the Mezmerize and Hypnotize albums in 2005. The band has sold over 40 million records worldwide, while two of their singles "Aerials" and "Hypnotize" reached number one on Billboard''s Alternative Songs chart. 
INSERT INTO "music_artist" VALUES (301,'Ôðàíöóçñêèé ðåï','',NULL,NULL,NULL,NULL);
INSERT INTO "music_artist" VALUES (302,'Benny Benassi','','Person','Marco "Benny" Benassi (Italian pronunciation: [ˈmarko ˈbɛnassi]; born 13 July 1967) is an Italian DJ, record producer and remixer. He is widely seen as a pioneer of electro house, a genre brought into the mainstream by his 2002 summer club hit "Satisfaction".He started his career as DJ along with his cousin Alessandro "Alle" Benassi, forming the electronica duo Benassi Bros. Although he began to gain popularity with his pseudonym in 1997 by releasing the song "Electric Flying", his first international hit was "I Feel So Fine", launched in 2001 under the nickname KMC.
INSERT INTO "music_artist" VALUES (303,'Jason Derulo','','Person','Jason Joel Desrouleaux (born September 21, 1989), better known by his stage name Jason Derulo (; formerly stylised as Derülo), is an American singer, songwriter, and dancer. Since the start of his solo recording career in 2009, Derulo has sold over 30 million singles and has achieved eleven Platinum singles including "Wiggle", "Talk Dirty", "Want to Want Me", "Trumpets", "It Girl", "In My Head", "Ridin'' Solo", and "Whatcha Say".After contributing and writing songs for various artists, Derulo signed to recording label Beluga Heights, owned by industry veteran J. R. Rotem. After Beluga Heights became part of the Warner Music Group, Derulo became a recording artist and released his debut single "Whatcha Say" in May 2009. It sold over five million digital downloads, gaining an RIAA certification of triple Platinum, and reaching number 1 in the U.S. and New Zealand.
INSERT INTO "music_artist" VALUES (304,'A$ton Wyld','','Person','','','6572df3b-3010-4dab-937d-ed788edaec2b');
INSERT INTO "music_artist" VALUES (305,'Eminem','','Person','Marshall Bruce Mathers III (born October 17, 1972), known professionally as Eminem (; often stylized as EMINƎM), is an American rapper, songwriter, actor, and record producer. Eminem is among the best-selling music artists of all time, with estimated worldwide sales of more than 220 million records. He is credited with popularizing hip hop in Middle America and is critically acclaimed as one of the greatest rappers of all time.Eminem''s global success and acclaimed works are widely regarded as having broken racial barriers for the acceptance of white rappers in popular music. While much of his transgressive work during the early 2000s made him hugely controversial, he came to be a representation of popular angst of the American underclass. He has been influential for many artists of various genres. After his debut album Infinite (1996) and the extended play Slim Shady EP (1997), Eminem signed with Dr. Dre''s Aftermath Entertainment and subsequently achieved mainstream popularity in 1999 with The Slim Shady LP. His next two releases The Marshall Mathers LP (2000) and The Eminem Show (2002) were worldwide successes and were both nominated for the Grammy Award for Album of the Year. After the release of his next album, Encore (2004), Eminem went on hiatus in 2005 partly due to a prescription drug addiction. He returned to the music industry four years later with the release of Relapse (2009), and Recovery was released the following year. Recovery was the best-selling album worldwide of 2010, making it Eminem''s second album, after The Eminem Show in 2002, to be the best-selling album of the year worldwide.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/b95ce3ff-3d05-4e87-9e01-c97b66af13d4/artistthumb/eminem-5599461859922.jpg">https://assets.fanart.tv/fanart/music/b95ce3ff-3d05-4e87-9e01-c97b66af13d4/artistthumb/eminem-5599461859922.jpg</thumb><thumb spoof="" cache=""