INSERT INTO "music_artist" VALUES (309,'Lil Jon','','Person','Jonathan H. Smith (born January 17, 1971), better known by his stage name Lil Jon, is an American rapper, songwriter, DJ, and record producer. He was the frontman of the multi-platinum selling rap group Lil Jon & The East Side Boyz and was instrumental in the emergence of the hip/hop subgenre crunk. He is credited with bringing the genre into mainstream success, producing Top 10 Billboard Hot 100 singles "Get Low," "Goodies," "Cyclone," "Freek-a-Leek," and "Yeah!". "Yeah!" won a Grammy Award for Best Rap/Sung Performance. Lil Jon is also a frequent collaborator with friend and fellow rapper Pitbull. In 2013, Lil Jon collaborated with DJ Snake and released the electronic dance music multi-platinum hit, "Turn Down for What," that won Billboard Music Award for Top Dance/Electronic Song. The music video for the single, released in 2014, was nominated for a Grammy Award for Best Music Video, and has been viewed over 900 million times on YouTube as of October 2019. As of 2016, Lil Jon is listed as one of the Top Billboard Music Award Winners of All Time. In 2019, Lil Jon achieved his 8th #1 on Billboard’s Rhythmic Chart as a songwriter on the song "My Type" by Sacramento rapper Saweetie. Jonathan H. Smith was born in Atlanta, Georgia and grew up in a middle-class Southwest Atlanta neighborhood.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/a95384b1-6aec-468c-ae0d-8c6daf87c4c2/artistthumb/lil-jon-5216212f5b79d.jpg">https://assets.fanart.tv/fanart/music/a95384b1-6aec-468c-ae0d-8c6daf87c4c2/artistthumb/lil-jon-5216212f5b79d.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/cW4qFwZCQUs2WV_wfFa62zjfWok=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-215828-1512508782-3442.jpeg.jpg">https://img.discogs.com/XSu115R7gtPyPdVzXjHKh4tERI4=/600x567/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(9