INSERT INTO "music_artist" VALUES (317,'Don Omar','','Person','William Omar Landrón Rivera (born February 10, 1978), better known by his stage name Don Omar, is a Puerto Rican reggaeton singer, rapper, record producer and actor. He is sometimes referred to by his nicknames El Rey, and King of Kings (of reggaeton music). On September 1, 2017, he announced that he would retire after a series of concerts at the José Miguel Agrelot Coliseum in Puerto Rico, scheduled to be held on December 15, 16 and 17. He returned to music on April 20, 2019 with his song "Single Ramayama" featuring Farruko. Don Omar was born in Santurce, a barrio of San Juan, Puerto Rico, where he was raised, the oldest son of William Landrón and Luz Antonia Rivera. From an early age, he showed interest in the music of Vico C and Brewley MC. During his youth, he became an active member of a Protestant church, Iglesia Evangélica Restauración en Cristo in Bayamón where he occasionally offered sermons. However, after four years, he left the church to dedicate himself to singing. His first public performance in a night club was accompanied by disc jockey Eliel Lind Osorio. Afterwards he appeared regularly on compilation albums from popular DJs and producers including Luny Tunes, Noriega, and DJ Eric. He also worked as a backup singer for the duo Héctor & Tito.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/afbdfac9-2955-4404-ae22-c08bf1c1b51e/artistthumb/omar-don-53af3bb3255c7.jpg">https://assets.fanart.tv/fanart/music/afbdfac9-2955-4404-ae22-c08bf1c1b51e/artistthumb/omar-don-53af3bb3255c7.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/afbdfac9-2955-4404-ae22-c08bf1c1b51e/artistthumb/omar-don-53af3bdba5ffc.jpg">https://assets.fanart.tv/fanart/music/afbdfac9-2955-4404-ae22-c08bf1c1b51e/artistthumb/omar-don-53af3bdba5ffc.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/mu