INSERT INTO "music_artist" VALUES (318,'Lucenzo','','Person','Luís Filipe Fraga Oliveira (European Portuguese: [luˈiʃ fɨˈlip(ɨ) ˈfɾaɣɐ ɔliˈvɐjɾɐ]; born 27 May 1983), better known by his stage name Lucenzo, is a Portuguese–French reggaeton recording artist and record producer. His parents emigrated to France, from Portugal. Lucenzo signed with the Universal Music record label. He is best known for his dance hit with rapper Big Ali, "Vem dançar Kuduro". Puerto Rican reggaeton artist Don Omar released a Spanish/Portuguese version of the song under the title "Danza Kuduro" with Lucenzo. Lucenzo released his debut single in 2008, a Portuguese/multilingual reggae/reggaeton song entitled "Emigrante del mundo". Signed to Scopio Music, the song became a Portuguese radio hit.  It was followed in 2009 by "Dame reggaeton". But it was with his bilingual English/Portuguese dance hit "Vem Dançar Kuduro" in collaboration with Big Ali produced by Lucenzo. It was a Top 40 hit in Switzerland, reaching #31.','<thumb spoof="" cache="" aspect="thumb" preview="https://assets.fanart.tv/preview/music/9d93fcb8-f66a-4576-9bdc-04dd4a1b27c6/artistthumb/lucenzo-54d74d3728586.jpg">https://assets.fanart.tv/fanart/music/9d93fcb8-f66a-4576-9bdc-04dd4a1b27c6/artistthumb/lucenzo-54d74d3728586.jpg</thumb><thumb spoof="" cache="" aspect="thumb" preview="https://img.discogs.com/DNpVuXAW2N7NnTs1Sv2pwnatsg0=/150x150/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(40)/discogs-images/A-1830531-1292531822.jpeg.jpg">https://img.discogs.com/XvWfxCh_PWoWTSHHi9Bq-hnXH64=/436x327/smart/filters:strip_icc():format(jpeg):mode_rgb():quality(90)/discogs-images/A-1830531-1292531822.jpeg.jpg</thumb><thumb spoof="" cache="" aspect="banner" preview="https://assets.fanart.tv/preview/music/9d93fcb8-f66a-4576-9bdc-04dd4a1b27c6/musicbanner/lucenzo-54d88da7b765e.jpg">https://assets.fanart.tv/fanart/music/9d93fcb8-f66a-4576-9bdc-04dd4a1b27c6/musicbanner/lucenzo-54d88da7b765e.jpg</thumb><thumb spoof="" cache="" aspect="